14434=>["Value"=>14434,"TextKey"=>"图鉴描述10506","TextValue"=>"有着让闻者落泪的心酸往事，但磨难不但让她变得更强大，她还学会了一种让火光中幻影成真的神秘魔法。"],
14435=>["Value"=>14435,"TextKey"=>"图鉴描述10507","TextValue"=>"一个有点吝啬的顽皮鬼。曾因捉弄巫婆而被诅咒失去了原本的身体。但成为南瓜头的他变得乐于助人，经常手举灯笼为路人在黑暗中照明。"],
14436=>["Value"=>14436,"TextKey"=>"图鉴描述10508","TextValue"=>"美味的食物和功夫梦，这就是它生活的全部。天天百无禁忌地做着白日梦，梦想着自己有一天能够在功夫的世界里与最强者进行一场巅峰之战。"],
