15858=>["Value"=>15858,"TextKey"=>"新手引导说明2032","TextValue"=>"这片土地失去了与<color=#f58c26>创世女神</color>的联系，陷入了沉睡。"],
15859=>["Value"=>15859,"TextKey"=>"新手引导说明2033","TextValue"=>"你无法移动在<color=#38aec0>沉睡之地</color>上的任何东西！"],
15860=>["Value"=>15860,"TextKey"=>"新手引导说明2034","TextValue"=>"合并任意的<color=#38c0a5>灵花</color>来唤醒土地。"],
