15876=>["Value"=>15876,"TextKey"=>"新手引导说明2150","TextValue"=>"部落成员可以从更高级的<color=#38c0a5>藤蔓</color>处采集到<color=#38c0a5>原石矿</color>，您可以点击来收集。"],
15877=>["Value"=>15877,"TextKey"=>"新手引导说明2160","TextValue"=>"这是一个<color=#ef933d>破碎墓碑</color>。如果放任它们不管或合并，它们会变化为恐怖的僵尸。击杀僵尸后，会获得<color=#38c0a5>萤火虫</color>道具，也就是通过本关必需的道具。"],
15878=>["Value"=>15878,"TextKey"=>"新手引导说明2170","TextValue"=>"<color=#ef933d>荒废的壁巢</color>会持续不断地产生僵尸，无论其是否处于唤醒状态。点击它会立即产生一只僵尸。破坏<color=#ef933d>荒废的壁巢</color>之后，会获得大量的原石矿奖励。"],
15879=>["Value"=>15879,"TextKey"=>"新手引导说明2180","TextValue"=>"这是一个<color=#ef933d>德鲁伊符文阵</color>，运气真好！合并它们，可以从营地里随机召唤一个<color=#38c0a5>部落成员<color=#38c0a5>来帮忙。"],
15880=>["Value"=>15880,"TextKey"=>"新手引导说明2190","TextValue"=>"创世神树遗留的圣物，它们可以自动生成<color=#38c0a5>大地灵球</color>唤醒土地。创世神树遗留的圣物等级越高，治愈能力越强。"],
15881=>["Value"=>15881,"TextKey"=>"新手引导说明2200","TextValue"=>"这里会不断出现<color=#ef933d>荒野云朵</color>，点击它们，使它们持续下雨。下雨范围内的空白土地，会持续产生<color=#38c0a5>水坑</color>和<color=#38c0a5>灵花</color>。"],
15882=>["Value"=>15882,"TextKey"=>"新手引导说明2210","TextValue"=>"奇怪，<color=#ef933d>创世少女像</color>去哪里了？"],
15883=>["Value"=>15883,"TextKey"=>"新手引导说明2211","TextValue"=>"哦对了，如果你完成任务，她们就会出现！"],
15884=>["Value"=>15884,"TextKey"=>"新手引导说明2220","TextValue"=>"这是<color=#ef933d>魔神雕像</color>，丑陋的东西！命令你的部落成员消灭它，会获得<color=#ef933d>创世少女像</color>。"],
15885=>["Value"=>15885,"TextKey"=>"新手引导说明2230","TextValue"=>"有新的营地被开启，快去<color=#f58c26>世界地图</color>里看一下吧"],
15886=>["Value"=>15886,"TextKey"=>"新手引导说明2240","TextValue"=>"我重获自由啦，谢谢。"],
15887=>["Value"=>15887,"TextKey"=>"新手引导说明2241","TextValue"=>"我们的族员都被禁锢在这些<color=#38c0a5>图腾</color>中了。"],
