16006=>["Value"=>16006,"TextKey"=>"新手引导说明2542","TextValue"=>"哇，你解救了第一个英雄——<color=#df66a8>奥罗拉</color>！<color=#df66a8>奥罗拉</color>带来了美食订单，点击来看看吧。"],
16007=>["Value"=>16007,"TextKey"=>"新手引导说明2543","TextValue"=>"恭喜你获得了农作物<color=#ef933d>小麦</color>，英雄制作订单必不可少的哦。点击<color=#ef933d>小麦</color>进行收集！"],
16008=>["Value"=>16008,"TextKey"=>"新手引导说明2544","TextValue"=>"<color=#38c0a5>魔法书</color>帮助你驱逐云雾，解救更多的英雄。你可以通过完成订单，获得<color=#38c0a5>魔法书</color>。"],
16009=>["Value"=>16009,"TextKey"=>"新手引导说明2631","TextValue"=>"我迷失在雾中了！首先，<color=#ef933d>合并</color>3个公主裙来帮我！"],
16010=>["Value"=>16010,"TextKey"=>"新手引导说明2633","TextValue"=>"嘿！我是奥罗拉，看来是你帮我指了路，我才能回到罗尔镇！"],
16011=>["Value"=>16011,"TextKey"=>"新手引导说明2636","TextValue"=>"通过<color=#ef933d>3合1</color>或者更多<color=#ef933d>相同元素</color>的合并，解锁<color=#ef933d>新的</color>角色，迷雾区域和其他有趣的内容。"],
