16796=>["Value"=>16796,"TextKey"=>"攻击过程文字1028","TextValue"=>"走吧。"],
16797=>["Value"=>16797,"TextKey"=>"攻击过程文字1029","TextValue"=>"你赢不了部落"],
16798=>["Value"=>16798,"TextKey"=>"攻击过程文字1030","TextValue"=>"接受制裁"],
16799=>["Value"=>16799,"TextKey"=>"攻击过程文字1031","TextValue"=>"嘿呀~"],
16800=>["Value"=>16800,"TextKey"=>"攻击过程文字1032","TextValue"=>"恐惧我吧！"],
16801=>["Value"=>16801,"TextKey"=>"攻击过程文字1033","TextValue"=>"认输吧！"],
16802=>["Value"=>16802,"TextKey"=>"攻击过程文字1034","TextValue"=>"去死"],
16803=>["Value"=>16803,"TextKey"=>"攻击过程文字1035","TextValue"=>"在风暴中消失吧。"],
16804=>["Value"=>16804,"TextKey"=>"攻击过程文字1036","TextValue"=>"在闪电中消失。"],
16805=>["Value"=>16805,"TextKey"=>"攻击过程文字1037","TextValue"=>"尝尝这个派对组合拳！"],
16806=>["Value"=>16806,"TextKey"=>"攻击过程文字1038","TextValue"=>"离开！"],
16807=>["Value"=>16807,"TextKey"=>"攻击过程文字1039","TextValue"=>"要保护家园！"],
16808=>["Value"=>16808,"TextKey"=>"天气雷名称100001","TextValue"=>"雷电"],
16809=>["Value"=>16809,"TextKey"=>"天气雷描述100001","TextValue"=>"把雷电放置到物品上可以吸附与之相同的物品到身边。"],
16810=>["Value"=>16810,"TextKey"=>"剧情ID1010101","TextValue"=>"早上好呀，酋长！我是特里斯坦，您忠诚的侦察兵！旅途艰险，但我们都活下来了，真是太好啦！终于找到陆地了，现在我们可以建个<color=#f58c26>营地</color>了。"],
16811=>["Value"=>16811,"TextKey"=>"剧情ID1010102","TextValue"=>"这真是郁郁葱葱！不知道我们在这儿会碰见什么呢？我们先来搭个帐篷为我们遮风挡雨吧！"],
16812=>["Value"=>16812,"TextKey"=>"剧情ID1010201","TextValue"=>"我的神啊，这都是啥啊……这贫瘠的丑陋土地……还有这个丑陋的帐篷！我好想家……"],
16813=>["Value"=>16813,"TextKey"=>"剧情ID1010202","TextValue"=>"恩达，我知道对于你来说，离开家不是件简单事，但是除此之外别无他法。那些自然灾害实在是太奇怪了……我们必须得找到解释！这就是我们要出来寻求帮助的原因。"],
16814=>["Value"=>16814,"TextKey"=>"剧情ID1010203","TextValue"=>"但是我们会找到回家的方法的，好吗？我们先给你建一个<color=#f58c26>祭坛</color>好让你跟神聊聊天，怎么样，祭司恩达？酋长会帮忙的！"],
16815=>["Value"=>16815,"TextKey"=>"剧情ID1020101","TextValue"=>"看看我们找到了什么！<color=#ef933d>大地遗产</color>！这样我们建造<color=#f58c26>祭坛</color>所需的材料就全准备好了。我们还找到了解开图腾封印的方法！这地方是个福地啊！"],
16816=>["Value"=>16816,"TextKey"=>"剧情ID1020201","TextValue"=>"我猜你也不是个完全的废物……叫什么，斯坦，的家伙。虽然这个祭坛比我家里那个小多了，一点也不气势恢宏，但是现在是够用了。现在，到一边去！"],
16817=>["Value"=>16817,"TextKey"=>"剧情ID1020202","TextValue"=>"啊呀~真可爱~看她多高兴啊！还有她那非常扭曲的道谢的方式！"],
16818=>["Value"=>16818,"TextKey"=>"剧情ID1020203","TextValue"=>"（跳了一支奇怪的舞）我们的神对我说，我们所在之处是正确的，接着我们会遇见一位贵人……"],
16819=>["Value"=>16819,"TextKey"=>"剧情ID1020204","TextValue"=>"真的吗？那真是惊天好消息！我们什么时候能遇见这位贵人呢？"],
16820=>["Value"=>16820,"TextKey"=>"剧情ID1020301","TextValue"=>"是你们这些顽徒将我从睡梦中惊醒了吗？！"],
16821=>["Value"=>16821,"TextKey"=>"剧情ID1020302","TextValue"=>"……您是？"],
16822=>["Value"=>16822,"TextKey"=>"剧情ID1020303","TextValue"=>"我是大德鲁伊、吟游诗人之祖、风暴的征服者、冒险者的守护神、神的行刑官兼信使、公正的大法官，歌唱的阿梅金！"],
16823=>["Value"=>16823,"TextKey"=>"剧情ID1020304","TextValue"=>"额……很高兴认识你，我猜？我们是新来的，然后我们刚刚听说……"],
16824=>["Value"=>16824,"TextKey"=>"剧情ID1020305","TextValue"=>"什么？！你们是外来侵略者？！我不会给你们毁坏家园、破坏家庭的机会！"],
16825=>["Value"=>16825,"TextKey"=>"剧情ID1020401","TextValue"=>"什么？不，不是！我们不是侵略者！我们只是在找地方歇脚，顺便解决一下我们家园的谜团……"],
16826=>["Value"=>16826,"TextKey"=>"剧情ID1020402","TextValue"=>"不！桥！看你干的好事！神会发怒的！等等……你说你是谁？阿梅金？大德鲁伊阿梅金？传说里的那个？"],
16827=>["Value"=>16827,"TextKey"=>"剧情ID1020403","TextValue"=>"你们……不是侵略者？那你们是谁？你们在这里做什么？等等……我在这里做什么？这是哪儿？我的人民呢？我对这里毫无印象……"],
16828=>["Value"=>16828,"TextKey"=>"剧情ID1020404","TextValue"=>"对不起，但是我们也回答不了你这些问题。我们冒着生命危险远道而来，为了寻找能帮我们解决家园谜团的能手。一团浓重的迷雾笼罩着我们的家园，接着……"],
16829=>["Value"=>16829,"TextKey"=>"剧情ID1020405","TextValue"=>"去年一年发过的洪水比过去十年的都多。但是最奇怪的是，我们的族员一个个都变成了没有生命的图腾！你能信吗？！"],
16830=>["Value"=>16830,"TextKey"=>"剧情ID1020406","TextValue"=>"噢……这信息量有点大。对不起我刚才过于鲁莽了，毁了你们的桥。也许我能帮你们把它重新建起来？"],
16831=>["Value"=>16831,"TextKey"=>"剧情ID1020407","TextValue"=>"阿梅金？！伟大的阿梅金？！你的长袍、你能呼风唤雨的能力……你是真的！那就是说我家族的藏书里所有的传说都是真的！"],
16832=>["Value"=>16832,"TextKey"=>"剧情ID1020408","TextValue"=>"工人们，振作起来重建那座桥！"],
16833=>["Value"=>16833,"TextKey"=>"剧情ID1020409","TextValue"=>"但是我们受伤了！我们现在没法干活！"],
16834=>["Value"=>16834,"TextKey"=>"剧情ID1020410","TextValue"=>"我知道你们需要什么。在我漫长的旅行生涯中我学到了很多关于草药的知识。我们收集一些药草，然后在这里建一个<color=#f58c26>药草园</color>。就当做我向你们道歉了。"],
16835=>["Value"=>16835,"TextKey"=>"剧情ID1020411","TextValue"=>"谢谢！你真厚道。我们一会儿会用我们新学到的知识回家园解救那些困在图腾中的人民！太好了，出发！"],
16836=>["Value"=>16836,"TextKey"=>"剧情ID1030101","TextValue"=>"我们回来了，我们还带了新帮手！来把这座<color=#f58c26>小药草园</color>建起来吧！"],
16837=>["Value"=>16837,"TextKey"=>"剧情ID1030201","TextValue"=>"哇，不得不说你的建造技术还真不错！这个小花园真漂亮。"],
16838=>["Value"=>16838,"TextKey"=>"剧情ID1030202","TextValue"=>"而且很有用！现在工人们的伤都治好了，我们马上就可以重建那座桥了！"],
16839=>["Value"=>16839,"TextKey"=>"剧情ID1030203","TextValue"=>"很高兴能帮忙。"],
16840=>["Value"=>16840,"TextKey"=>"剧情ID1030204","TextValue"=>"说起来，祭司刚才还在夸奖您的美德和渊博的学识。我其实是在说……"],
16841=>["Value"=>16841,"TextKey"=>"剧情ID1030205","TextValue"=>"像您这样经验丰富的冒险家能加入我们，会是我们莫大的荣幸。但是您是一个传奇！您不可能随随便便地就跟一些奇怪的陌生人走了！您可能吗？求求您了，和我们一起走吧！"],
16842=>["Value"=>16842,"TextKey"=>"剧情ID1030206","TextValue"=>"好啊。也许这就是我被派来这里的原因。"],
16843=>["Value"=>16843,"TextKey"=>"剧情ID1030207","TextValue"=>"我就知道，您不会愿意……什么！您要和我们来？！天哪，难以置信……今天是我这辈子最棒的一天！"],
16844=>["Value"=>16844,"TextKey"=>"剧情ID1030208","TextValue"=>"对不起，她有时候会比较激动。现在既然您加入了我们的队伍，我们何不为您举行一场欢迎派对呢？"],
16845=>["Value"=>16845,"TextKey"=>"剧情ID1030209","TextValue"=>"不必了，没有派对我也挺好的。现在我手上有更紧要的事情要做。我要找些木头来，把那座我毁掉的桥重新建起来。"],
16846=>["Value"=>16846,"TextKey"=>"剧情ID1030210","TextValue"=>"多么高尚的人啊！噢！光是得以与他见面……这就是我生命中最棒的一天！"],
16847=>["Value"=>16847,"TextKey"=>"剧情ID1040101","TextValue"=>"你是……酋长，对吧？刚才你帮了我大忙了，谢谢。现在我们准备好要建桥了。"],
16848=>["Value"=>16848,"TextKey"=>"剧情ID1040201","TextValue"=>"就像新的一样！现在，祭司恩达，你准备好和神再聊次天了吗？"],
16849=>["Value"=>16849,"TextKey"=>"剧情ID1040202","TextValue"=>"从来没准备得这么好过！"],
16850=>["Value"=>16850,"TextKey"=>"剧情ID1040301","TextValue"=>"好的，酋长，现在祭司和她亲爱的祭坛重逢了，我们可以干点活……"],
16851=>["Value"=>16851,"TextKey"=>"剧情ID1040401","TextValue"=>"唉哟！什么东西绊了我？哈，一块从<color=#f58c26>祭坛</color>上掉下来的<color=#38c0a5>原石</color>。你们这些人干活真不小心。"],
16852=>["Value"=>16852,"TextKey"=>"剧情ID1040402","TextValue"=>"啊哈！我知道了！我们需要建一个用来储存各种资源的<color=#f58c26>仓库</color>。这样大家就不会被地上散落的各种东西绊倒了。"],
16853=>["Value"=>16853,"TextKey"=>"剧情ID1050101","TextValue"=>"东西都准备好了吗？我们来狂欢吧！抱歉，我是说，建<color=#f58c26>仓库</color>。"],
16854=>["Value"=>16854,"TextKey"=>"剧情ID1050201","TextValue"=>"坚实的墙壁，宽阔而明亮的室内空间……酋长的建造技能日益精进呀！"],
16855=>["Value"=>16855,"TextKey"=>"剧情ID1050202","TextValue"=>"啊，长官？你身后有一个八条腿的东西。"],
16856=>["Value"=>16856,"TextKey"=>"剧情ID1050301","TextValue"=>"什么？！怎么会？！这是什么东西？！它看起来像是某种水生动物的尸体……嗯，它的皮肤又滑又富有弹性。"],
16857=>["Value"=>16857,"TextKey"=>"剧情ID1050302","TextValue"=>"<color=#f58c26>北海巨妖</color>！它是<color=#f58c26>北海巨妖</color>！！我在书里读到过，这一定是那种怪物的幼崽！为什么这儿会有一只<color=#f58c26>北海巨妖</color>？！"],
16858=>["Value"=>16858,"TextKey"=>"剧情ID1050303","TextValue"=>"不用害怕，首先它肯定是死了，其次这只是一只<color=#f58c26>章鱼</color>而已。"],
16859=>["Value"=>16859,"TextKey"=>"剧情ID1050304","TextValue"=>"章鱼？从来没听说过……"],
16860=>["Value"=>16860,"TextKey"=>"剧情ID1050305","TextValue"=>"那么你们一定是从内陆来的。我的民族是一个航海的民族。我们以海为生。章鱼对我们来说就如夜空中的星星一般普遍。"],
16861=>["Value"=>16861,"TextKey"=>"剧情ID1050306","TextValue"=>"其实，跟我来，我们来找些绳子和树枝。让你们看看怎么用章鱼皮搭个帐篷。"],
16862=>["Value"=>16862,"TextKey"=>"剧情ID1060101","TextValue"=>"……然后……就，搭好了。我想象中的它没这么丑。"],
16863=>["Value"=>16863,"TextKey"=>"剧情ID1060102","TextValue"=>"它真……真……可爱！"],
16864=>["Value"=>16864,"TextKey"=>"剧情ID1060103","TextValue"=>"对不起，比起实际操作来，我还是更擅长理论。建造……并不是我擅长的。现在……我可能需要躺一会儿……"],
16865=>["Value"=>16865,"TextKey"=>"剧情ID1060104","TextValue"=>"噢伟大的阿梅金！您为何不随我到我们的主帐篷去休息一下呢？您向我传授了您的智慧，而我会永远做您虔诚的侍者……"],
16866=>["Value"=>16866,"TextKey"=>"剧情ID1060201","TextValue"=>"对于祭司来说这肯定就像美梦成真一样。他们两个关系很好我很高兴。但是，事情有点不对劲，不是吗，酋长？"],
16867=>["Value"=>16867,"TextKey"=>"剧情ID1060202","TextValue"=>"部落的长者们都说去找所谓的海的人没有一个回来的，哦除了那个回来之后成了个疯子的，嘴里念叨着什么在世界的尽头有一堵水造的高墙。"],
16868=>["Value"=>16868,"TextKey"=>"剧情ID1060203","TextValue"=>"但是那个阿梅金说他们是海上的民族！没人住在海上！"],
16869=>["Value"=>16869,"TextKey"=>"剧情ID1060204","TextValue"=>"就这就是为什么事情有些蹊跷。但是他目前也没害我们，我们就先不管他了，去完成自己的工作吧。"],
16870=>["Value"=>16870,"TextKey"=>"剧情ID1060205","TextValue"=>"您现在已经探索了很大一片区域了，我们获得的大量战利品已经要把营地塞满了。牲畜可以帮我们把它们运回家园。为了它们的舒适，我们应该给它们建造一个<color=#f58c26>牲畜棚</color>。"],
16871=>["Value"=>16871,"TextKey"=>"剧情ID1070101","TextValue"=>"看起来不错，酋长！看起来这些小家伙们很快就能派上用场，太棒啦！"],
16872=>["Value"=>16872,"TextKey"=>"剧情ID1070102","TextValue"=>"我们的建设工作马上就要完成了，只是我这里还有一个忙需要您帮。"],
16873=>["Value"=>16873,"TextKey"=>"剧情ID1070103","TextValue"=>"以防万一有图谋不轨之徒在咱们离开营地之后摧毁我们的劳动成果，我们需要一支专业的斥候小队来在周围巡逻。"],
16874=>["Value"=>16874,"TextKey"=>"剧情ID1070104","TextValue"=>"我们需要为他们建一个<color=#f58c26>训练场</color>！"],
16875=>["Value"=>16875,"TextKey"=>"剧情ID1070105","TextValue"=>"说对了凯文，一个<color=#f58c26>训练场</color>！我们去寻找材料吧！"],
16876=>["Value"=>16876,"TextKey"=>"剧情ID1080101","TextValue"=>"准备好了吗？"],
16877=>["Value"=>16877,"TextKey"=>"剧情ID1080102","TextValue"=>"准备好了长官！"],
16878=>["Value"=>16878,"TextKey"=>"剧情ID1080103","TextValue"=>"酋长已经准备好了材料，就等咱们开工啦！"],
16879=>["Value"=>16879,"TextKey"=>"剧情ID1080104","TextValue"=>"好的长官，没问题长官！"],
16880=>["Value"=>16880,"TextKey"=>"剧情ID1080201","TextValue"=>"干得漂亮！然后现在我们……祭司？有什么不对吗？"],
16881=>["Value"=>16881,"TextKey"=>"剧情ID1080301","TextValue"=>"我刚才在跟大德鲁伊阿梅金先生说话，接着我们都因为太累了而陷入了梦乡。接着我们都梦见了同一个梦，梦里一个女神跟我们说“救救<color=#f58c26>海洋之心</color>……”"],
16882=>["Value"=>16882,"TextKey"=>"剧情ID1080302","TextValue"=>"<color=#f58c26>海洋之心</color>？那是什么？"],
16883=>["Value"=>16883,"TextKey"=>"剧情ID1080303","TextValue"=>"我的民族有一个传说，说是深海中有一个巨大的气泡，被那位最年幼的女神所庇佑着。气泡中不光古老的动物存活了下来，巨人和精灵也生活在其中。但是这只是个哄小孩的睡前故事罢了。"],
16884=>["Value"=>16884,"TextKey"=>"剧情ID1080304","TextValue"=>"我必须把这事研究明白。为了能把女神的信息听得更清楚，我需要一个<color=#f58c26>强大符文底座</color>。"],
16885=>["Value"=>16885,"TextKey"=>"剧情ID1080305","TextValue"=>"收到！好的，酋长，咱们去找一些原石来，把那个底座给恩达建起来吧！"],
16886=>["Value"=>16886,"TextKey"=>"剧情ID1090101","TextValue"=>"马上就能收工了，是时候庆祝一下了！"],
16887=>["Value"=>16887,"TextKey"=>"剧情ID1090102","TextValue"=>"太棒啦！"],
16888=>["Value"=>16888,"TextKey"=>"剧情ID1090201","TextValue"=>"先别庆祝呢！你们这么闹腾我根本没法集中注意力！"],
16889=>["Value"=>16889,"TextKey"=>"剧情ID1090202","TextValue"=>"我正在尝试和神建立联系，结果被你们这群小屁孩给毁了！"],
16890=>["Value"=>16890,"TextKey"=>"剧情ID1090203","TextValue"=>"闭上你们的嘴然后让我好好工作！"],
16891=>["Value"=>16891,"TextKey"=>"剧情ID1090204","TextValue"=>"诶哟，看起来某人心情不太好的样子。"],
16892=>["Value"=>16892,"TextKey"=>"剧情ID1090205","TextValue"=>"等等！安静！我觉得我好像能听见她的声音了。这事很重要。"],
16893=>["Value"=>16893,"TextKey"=>"剧情ID1090206","TextValue"=>"嗯……我听不太清……但是我猜，她是说我们该向北走，那里不光是没有飞鸟走兽，更是寸草不生。在那里我们能找到一个朋友。"],
16894=>["Value"=>16894,"TextKey"=>"剧情ID1090207","TextValue"=>"好吧，听起来……也不是不可行？我是说，能出什么事呢？那就向北出发！"],
16895=>["Value"=>16895,"TextKey"=>"剧情ID1090208","TextValue"=>"但是在此之前，我们终于可以庆祝我们新营地的建成啦！大家都围过来，我们要开场盛大的派对！"],
16896=>["Value"=>16896,"TextKey"=>"剧情ID1090209","TextValue"=>"万岁！"],
16897=>["Value"=>16897,"TextKey"=>"剧情ID1090301","TextValue"=>"我们离开家的时候，以为可能再也回不去了。但是我们找到了这座不可思议的小岛，结识了新的朋友，甚至还找到了复活那些我们以为已经离我们而去的部落成员的方法！"],
16898=>["Value"=>16898,"TextKey"=>"剧情ID1090302","TextValue"=>"所有的这一切，我们必须感谢我们的女神。她一直在庇佑我们并为我们指引方向；接着我要感谢我们的新朋友，亲爱的阿梅金，他一直在无私地向我们传授他那渊博的学识。"],
16899=>["Value"=>16899,"TextKey"=>"剧情ID1090303","TextValue"=>"但最重要的是，酋长，如果您没有像从前那样保持坚强和友善，我们将不可能做到这一切。所以，谢谢您为我们做的一切。呃……祭司，你在哭吗？"],
16900=>["Value"=>16900,"TextKey"=>"剧情ID1090304","TextValue"=>"我……我没有……*抽鼻子*没有哭！只是……*抽鼻子*好吧，我有！我在哭！现在你们都满意了吗？！我爱你酋长！你是最棒的酋长！"],
16901=>["Value"=>16901,"TextKey"=>"剧情ID1090305","TextValue"=>"哈哈，我相信这足以说明问题了，酋长。我等不及想看看我们未来的旅途是什么样的。总有一天，我们一定会解决我们家园的谜团，并重建我们的家。"],
16902=>["Value"=>16902,"TextKey"=>"剧情ID2010101","TextValue"=>"别着急男孩们，我们马上就到了……"],
16903=>["Value"=>16903,"TextKey"=>"剧情ID2010102","TextValue"=>"神保佑！我们在沙漠里已经走了好几天了，或许你可以给我点水喝吗？"],
16904=>["Value"=>16904,"TextKey"=>"剧情ID2010103","TextValue"=>"有点耐心！我在你这么大的时候……嘿这是什么？"],
16905=>["Value"=>16905,"TextKey"=>"剧情ID2010201","TextValue"=>"呜哇啊啊啊啊啊啊啊啊啊！"],
16906=>["Value"=>16906,"TextKey"=>"剧情ID2010202","TextValue"=>"祭司？！"],
16907=>["Value"=>16907,"TextKey"=>"剧情ID2010203","TextValue"=>"哦不，你在下面吗，祭司大人？你还好吗？"],
16908=>["Value"=>16908,"TextKey"=>"剧情ID2010204","TextValue"=>"嗯……我还活着……嗯，我想我被这个……..魔法矿洞给吸进来了。"],
16909=>["Value"=>16909,"TextKey"=>"剧情ID2010205","TextValue"=>"噢感谢神，你还好。请放心，我们会尽最大的努力尽快把您救出来的。"],
16910=>["Value"=>16910,"TextKey"=>"剧情ID2010301","TextValue"=>"酋长，我在附近的山顶上发现了一栋废弃的建筑。我看到里面有一台巨大的草绳机，但它被埋在乱七八糟的垃圾堆里。"],
16911=>["Value"=>16911,"TextKey"=>"剧情ID2010302","TextValue"=>"我猜它是某种<color=#f58c26>旧工坊</color>。"],
16912=>["Value"=>16912,"TextKey"=>"剧情ID2010303","TextValue"=>"也许我们可以试着打开它的门，把里面打扫一下，然后做条草绳，建个滑轮架子，把祭司拉上来？"],
16913=>["Value"=>16913,"TextKey"=>"剧情ID2010304","TextValue"=>"别闲聊了，快去把那个滑轮的玩意建起来！"],
16914=>["Value"=>16914,"TextKey"=>"剧情ID2010305","TextValue"=>"别那么着急嘛，祭司大人。天要黑了，再待在外面我们就要冻死了。所以我打算建个<color=#f58c26>帐篷</color>，等大家休息好了再来想办法。"],
16915=>["Value"=>16915,"TextKey"=>"剧情ID2010306","TextValue"=>"那我怎么办？！我会冻死的！"],
16916=>["Value"=>16916,"TextKey"=>"剧情ID2010307","TextValue"=>"不要担心，尽管这里地上的日夜温差很大，地下的温度总是又舒适又稳定的。再坚持一会儿吧，祭司大人！"],
16917=>["Value"=>16917,"TextKey"=>"剧情ID2020101","TextValue"=>"第二天……"],
16918=>["Value"=>16918,"TextKey"=>"剧情ID2020201","TextValue"=>"这觉睡得真舒服！我的祭司，您在下面感觉如何？"],
16919=>["Value"=>16919,"TextKey"=>"剧情ID2020202","TextValue"=>"与其来问我感觉如何，不如快点想办法把我弄上去！"],
16920=>["Value"=>16920,"TextKey"=>"剧情ID2020203","TextValue"=>"我们正在想呢，只是还需要点必需的工具才能凿开山顶那座工坊的门。别着急，好吗？*微笑*"],
16921=>["Value"=>16921,"TextKey"=>"剧情ID2020204","TextValue"=>"你等我上来……你这个狂妄自大的小屁孩……"],
16922=>["Value"=>16922,"TextKey"=>"剧情ID2020205","TextValue"=>"啊呀，我好受伤！你怎么可以这样误解我的好意！但是我原谅你了。酋长和我会马上回来的！"],
16923=>["Value"=>16923,"TextKey"=>"剧情ID2030201","TextValue"=>"好了，我们进来了！现在我们只需要……"],
16924=>["Value"=>16924,"TextKey"=>"剧情ID2030202","TextValue"=>"长官，小心！在你身后！"],
16925=>["Value"=>16925,"TextKey"=>"剧情ID2030203","TextValue"=>"啊！这支箭是从哪来的？！"],
16926=>["Value"=>16926,"TextKey"=>"剧情ID2030204","TextValue"=>"出来！"],
16927=>["Value"=>16927,"TextKey"=>"剧情ID2030205","TextValue"=>"谁在那儿？"],
16928=>["Value"=>16928,"TextKey"=>"剧情ID2030206","TextValue"=>"出来！绑架犯！"],
16929=>["Value"=>16929,"TextKey"=>"剧情ID2030207","TextValue"=>"绑架犯？我觉得你抓错人了，声音女士……啊啊疼！疼！"],
16930=>["Value"=>16930,"TextKey"=>"剧情ID2030301","TextValue"=>"声音女士，我们现在出来了。你可以给我解释一下现在是什么情况吗？"],
16931=>["Value"=>16931,"TextKey"=>"剧情ID2030302","TextValue"=>"首先，我不叫声音女士，我是特拉齐嘉，闪电的捕猎者，莫洛斯之女，大地之母，女英雄……"],
16932=>["Value"=>16932,"TextKey"=>"剧情ID2030303","TextValue"=>"伟大的特拉齐嘉！！！！！"],
16933=>["Value"=>16933,"TextKey"=>"剧情ID2030304","TextValue"=>"什……这个声音是从哪儿……从山脚？有人掉进那个矿洞了？"],
16934=>["Value"=>16934,"TextKey"=>"剧情ID2030305","TextValue"=>"你们仨，我回来之前待在这儿不许动！如果我发现你们挪了一步，你们知道会发生什么。"],
16935=>["Value"=>16935,"TextKey"=>"剧情ID2030306","TextValue"=>"好的女士，一步也不动！"],
16936=>["Value"=>16936,"TextKey"=>"剧情ID2030401","TextValue"=>"你在那儿啊。一个祭司？你在这下面做什么？我在找人的时候把这个矿洞打开了，但是你怎么在这里面？"],
16937=>["Value"=>16937,"TextKey"=>"剧情ID2030402","TextValue"=>"长话短说，我跟那边那些被你抓住的小男孩是一道来的，但是我掉进了这个矿洞。但是那不重要。我们遇见您了！！我预言我们会在这片荒芜的土地上遇见一位能帮助我们的朋友，想不到居然是您！！"],
16938=>["Value"=>16938,"TextKey"=>"剧情ID2030403","TextValue"=>"朋友？帮助你们？帮什么？你们……不是绑架犯？"],
16939=>["Value"=>16939,"TextKey"=>"剧情ID2030404","TextValue"=>"绑架犯？不不不，我们只是路过的，在旅途中努力寻找能够拯救我们家园的帮手……*解释*"],
16940=>["Value"=>16940,"TextKey"=>"剧情ID2030405","TextValue"=>"哈。你这么一说，我妈确实说过会遇见像你们这样的一群人……但是接着她人就不见了。所以我确实是抓错人了。"],
16941=>["Value"=>16941,"TextKey"=>"剧情ID2030406","TextValue"=>"妈妈？"],
16942=>["Value"=>16942,"TextKey"=>"剧情ID2030407","TextValue"=>"别管了，不是什么大事。我猜你的那些男孩们想修好那个草绳机来把你钓出来，才掉进我的陷阱的？"],
16943=>["Value"=>16943,"TextKey"=>"剧情ID2030408","TextValue"=>"是的，智慧的女士，您说的对。这就是为什么我现在成了这个样子，只剩一只脚能用了。"],
16944=>["Value"=>16944,"TextKey"=>"剧情ID2030409","TextValue"=>"哦天，对不起，我的错。我一会儿帮你疗伤。现在我先帮你们把我的陷阱给拆了，再把那个草绳机修好……"],
16945=>["Value"=>16945,"TextKey"=>"剧情ID2030501","TextValue"=>"草绳机修好了，太棒啦女士！"],
16946=>["Value"=>16946,"TextKey"=>"剧情ID2030592","TextValue"=>"一点也不好！快把我拉上去！现在，马上！"],
16947=>["Value"=>16947,"TextKey"=>"剧情ID2030683","TextValue"=>"现在还剩下一步，就是我们得做点草绳，才能把你钓上来。"],
16948=>["Value"=>16948,"TextKey"=>"剧情ID2030774","TextValue"=>"我觉得你在针对我……*哭*"],
16949=>["Value"=>16949,"TextKey"=>"剧情ID2040101","TextValue"=>"我的酋长，您已经收集完所有的材料了吗？其实您慢点也没关系，因为现在恩达祭司不在这儿， 我们终于能清净一会儿了……"],
16950=>["Value"=>16950,"TextKey"=>"剧情ID2040102","TextValue"=>"我能听见你说话！放尊重点！"],
16951=>["Value"=>16951,"TextKey"=>"剧情ID2040103","TextValue"=>"糟糕！不知道她还能听见……啊哈！滑轮准备好了！"],
16952=>["Value"=>16952,"TextKey"=>"剧情ID2040201","TextValue"=>"亲爱的祭司，救援小队已经下去了，请站在别人能看见的地方，以防发生踩踏事故……"],
16953=>["Value"=>16953,"TextKey"=>"剧情ID2040202","TextValue"=>"你踩到我的腰了！从我身上下去！"],
16954=>["Value"=>16954,"TextKey"=>"剧情ID2040203","TextValue"=>"看起来祭司很快就能上来了，非常感谢您，女士。"],
16955=>["Value"=>16955,"TextKey"=>"剧情ID2040204","TextValue"=>"别叫我女士，我叫特拉齐嘉。现在给我看看，我刚才伤到你哪儿了？"],
16956=>["Value"=>16956,"TextKey"=>"剧情ID2040205","TextValue"=>"您伤到了我的小腿，女士，啊不，特拉齐嘉。"],
16957=>["Value"=>16957,"TextKey"=>"剧情ID2040206","TextValue"=>"明白了。我们这些猎人很擅长照料伤口的。我在矿洞下面存了袋多肉叶子，我把矿洞当储存室来着。我们种些叶子，然后把那些汁水抹在你的小腿腿上~"],
16958=>["Value"=>16958,"TextKey"=>"剧情ID2040207","TextValue"=>"额……小腿腿……好吧。所以我们现在就下到矿井里去？"],
16959=>["Value"=>16959,"TextKey"=>"剧情ID2040208","TextValue"=>"不不不，你们这些小菜鸟在下面需要用火把才能看见。这下面比你们想得要深多了。去找点火把和发掘工具来吧！"],
16960=>["Value"=>16960,"TextKey"=>"剧情ID2050101","TextValue"=>"拿着这个，如果火灭了，就不要往前走，停下然后回来，好吗？"],
16961=>["Value"=>16961,"TextKey"=>"剧情ID2050102","TextValue"=>"准备好了吗？我们走！小心脚下！"],
16962=>["Value"=>16962,"TextKey"=>"剧情ID2050103","TextValue"=>"好的女士！"],
16963=>["Value"=>16963,"TextKey"=>"剧情ID2050104","TextValue"=>"酋长，您愿意和我还有祭司一起留在上面，我很感谢。特拉齐嘉说我现在这样子，除非我这条腿不想要了，不然不能下井，我还挺惋惜的。但是好期待他们会给我们带来什么新发现呀！"],
16964=>["Value"=>16964,"TextKey"=>"剧情ID2050105","TextValue"=>"我真不敢相信伟大的特拉齐嘉竟然让你直呼她的名字。多么大的荣耀！然后你一点也没有感激的意思……"],
16965=>["Value"=>16965,"TextKey"=>"剧情ID2050201","TextValue"=>"我的神啊那是什么？"],
16966=>["Value"=>16966,"TextKey"=>"剧情ID2050202","TextValue"=>"是地下河！我们的队伍竟然找到了一条<color=#f58c26>地下河</color>！我们有水了！"],
16967=>["Value"=>16967,"TextKey"=>"剧情ID2050203","TextValue"=>"也湿透了。"],
16968=>["Value"=>16968,"TextKey"=>"剧情ID2050204","TextValue"=>"你们这些娇气包忍着点！只是点水而已！"],
16969=>["Value"=>16969,"TextKey"=>"剧情ID2050205","TextValue"=>"嘿，你，那个酋长，你现在有水了，我们来种点<color=#f58c26>多肉植物</color>吧！一片叶子加上诵经和适当的护理，马上就能长成一棵漂亮的多肉植物啦！"],
16970=>["Value"=>16970,"TextKey"=>"剧情ID2050206","TextValue"=>"这些姑娘们归你了。去让他们找点水桶铁锹和肥料，我在这儿等着。"],
16971=>["Value"=>16971,"TextKey"=>"剧情ID2060101","TextValue"=>"好了弄完了！看它多可爱！来揪片叶子下来，要大的。"],
16972=>["Value"=>16972,"TextKey"=>"剧情ID2060102","TextValue"=>"我从来没见过这种植物……什么？你说要揪一片下来？"],
16973=>["Value"=>16973,"TextKey"=>"剧情ID2060103","TextValue"=>"对，拿一片，把它的汁水挤出来，涂抹在你受伤的皮肤上。"],
16974=>["Value"=>16974,"TextKey"=>"剧情ID2060104","TextValue"=>"好吧……拿一片……抹……哇，真的管用诶！我从来没听说过哪种草药治愈伤口能这么快！"],
16975=>["Value"=>16975,"TextKey"=>"剧情ID2060105","TextValue"=>"嘛，大地之母也不是白叫的。我猜人们给我起了这个昵称，是因为我的园艺功夫很棒。这些可不是普通的多肉，是我培育的。"],
16976=>["Value"=>16976,"TextKey"=>"剧情ID2060106","TextValue"=>"奇迹创造者！天哪！现在我觉得我们所有家园的谜团很快就能解开了！"],
16977=>["Value"=>16977,"TextKey"=>"剧情ID2060107","TextValue"=>"说实话，关于那件事。我现在筋疲力尽，急需睡上一觉。你介意我去你们那个啥家园打个盹吗？它是像个基地一样的么？有床吗？"],
16978=>["Value"=>16978,"TextKey"=>"剧情ID2060108","TextValue"=>"对，它是有点像个基地，然后这是回去的地图。但是……你是计划去过个夜，还是你会加入我们的队伍啊？"],
16979=>["Value"=>16979,"TextKey"=>"剧情ID2060109","TextValue"=>"当然是加入你们的队伍了，你是傻吗？！你们需要帮助，我现在也不忙，为什么不呢？我们反正估计是在找同一个人。所以！地图我就拿走啦，拜拜！"],
16980=>["Value"=>16980,"TextKey"=>"剧情ID2060201","TextValue"=>"然后她就走了。我感觉她会和我们的人民成为好朋友的。我们继续我们手头的工作，建完营地吧。就像是我们之前的营地一样，我们需要一个储存资源的<color=#f58c26>仓库</color>。"],
16981=>["Value"=>16981,"TextKey"=>"剧情ID2060202","TextValue"=>"我们去收集一些建造<color=#f58c26>仓库</color>的资源吧！"],
16982=>["Value"=>16982,"TextKey"=>"剧情ID2070101","TextValue"=>"太棒了！"],
16983=>["Value"=>16983,"TextKey"=>"剧情ID2070102","TextValue"=>"你还没感谢我给你们找到水源呢！告诉你我对这地方的感觉是对的！"],
16984=>["Value"=>16984,"TextKey"=>"剧情ID2070103","TextValue"=>"好的，好的。我以后全心全意相信你的占卜，满足你一切的无理要求。接下来你需要什么呢？"],
16985=>["Value"=>16985,"TextKey"=>"剧情ID2070104","TextValue"=>"你……！算了。我需要跟神再次交流，来确定接下来前进的方向。这次我需要一个<color=#f58c26>瞭望塔</color>来试试天文学占卜。"],
16986=>["Value"=>16986,"TextKey"=>"剧情ID2070105","TextValue"=>"为什么选择天文学？我们甚至都不知道那些星星是什么，我是说，他们只是天上的一些小亮点！"],
16987=>["Value"=>16987,"TextKey"=>"剧情ID2070106","TextValue"=>"我们没时间浪费了！有一大堆活要干呢！别再胡诌了！"],
16988=>["Value"=>16988,"TextKey"=>"剧情ID2070107","TextValue"=>"去把我要的东西给我找来，快去！"],
16989=>["Value"=>16989,"TextKey"=>"剧情ID2070108","TextValue"=>"好吧……"],
16990=>["Value"=>16990,"TextKey"=>"剧情ID2070201","TextValue"=>"大人都说不要惹难缠的老人，我怎么就不听呢……"],
16991=>["Value"=>16991,"TextKey"=>"剧情ID2080101","TextValue"=>"好了酋长，你干完你要干的了，剩下的就是建祭司让我建的那个<color=#f58c26>瞭望塔</color>了……"],
16992=>["Value"=>16992,"TextKey"=>"剧情ID2080102","TextValue"=>"我听着呢你这个家伙！别抱怨了，干你的活！"],
16993=>["Value"=>16993,"TextKey"=>"剧情ID2080103","TextValue"=>"好吧~好吧~*叹气*"],
16994=>["Value"=>16994,"TextKey"=>"剧情ID2080201","TextValue"=>"好了，我的酋长，我要去跟神说话了。"],
16995=>["Value"=>16995,"TextKey"=>"剧情ID2080202","TextValue"=>"您可以休息一下，一会儿见。"],
16996=>["Value"=>16996,"TextKey"=>"剧情ID2080203","TextValue"=>"*小声*这里这里，酋长……"],
16997=>["Value"=>16997,"TextKey"=>"剧情ID2080204","TextValue"=>"恩达终于可以消停会儿了。"],
16998=>["Value"=>16998,"TextKey"=>"剧情ID2080205","TextValue"=>"我们的队员在矿下找到一堆金子。"],
16999=>["Value"=>16999,"TextKey"=>"剧情ID2080206","TextValue"=>"我们在想能不能做一个箱子来把他们运上来，所以来这里找您帮忙。"],
17000=>["Value"=>17000,"TextKey"=>"剧情ID2080207","TextValue"=>"您介意帮我们收集一些做箱子的材料吗？"],
17001=>["Value"=>17001,"TextKey"=>"剧情ID2090101","TextValue"=>"呼，这可真是不少金子。"],
17002=>["Value"=>17002,"TextKey"=>"剧情ID2090102","TextValue"=>"这是什么？它在发光……"],
17003=>["Value"=>17003,"TextKey"=>"剧情ID2090201","TextValue"=>"是个小袋子……上面写着“吃我”。里面是……一颗<color=#f58c26>发光的种子</color>？它是说，把这个种子吃了吗？"],
17004=>["Value"=>17004,"TextKey"=>"剧情ID2090202","TextValue"=>"放下我来！"],
17005=>["Value"=>17005,"TextKey"=>"剧情ID2090203","TextValue"=>"什么？！祭司大人，您在干什么！"],
17006=>["Value"=>17006,"TextKey"=>"剧情ID2090301","TextValue"=>"你刚刚把它吃了吗？！我们还没研究清楚它是什么呢！"],
17007=>["Value"=>17007,"TextKey"=>"剧情ID2090302","TextValue"=>"星象指引我向位于<color=#f58c26>东南方</color>的<color=#f58c26>大峡谷</color>而去，而这颗<color=#f58c26>催眠种子</color>会帮助我遇见……*打呼噜*"],
17008=>["Value"=>17008,"TextKey"=>"剧情ID2090303","TextValue"=>"祭司？祭司？你还在吗？"],
17009=>["Value"=>17009,"TextKey"=>"剧情ID2090304","TextValue"=>"*打呼噜*"],
17010=>["Value"=>17010,"TextKey"=>"剧情ID2090305","TextValue"=>"然后她就睡着了。我不太理解这些通灵的家伙。他们有时候挺莫名其妙的。"],
17011=>["Value"=>17011,"TextKey"=>"剧情ID2090306","TextValue"=>"呃，祭司晕过去了，那我们接下来该去哪儿呢？"],
17012=>["Value"=>17012,"TextKey"=>"剧情ID2090307","TextValue"=>"她说了<color=#f58c26>大峡谷</color>，对吧？去<color=#f58c26>东南方</color>？"],
17013=>["Value"=>17013,"TextKey"=>"剧情ID2090308","TextValue"=>"我们该信她吗？她现在看起来……有点不正常？"],
17014=>["Value"=>17014,"TextKey"=>"剧情ID2090309","TextValue"=>"当然。我答应了她我今后会相信她。另外，我们还能去哪儿呢？今天就让我们先休息，然后明天向东南方出发。"],
17015=>["Value"=>17015,"TextKey"=>"剧情ID3010101","TextValue"=>"喂，那边那个。"],
17016=>["Value"=>17016,"TextKey"=>"剧情ID3010102","TextValue"=>"我？"],
17017=>["Value"=>17017,"TextKey"=>"剧情ID3010103","TextValue"=>"对！你。你介意给老太太搭把手吗？"],
17018=>["Value"=>17018,"TextKey"=>"剧情ID3010104","TextValue"=>"额……我其实不在这里。"],
17019=>["Value"=>17019,"TextKey"=>"剧情ID3010105","TextValue"=>"哈？为啥？"],
17020=>["Value"=>17020,"TextKey"=>"剧情ID3010106","TextValue"=>"我和我的部落成员在一起。我们正在四处旅行，寻找能够帮助我们解开家园谜团的帮手……"],
17021=>["Value"=>17021,"TextKey"=>"剧情ID3010107","TextValue"=>"晓得了。我其实是在跟你的脑子说话，通过你手里那个发光小方块？"],
17022=>["Value"=>17022,"TextKey"=>"剧情ID3010108","TextValue"=>"你是说我的<color=#f58c26>手机</color>？"],
17023=>["Value"=>17023,"TextKey"=>"剧情ID3010109","TextValue"=>"对的，那个<color=#f58c26>“你的手机”</color>。你愿意帮帮我吗？"],
17024=>["Value"=>17024,"TextKey"=>"剧情ID3010110","TextValue"=>"等等……为什么你能闻见我？"],
17025=>["Value"=>17025,"TextKey"=>"剧情ID3010111","TextValue"=>"噢亲爱的，我虽然是个瞎子，但是我什么都能感受到。你会明白的。现在，你愿意帮我吗？"],
17026=>["Value"=>17026,"TextKey"=>"剧情ID3010112","TextValue"=>"好吧。你需要什么？"],
17027=>["Value"=>17027,"TextKey"=>"剧情ID3010113","TextValue"=>"你的部落的人会经过这儿吧？我假装自己是个饥肠辘辘的人，建个<color=#f58c26>小摊儿</color>卖我的破烂。天哪！我是个天才！"],
17028=>["Value"=>17028,"TextKey"=>"剧情ID3010114","TextValue"=>"我不懂……"],
17029=>["Value"=>17029,"TextKey"=>"剧情ID3010115","TextValue"=>"我不想帮随随便便的什么粗鲁家伙，对吧？我只帮好人。 "],
17030=>["Value"=>17030,"TextKey"=>"剧情ID3010116","TextValue"=>"所以呢？"],
17031=>["Value"=>17031,"TextKey"=>"剧情ID3010117","TextValue"=>"所以如果他们买我的东西然后给我食物，他们就还可以。或者更好，他们直接给我食物！"],
17032=>["Value"=>17032,"TextKey"=>"剧情ID3010118","TextValue"=>"否则，对不住了，我一个响指，你的部落就灰飞烟灭了。懂吗？所以，进入关卡帮我收集点材料吧！"],
17033=>["Value"=>17033,"TextKey"=>"剧情ID3020101","TextValue"=>"漂亮！谢谢你们！"],
17034=>["Value"=>17034,"TextKey"=>"剧情ID3020102","TextValue"=>"我希望我的女儿像你一样可靠又手脚麻利。"],
17035=>["Value"=>17035,"TextKey"=>"剧情ID3020103","TextValue"=>"我们之前在沙漠里走散了，然后我就迷路了……我方向感不太好。"],
17036=>["Value"=>17036,"TextKey"=>"剧情ID3020104","TextValue"=>"你知道她现在在哪儿吗？"],
17037=>["Value"=>17037,"TextKey"=>"剧情ID3020105","TextValue"=>"我当然知道！但是她也不能不来找我啊！"],
17038=>["Value"=>17038,"TextKey"=>"剧情ID3020201","TextValue"=>"这样挺好的，你知道吗？就你和我，很放松，聊聊天，说说八卦……"],
17039=>["Value"=>17039,"TextKey"=>"剧情ID3020301","TextValue"=>"他们会来的，我们只是需要等一会儿。"],
17040=>["Value"=>17040,"TextKey"=>"剧情ID3020302","TextValue"=>"……"],
17041=>["Value"=>17041,"TextKey"=>"剧情ID3020303","TextValue"=>"很久之后"],
17042=>["Value"=>17042,"TextKey"=>"剧情ID3020304","TextValue"=>"我要爬上那堆骨头瞅瞅他们到底到哪儿了。"],
17043=>["Value"=>17043,"TextKey"=>"剧情ID3020401","TextValue"=>"哈！他们就在那儿！你那个小祭司好帅呀！"],
17044=>["Value"=>17044,"TextKey"=>"剧情ID3020402","TextValue"=>"好了他们就要到了。我很期待和他们见面！现在我只需要小心地走下来……"],
17045=>["Value"=>17045,"TextKey"=>"剧情ID3020501","TextValue"=>"你还好吗？"],
17046=>["Value"=>17046,"TextKey"=>"剧情ID3020502","TextValue"=>"喂？"],
17047=>["Value"=>17047,"TextKey"=>"剧情ID3020601","TextValue"=>"过了一会儿"],
17048=>["Value"=>17048,"TextKey"=>"剧情ID3020701","TextValue"=>"“饿死了，请买东西，给我点食物。”嗯……有人在这儿创业了。"],
17049=>["Value"=>17049,"TextKey"=>"剧情ID3020702","TextValue"=>"啊，酋长，您来了。祭司说梦里有人叫他来龙骨这里见面。"],
17050=>["Value"=>17050,"TextKey"=>"剧情ID3020703","TextValue"=>"果然这儿有人活动的痕迹。不过这个火堆余温已散，四周也不见人影……莫非我们被放了鸽子？"],
17051=>["Value"=>17051,"TextKey"=>"剧情ID3020704","TextValue"=>"不管怎样，我们在此处扎营歇歇脚，顺便等等祭司说的那个人吧！ "],
17052=>["Value"=>17052,"TextKey"=>"剧情ID3020801","TextValue"=>"累死我了，终于到了...就这么暴晒，还被大披风捂着，我这老骨头快熟了！赶紧把我这披风脱了！"],
17053=>["Value"=>17053,"TextKey"=>"剧情ID3020802","TextValue"=>"敬爱的祭司，您刚才在骆驼背上睡得很香，没资格说累死了。"],
17054=>["Value"=>17054,"TextKey"=>"剧情ID3020803","TextValue"=>"然后，您还不能脱下您的披风。戈壁和沙漠地区虽然白天酷热，但夜晚格外寒冷。"],
17055=>["Value"=>17055,"TextKey"=>"剧情ID3020804","TextValue"=>"神啊…为什么您要把我引到这个鬼地方来…还要忍受这个傲慢的年轻人……"],
17056=>["Value"=>17056,"TextKey"=>"剧情ID3020805","TextValue"=>"请再稍加忍耐，酋长会尽快帮我们收集好建造旅居<color=#f58c26>帐篷</color>的材料。"],
17057=>["Value"=>17057,"TextKey"=>"剧情ID3030101","TextValue"=>"不愧是您，这么快就收集好了材料，那就让我们动工吧！"],
17058=>["Value"=>17058,"TextKey"=>"剧情ID3030201","TextValue"=>"想必大家也都饿了，我们正好就借用这个篝火来做点饭、搭一个简易的休息区休息一下。吃饱了才有力气干活嘛！"],
17059=>["Value"=>17059,"TextKey"=>"剧情ID3030202","TextValue"=>"太好了！！！吃的！培根！"],
17060=>["Value"=>17060,"TextKey"=>"剧情ID3030203","TextValue"=>"我想吃羊排……"],
17061=>["Value"=>17061,"TextKey"=>"剧情ID3030204","TextValue"=>"你们这些残暴的食肉动物！"],
17062=>["Value"=>17062,"TextKey"=>"剧情ID3030205","TextValue"=>"你要什么？"],
17063=>["Value"=>17063,"TextKey"=>"剧情ID3030206","TextValue"=>"牛排，五成熟，配辣根酱，谢谢。"],
17064=>["Value"=>17064,"TextKey"=>"剧情ID3030207","TextValue"=>"祭司大人，那个也是……"],
17065=>["Value"=>17065,"TextKey"=>"剧情ID3030208","TextValue"=>"我知道！闭嘴！"],
17066=>["Value"=>17066,"TextKey"=>"剧情ID3030209","TextValue"=>"哈哈，对于旅行在外的人来说，补充蛋白质是很重要的。这一路上不容易，所以我们得吃顿好的！酋长，您意下如何？"],
17067=>["Value"=>17067,"TextKey"=>"剧情ID3030210","TextValue"=>"我们没有那么多食材……"],
17068=>["Value"=>17068,"TextKey"=>"剧情ID3030211","TextValue"=>"我们有羊肉、牛肉干和苹果，酋长大人！"],
17069=>["Value"=>17069,"TextKey"=>"剧情ID3030212","TextValue"=>"但是酋长说的在理，我们还要为之后的极端天气做准备。所以我们需要去找点别的蛋白质来当替代品。"],
17070=>["Value"=>17070,"TextKey"=>"剧情ID3030213","TextValue"=>"路上我看见了一些沙漠蜥蜴。蜥蜴卵，和它们自己都是很好的蛋白质来源！"],
17071=>["Value"=>17071,"TextKey"=>"剧情ID3030214","TextValue"=>"你说什么？！蜥蜴？！那东西能吃？！"],
17072=>["Value"=>17072,"TextKey"=>"剧情ID3030215","TextValue"=>"这些稀有食材加上一点点创意就能成为珍馐！比如，蜥蜴炖杂蔬，就听起来特别美味！"],
17073=>["Value"=>17073,"TextKey"=>"剧情ID3030216","TextValue"=>"我等不及啦！"],
17074=>["Value"=>17074,"TextKey"=>"剧情ID3030217","TextValue"=>"哦……抓蜥蜴……"],
17075=>["Value"=>17075,"TextKey"=>"剧情ID3040101","TextValue"=>"好极了！您把材料都收集好了，咱们开始吧！"],
17076=>["Value"=>17076,"TextKey"=>"剧情ID3040102","TextValue"=>"来了！点燃篝火！"],
17077=>["Value"=>17077,"TextKey"=>"剧情ID3040201","TextValue"=>"终于……食物……我动不了了……煎蛋……牛排……烤苹果……"],
17078=>["Value"=>17078,"TextKey"=>"剧情ID3040202","TextValue"=>"阿兰的羊排，然后是凯文的煎蛋……恩达祭司会和我一起享用这碗美味的蜥蜴炖杂蔬……"],
17079=>["Value"=>17079,"TextKey"=>"剧情ID3040301","TextValue"=>"没人跟你吃炖蜥蜴！"],
17080=>["Value"=>17080,"TextKey"=>"剧情ID3040302","TextValue"=>"好吧，看来这碗热气腾腾的美味炖菜要给我们的新朋友了。"],
17081=>["Value"=>17081,"TextKey"=>"剧情ID3040303","TextValue"=>"新朋友？什么新朋友？"],
17082=>["Value"=>17082,"TextKey"=>"剧情ID3040401","TextValue"=>"啊！！！！我的神啊！！！把这些老鼠从我身上弄下去！"],
17083=>["Value"=>17083,"TextKey"=>"剧情ID3040402","TextValue"=>"首先，老鼠不可能这么大。根据我的观察，它们是沙漠和戈壁地区特有的一种生物，沙鼠。"],
17084=>["Value"=>17084,"TextKey"=>"剧情ID3040403","TextValue"=>"尽管体型不小，但它们一般都胆小敏感，所以性情温和的它们对人是完全无害的。"],
17085=>["Value"=>17085,"TextKey"=>"剧情ID3040404","TextValue"=>"好了好了我知道了！！！我不在乎这堆东西是啥，赶紧给我弄下去！"],
17086=>["Value"=>17086,"TextKey"=>"剧情ID3040405","TextValue"=>"你这么一说，有点奇怪。这些沙鼠为什么完全不怕你呢？"],
17087=>["Value"=>17087,"TextKey"=>"剧情ID3040406","TextValue"=>"亲爱的工人们，能请你们把这些可爱的小家伙们从祭司身上移走吗？"],
17088=>["Value"=>17088,"TextKey"=>"剧情ID3040407","TextValue"=>"没问题！"],
17089=>["Value"=>17089,"TextKey"=>"剧情ID3040501","TextValue"=>"嘿！！！！还给我！！！"],
17090=>["Value"=>17090,"TextKey"=>"剧情ID3040502","TextValue"=>"然后它们就这么跑了。好像它们还是有点怕祭司以外的人？"],
17091=>["Value"=>17091,"TextKey"=>"剧情ID3040503","TextValue"=>"它们抢走了我的戒指！我亲爱的戒指……"],
17092=>["Value"=>17092,"TextKey"=>"剧情ID3040504","TextValue"=>"可怜的祭司……我猜我们可以去看看那堆龙骨？反正我对那些小家伙也有点兴趣。"],
17093=>["Value"=>17093,"TextKey"=>"剧情ID3040505","TextValue"=>"但是那儿地势陡峭，我们需要一个<color=#f58c26>风车</color>来运送工人。"],
17094=>["Value"=>17094,"TextKey"=>"剧情ID3050101","TextValue"=>"风车的材料已经备好了吗？好！那撸起袖子把它建起来吧！"],
17095=>["Value"=>17095,"TextKey"=>"剧情ID3050102","TextValue"=>"热乎的风车马上来！"],
17096=>["Value"=>17096,"TextKey"=>"剧情ID3050201","TextValue"=>"多漂亮的风车！这样我们上下陡坡更安全也更方便啦！"],
17097=>["Value"=>17097,"TextKey"=>"剧情ID3050202","TextValue"=>"好！赶紧把我的戒指拿回来！它神圣得很！"],
17098=>["Value"=>17098,"TextKey"=>"剧情ID3050203","TextValue"=>"好好！我们去！凯文，阿兰，你们准备好了吗？"],
17099=>["Value"=>17099,"TextKey"=>"剧情ID3050204","TextValue"=>"时刻准备着！"],
17100=>["Value"=>17100,"TextKey"=>"剧情ID3050205","TextValue"=>"嗯……长官……不是说我胆小，但是我觉得以防我们从悬崖上掉下来，我们需要点绳子……"],
17101=>["Value"=>17101,"TextKey"=>"剧情ID3050206","TextValue"=>"啊哈！你说得太对了，工作安全永远第一！所以酋长，再请您帮忙弄点安全工具来啦。"],
17102=>["Value"=>17102,"TextKey"=>"剧情ID3060101","TextValue"=>"准备好了吗？"],
17103=>["Value"=>17103,"TextKey"=>"剧情ID3060102","TextValue"=>"准备好了！"],
17104=>["Value"=>17104,"TextKey"=>"剧情ID3060103","TextValue"=>"漂亮！我们现在就去解开那些沙鼠的谜团吧！好期待呀！"],
17105=>["Value"=>17105,"TextKey"=>"剧情ID3060104","TextValue"=>"别忘了我的戒指！"],
17106=>["Value"=>17106,"TextKey"=>"剧情ID3060201","TextValue"=>"哇哦，这个骨头堆真够深的！等等……在底部有个闪闪发光的东西……嗯……是不是恩达的戒指呢？"],
17107=>["Value"=>17107,"TextKey"=>"剧情ID3060202","TextValue"=>"酋长！看我们找到了什么！一个灰头土脸的老太太！"],
17108=>["Value"=>17108,"TextKey"=>"剧情ID3060203","TextValue"=>"还有祭司的戒指。"],
17109=>["Value"=>17109,"TextKey"=>"剧情ID3060301","TextValue"=>"*热泪盈眶*阿兰，太感谢你了，你是咱们这群人里最讲理的那个……等等……什么？"],
17110=>["Value"=>17110,"TextKey"=>"剧情ID3060401","TextValue"=>"*激动的吱吱声*"],
17111=>["Value"=>17111,"TextKey"=>"剧情ID3060402","TextValue"=>"我猜……谢谢你们？"],
17112=>["Value"=>17112,"TextKey"=>"剧情ID3060403","TextValue"=>"*高兴的吱吱声*"],
17113=>["Value"=>17113,"TextKey"=>"剧情ID3060501","TextValue"=>"*激动的吱吱声*"],
17114=>["Value"=>17114,"TextKey"=>"剧情ID3060502","TextValue"=>"哦！你们好！你们好热情！我认识你们吗？这毛皮摸起来有种熟悉的感觉……"],
17115=>["Value"=>17115,"TextKey"=>"剧情ID3060503","TextValue"=>"噢！然后你一定就是刚才我梦里的那个小祭司吧！现实中的你比梦里还要可爱~"],
17116=>["Value"=>17116,"TextKey"=>"剧情ID3060504","TextValue"=>"小？你竟敢说我小？！我是尊贵的神的信使…"],
17117=>["Value"=>17117,"TextKey"=>"剧情ID3060505","TextValue"=>"抱歉，您说您梦到了我们的祭司？"],
17118=>["Value"=>17118,"TextKey"=>"剧情ID3060506","TextValue"=>"噢~年轻人！是的！我梦见了这位小祭司，我还梦见我跟她说：“我在这里等你。”但是我完全不知道那是什么意思！"],
17119=>["Value"=>17119,"TextKey"=>"剧情ID3060507","TextValue"=>"什么叫做你不知道那是什么意思？！"],
17120=>["Value"=>17120,"TextKey"=>"剧情ID3060508","TextValue"=>"其实说来好笑，我完全不记得我的名字，所以更不知道我那个奇奇怪怪的梦是什么意思。"],
17121=>["Value"=>17121,"TextKey"=>"剧情ID3060509","TextValue"=>"我掉进坑的时候脑袋肯定撞得不轻。我现在走路还有点摇摇晃晃呢。"],
17122=>["Value"=>17122,"TextKey"=>"剧情ID3060510","TextValue"=>"旁边这个小摊位是您的吗？上面写着“饿死了，请买东西，请给我食物“？"],
17123=>["Value"=>17123,"TextKey"=>"剧情ID3060511","TextValue"=>"这地方挺荒凉的，再加上这个小摊位上写的东西准确地描述了我目前的身体状态与内心独白。我猜它是我的。"],
17124=>["Value"=>17124,"TextKey"=>"剧情ID3060512","TextValue"=>"不用担心，我们带了很多的食物，请您到我们的帐篷里面享用。"],
17125=>["Value"=>17125,"TextKey"=>"剧情ID3060513","TextValue"=>"太好了！"],
17126=>["Value"=>17126,"TextKey"=>"剧情ID3060514","TextValue"=>"噢，不过有件事。我在空气中闻到培根、烤苹果、和……一场<color=#f58c26>即将到来的风暴</color>的味道。你们最好做好准备。"],
17127=>["Value"=>17127,"TextKey"=>"剧情ID3060601","TextValue"=>"然后……她就这么走了。好吧，酋长，您也听到了，这儿风很大很凶，我看看……"],
17128=>["Value"=>17128,"TextKey"=>"剧情ID3060602","TextValue"=>"咱们的帐篷需要进一步加固。"],
17129=>["Value"=>17129,"TextKey"=>"剧情ID3060603","TextValue"=>"我们凭什么要听她的！那家伙来头不明不白，然后你就信她的话！"],
17130=>["Value"=>17130,"TextKey"=>"剧情ID3060604","TextValue"=>"我的预言，你总是揪住一处差错嘲笑个不停！我一定要问出个所以然来，让这老女人现出真面目来！"],
17131=>["Value"=>17131,"TextKey"=>"剧情ID3060605","TextValue"=>"哈哈哈哈，我们的祭司还挺不服气的。<color=#f58c26>加固帐篷</color>的材料清单已经为您备好了，酋长大人，请您查看。"],
17132=>["Value"=>17132,"TextKey"=>"剧情ID3070101","TextValue"=>"嗯，好茶。"],
17133=>["Value"=>17133,"TextKey"=>"剧情ID3070102","TextValue"=>"这饼干也不错，入口即化。就是边缘稍稍烤焦了一点。"],
17134=>["Value"=>17134,"TextKey"=>"剧情ID3070103","TextValue"=>"下次火候小一点，然后适当延长一些时间就完美了。"],
17135=>["Value"=>17135,"TextKey"=>"剧情ID3070104","TextValue"=>"为什么她在吃下午茶？！"],
17136=>["Value"=>17136,"TextKey"=>"剧情ID3070105","TextValue"=>"有什么问题吗？"],
17137=>["Value"=>17137,"TextKey"=>"剧情ID3070106","TextValue"=>"然后那个奇奇怪怪的英式口音是怎么回事！我们甚至不在正确的时代！"],
17138=>["Value"=>17138,"TextKey"=>"剧情ID3070107","TextValue"=>"放松一点，可爱的小祭司。一切都会过去的，你会明白的。"],
17139=>["Value"=>17139,"TextKey"=>"剧情ID3070108","TextValue"=>"不！不会！没有事情会过去，然后我也什么都不明白！！神啊……你到底是从哪里来的啊！"],
17140=>["Value"=>17140,"TextKey"=>"剧情ID3070109","TextValue"=>"既然你虔诚地发问了，实际上，多亏了刚才的下午茶……"],
17141=>["Value"=>17141,"TextKey"=>"剧情ID3070110","TextValue"=>"我的记忆已经有所恢复。事实上，我是说，诚实地说，讲道理，说实话……"],
17142=>["Value"=>17142,"TextKey"=>"剧情ID3070111","TextValue"=>"能不能直说？！"],
17143=>["Value"=>17143,"TextKey"=>"剧情ID3070112","TextValue"=>"那个<color=#f58c26>小摊位</color>，能拜托你们也帮我加固一番吗？"],
17144=>["Value"=>17144,"TextKey"=>"剧情ID3070113","TextValue"=>"什么？！"],
17145=>["Value"=>17145,"TextKey"=>"剧情ID3070114","TextValue"=>"在戈壁滩上，我一个瘦弱的老人，一个人孤单地走了很久，已经是饥肠辘辘……哎！真可怜！"],
17146=>["Value"=>17146,"TextKey"=>"剧情ID3070115","TextValue"=>"要是这摊位坏了，我会很难过的。所以，拜托你们了！感激不尽！"],
17147=>["Value"=>17147,"TextKey"=>"剧情ID3070116","TextValue"=>"多有趣的老太太。"],
17148=>["Value"=>17148,"TextKey"=>"剧情ID3070117","TextValue"=>"对不起你说什么？！"],
17149=>["Value"=>17149,"TextKey"=>"剧情ID3070118","TextValue"=>"酋长大人，材料清单已经为您准备好了，请您查看！"],
17150=>["Value"=>17150,"TextKey"=>"剧情ID3070119","TextValue"=>"不要无视我！！天哪我受不了了！"],
17151=>["Value"=>17151,"TextKey"=>"剧情ID3080101","TextValue"=>"真好，你们太棒了！"],
17152=>["Value"=>17152,"TextKey"=>"剧情ID3080102","TextValue"=>"妈！我就知道！我就知道是你！"],
17153=>["Value"=>17153,"TextKey"=>"剧情ID3080201","TextValue"=>"伟大的特拉齐嘉，您为什么在这里？！"],
17154=>["Value"=>17154,"TextKey"=>"剧情ID3080202","TextValue"=>"这位年轻的女士是……？"],
17155=>["Value"=>17155,"TextKey"=>"剧情ID3080203","TextValue"=>"特拉齐嘉！你女儿！别装了！"],
17156=>["Value"=>17156,"TextKey"=>"剧情ID3080204","TextValue"=>"传信儿的告诉我他们在一坑里挖出来一个瞎眼老婆子，听起来像你，我就来看看。"],
17157=>["Value"=>17157,"TextKey"=>"剧情ID3080205","TextValue"=>"果然是你！"],
17158=>["Value"=>17158,"TextKey"=>"剧情ID3080206","TextValue"=>"特拉齐嘉的母亲……我从未听说过特拉齐嘉有母亲……"],
17159=>["Value"=>17159,"TextKey"=>"剧情ID3080207","TextValue"=>"我当然有母亲你个傻蛋！"],
17160=>["Value"=>17160,"TextKey"=>"剧情ID3080208","TextValue"=>"注意语言。"],
17161=>["Value"=>17161,"TextKey"=>"剧情ID3080209","TextValue"=>"这个疯疯癫癫的女士就是你们的莫洛斯。就在你们眼前。"],
17162=>["Value"=>17162,"TextKey"=>"剧情ID3080210","TextValue"=>"叫我麦格就好。"],
17163=>["Value"=>17163,"TextKey"=>"剧情ID3080211","TextValue"=>"但是我以为莫洛斯是男的……"],
17164=>["Value"=>17164,"TextKey"=>"剧情ID3080212","TextValue"=>"好吧，我的母亲可以是很多人。我小时候，她向人们隐藏了自己的真实身份。"],
17165=>["Value"=>17165,"TextKey"=>"剧情ID3080213","TextValue"=>"你想，谁比盲人女人和三岁大的人更容易被利用？"],
17166=>["Value"=>17166,"TextKey"=>"剧情ID3080214","TextValue"=>"我想，人们就是开始这样传播这个故事的……无所不能的德鲁伊，无所不知的战士，强大的骑士……"],
17167=>["Value"=>17167,"TextKey"=>"剧情ID3080215","TextValue"=>"实际上，她只是一个有奇怪幽默感的失明老太婆。"],
17168=>["Value"=>17168,"TextKey"=>"剧情ID3080216","TextValue"=>"莫洛斯是女人……然后我对莫洛斯出言不逊……噢，我完了，我不配做祭司……"],
17169=>["Value"=>17169,"TextKey"=>"剧情ID3080217","TextValue"=>"小祭司，不要悲伤。你会学乖的~这次我原谅你了，因为你真是太可爱了~"],
17170=>["Value"=>17170,"TextKey"=>"剧情ID3080218","TextValue"=>"所以你骗了我们？你没有失忆？"],
17171=>["Value"=>17171,"TextKey"=>"剧情ID3080219","TextValue"=>"是的...很抱歉。长途旅行很无聊，对吧？只是找点乐子〜"],
17172=>["Value"=>17172,"TextKey"=>"剧情ID3080220","TextValue"=>"但是，嘿，看那美丽的帐篷和那美丽的小铺子！现在这才像个“营地”！只是总觉得还缺点什么……"],
17173=>["Value"=>17173,"TextKey"=>"剧情ID3080221","TextValue"=>"缺点什么？"],
17174=>["Value"=>17174,"TextKey"=>"剧情ID3080222","TextValue"=>"我看看……"],
17175=>["Value"=>17175,"TextKey"=>"剧情ID3080301","TextValue"=>"一个大门！你们需要一个大门来标记营地的入口，然后再点缀些灯，就会变得无与伦比地美！"],
17176=>["Value"=>17176,"TextKey"=>"剧情ID3080302","TextValue"=>"我们作为您虔诚的仆人，会立刻去建造那座大门，女士！酋长，别磨磨蹭蹭的了！"],
17177=>["Value"=>17177,"TextKey"=>"剧情ID3090101","TextValue"=>"材料都准备好了？好！快去干活快去干活！"],
17178=>["Value"=>17178,"TextKey"=>"剧情ID3090201","TextValue"=>"噢！我感到活力四射！这是我第一次负责建筑项目……"],
17179=>["Value"=>17179,"TextKey"=>"剧情ID3090202","TextValue"=>"恭喜你，祭司，你成长了许多。但是不知道麦格对我们的营地现在的样子满不满意呢？"],
17180=>["Value"=>17180,"TextKey"=>"剧情ID3090203","TextValue"=>"其他的都很好，但是这个空荡荡的天空有点无聊……"],
17181=>["Value"=>17181,"TextKey"=>"剧情ID3090204","TextValue"=>"我知道！我知道！我们有一些能飘在天上的信号气球！"],
17182=>["Value"=>17182,"TextKey"=>"剧情ID3090205","TextValue"=>"好主意！这些小东西需要些微调，就会更漂亮啦！"],
17183=>["Value"=>17183,"TextKey"=>"剧情ID3090206","TextValue"=>"你们那些发光的黄色粉色小石头还有剩吗？"],
17184=>["Value"=>17184,"TextKey"=>"剧情ID3090207","TextValue"=>"有的！"],
17185=>["Value"=>17185,"TextKey"=>"剧情ID3090208","TextValue"=>"太好了，稍等一下。凯文，跟我来。"],
17186=>["Value"=>17186,"TextKey"=>"剧情ID3090301","TextValue"=>"咳，累死我了。但是看看这些小玩意！它们美不美？"],
17187=>["Value"=>17187,"TextKey"=>"剧情ID3090302","TextValue"=>"确实。"],
17188=>["Value"=>17188,"TextKey"=>"剧情ID3090303","TextValue"=>"你们喜欢就好。妈妈做的东西一般都不太正常。总之，时候不早了，我要回去了。"],
17189=>["Value"=>17189,"TextKey"=>"剧情ID3090304","TextValue"=>"现在就走？"],
17190=>["Value"=>17190,"TextKey"=>"剧情ID3090305","TextValue"=>"是啊，不然呢？我才不要跟你们这些臭烘烘的大老爷们挤一个小帐篷！妈妈，你跟我一起走吗？"],
17191=>["Value"=>17191,"TextKey"=>"剧情ID3090306","TextValue"=>"我一会儿会赶上来的。你的新朋友们看起来真可爱，尤其是这个小祭司~我想和他们再多玩一会儿~"],
17192=>["Value"=>17192,"TextKey"=>"剧情ID3090307","TextValue"=>"妈妈，控制一下你自己。"],
17193=>["Value"=>17193,"TextKey"=>"剧情ID3090308","TextValue"=>"知道啦知道啦，我现在控制住了。毕竟我们以后还有很长的路要一起走。"],
17194=>["Value"=>17194,"TextKey"=>"剧情ID3090309","TextValue"=>"行，那待会儿见。"],
17195=>["Value"=>17195,"TextKey"=>"剧情ID3090401","TextValue"=>"您是在说您会加入我们吗？"],
17196=>["Value"=>17196,"TextKey"=>"剧情ID3090402","TextValue"=>"当然！为什么不呢！你们的旅途将会愈发艰险。"],
17197=>["Value"=>17197,"TextKey"=>"剧情ID3090403","TextValue"=>"我做不了什么，但是至少我能告诉你们点儿未来的事情。"],
17198=>["Value"=>17198,"TextKey"=>"剧情ID3090404","TextValue"=>"不过你们得给我指一下去你们家园的路。我的方向感……难以想象地差。"],
17199=>["Value"=>17199,"TextKey"=>"剧情ID4010101","TextValue"=>"呼……世界上为什么会有这种地方存在！我的脚好像一直踩在了火焰上……"],
17200=>["Value"=>17200,"TextKey"=>"剧情ID4010102","TextValue"=>"了不起，恩达！呼……从四个小时前开始，你已经没有说出超过五个字的句子了。"],
17201=>["Value"=>17201,"TextKey"=>"剧情ID4010103","TextValue"=>"我……太累了……太热了……"],
17202=>["Value"=>17202,"TextKey"=>"剧情ID4010104","TextValue"=>"你们这群娇气包！区区火山罢了，看看这副恨不得佝偻到地上的样子！"],
17203=>["Value"=>17203,"TextKey"=>"剧情ID4010105","TextValue"=>"女士……您的汗水也已经成了源源不断的溪流。您确实还好吗？"],
17204=>["Value"=>17204,"TextKey"=>"剧情ID4010106","TextValue"=>"叫我特拉齐嘉！……我不累，但是确实太热了……这里比海上凶险得多。"],
17205=>["Value"=>17205,"TextKey"=>"剧情ID4010107","TextValue"=>"我们似乎已经到了。"],
17206=>["Value"=>17206,"TextKey"=>"剧情ID4010108","TextValue"=>"让我看看！女神的指示说，一片燃烧的海，还有其中的岛屿……"],
17207=>["Value"=>17207,"TextKey"=>"剧情ID4010109","TextValue"=>"对，一定就是这里！"],
17208=>["Value"=>17208,"TextKey"=>"剧情ID4010110","TextValue"=>"可是阿梅金在哪里？阿梅金应该早就到了，在这里等着我们才对。但到处看不到他。"],
17209=>["Value"=>17209,"TextKey"=>"剧情ID4010111","TextValue"=>"我需要修建祭坛，来感应阿梅金的信息。但是……"],
17210=>["Value"=>17210,"TextKey"=>"剧情ID4010201","TextValue"=>"呼……酋长，我……"],
17211=>["Value"=>17211,"TextKey"=>"剧情ID4010202","TextValue"=>"恩达！"],
17212=>["Value"=>17212,"TextKey"=>"剧情ID4010203","TextValue"=>"恩达！"],
17213=>["Value"=>17213,"TextKey"=>"剧情ID4010204","TextValue"=>"她一定是中暑了！快，搭一个阴凉地，让她歇一歇！"],
17214=>["Value"=>17214,"TextKey"=>"剧情ID4020101","TextValue"=>"长官，修建完毕！"],
17215=>["Value"=>17215,"TextKey"=>"剧情ID4020102","TextValue"=>"神啊，我好像可以多活一会儿了……"],
17216=>["Value"=>17216,"TextKey"=>"剧情ID4020103","TextValue"=>"实在是太热了吧！我无比怀念海水的味道……"],
17217=>["Value"=>17217,"TextKey"=>"剧情ID4020104","TextValue"=>"呼，我们的祭司大人看上去好多了。"],
17218=>["Value"=>17218,"TextKey"=>"剧情ID4020105","TextValue"=>"有了帐篷虽然好一点，没了迎面而来的热风……"],
17219=>["Value"=>17219,"TextKey"=>"剧情ID4020106","TextValue"=>"但也就是好了一点而已。"],
17220=>["Value"=>17220,"TextKey"=>"剧情ID4020107","TextValue"=>"女神在上，把我翻个面吧，这样烤更均匀。"],
17221=>["Value"=>17221,"TextKey"=>"剧情ID4020108","TextValue"=>"不得不说，这儿的确是个大烤炉。"],
17222=>["Value"=>17222,"TextKey"=>"剧情ID4020109","TextValue"=>"看！那边的低地。"],
17223=>["Value"=>17223,"TextKey"=>"剧情ID4020110","TextValue"=>"你们等着！我妈可真是生了个天才。"],
17224=>["Value"=>17224,"TextKey"=>"剧情ID4030101","TextValue"=>"伟大的特拉齐嘉！那是水，是水呀！"],
17225=>["Value"=>17225,"TextKey"=>"剧情ID4030102","TextValue"=>"嘿，还以为我们虔诚的祭司大人见到了女神呢。"],
17226=>["Value"=>17226,"TextKey"=>"剧情ID4030103","TextValue"=>"我彻底活过来了，活得相当好！"],
17227=>["Value"=>17227,"TextKey"=>"剧情ID4030104","TextValue"=>"我看你们的确有精神多了！"],
17228=>["Value"=>17228,"TextKey"=>"剧情ID4030105","TextValue"=>"既然这样，你，你，还有你，快去修建训练场！"],
17229=>["Value"=>17229,"TextKey"=>"剧情ID4030106","TextValue"=>"训练场？"],
17230=>["Value"=>17230,"TextKey"=>"剧情ID4030107","TextValue"=>"对，没错！"],
17231=>["Value"=>17231,"TextKey"=>"剧情ID4030108","TextValue"=>"我们不是应该找阿梅金？"],
17232=>["Value"=>17232,"TextKey"=>"剧情ID4030109","TextValue"=>"阿梅金那个老头嘛，我是知道的，呼风唤雨不在话下。"],
17233=>["Value"=>17233,"TextKey"=>"剧情ID4030110","TextValue"=>"再看看你们，只是走到这边就半死不活了，体能训练怎么能落下？"],
17234=>["Value"=>17234,"TextKey"=>"剧情ID4030111","TextValue"=>"嗯，恩达的确需要锻炼。"],
17235=>["Value"=>17235,"TextKey"=>"剧情ID4030112","TextValue"=>"闭嘴！"],
17236=>["Value"=>17236,"TextKey"=>"剧情ID4030113","TextValue"=>"根据我妈的预言，我们只会迎来更大的风暴……"],
17237=>["Value"=>17237,"TextKey"=>"剧情ID4030114","TextValue"=>"莫洛斯的预言吗……"],
17238=>["Value"=>17238,"TextKey"=>"剧情ID4030115","TextValue"=>"年轻人们！"],
17239=>["Value"=>17239,"TextKey"=>"剧情ID4030116","TextValue"=>"明白！"],
17240=>["Value"=>17240,"TextKey"=>"剧情ID4040101","TextValue"=>"看北方那块高地！居然有天然的阶梯。"],
17241=>["Value"=>17241,"TextKey"=>"剧情ID4040102","TextValue"=>"是的，长官！"],
17242=>["Value"=>17242,"TextKey"=>"剧情ID4040103","TextValue"=>"你们有没有注意到中间的圆柱？那一定不是天然形成的。"],
17243=>["Value"=>17243,"TextKey"=>"剧情ID4040104","TextValue"=>"这样的高度和形状，赌上我祭司世家的名誉，这以前一定是一个祭坛！"],
17244=>["Value"=>17244,"TextKey"=>"剧情ID4040105","TextValue"=>"这个祭坛看上去很荒凉。"],
17245=>["Value"=>17245,"TextKey"=>"剧情ID4040106","TextValue"=>"没错，年头一定很久远了。"],
17246=>["Value"=>17246,"TextKey"=>"剧情ID4040107","TextValue"=>"这样的祭坛，无法与大德鲁伊的力量产生共鸣，可是找不到阿梅金的。"],
17247=>["Value"=>17247,"TextKey"=>"剧情ID4040108","TextValue"=>"酋长，我们需要能够凝聚能量的装置……"],
17248=>["Value"=>17248,"TextKey"=>"剧情ID4040109","TextValue"=>"材料一定要耐得住这里的温度，形状要聚拢……"],
17249=>["Value"=>17249,"TextKey"=>"剧情ID4040110","TextValue"=>"岩浆里那些奇怪的尖牙怎么样？"],
17250=>["Value"=>17250,"TextKey"=>"剧情ID4040111","TextValue"=>"很不错！阿兰，怪不得临行前女神的提示说，要与重要的伙伴同行！"],
17251=>["Value"=>17251,"TextKey"=>"剧情ID4040112","TextValue"=>"的确如此。感谢女神！"],
17252=>["Value"=>17252,"TextKey"=>"剧情ID4040113","TextValue"=>"闭嘴！不包括你！"],
17253=>["Value"=>17253,"TextKey"=>"剧情ID4040114","TextValue"=>"材料交给我们了不起的酋长吧！"],
17254=>["Value"=>17254,"TextKey"=>"剧情ID4050101","TextValue"=>"酋长，我们的进度十分喜人。"],
17255=>["Value"=>17255,"TextKey"=>"剧情ID4050102","TextValue"=>"祭坛使用起来应该没有问题！"],
17256=>["Value"=>17256,"TextKey"=>"剧情ID4050103","TextValue"=>"但，看看现在幽暗的天色，恩达上下祭坛实在太艰难了，万一摔下来怎么办？"],
17257=>["Value"=>17257,"TextKey"=>"剧情ID4050104","TextValue"=>"不错，什么斯坦，看来你也有不那么讨厌的时候。"],
17258=>["Value"=>17258,"TextKey"=>"剧情ID4050105","TextValue"=>"毕竟恩达年纪确实，嗯，不小了……"],
17259=>["Value"=>17259,"TextKey"=>"剧情ID4050106","TextValue"=>"气死我对你有什么好处？"],
17260=>["Value"=>17260,"TextKey"=>"剧情ID4050107","TextValue"=>"那我们在阶梯两边修建上火把吧，这很简单！"],
17261=>["Value"=>17261,"TextKey"=>"剧情ID4060101","TextValue"=>"这个祭坛……给我的感觉还是缺一些什么，完全无法感应女神的信息……"],
17262=>["Value"=>17262,"TextKey"=>"剧情ID4060102","TextValue"=>"但应该可以感应阿梅金！"],
17263=>["Value"=>17263,"TextKey"=>"剧情ID4060103","TextValue"=>"好冷……是……是谁？……"],
17264=>["Value"=>17264,"TextKey"=>"剧情ID4060104","TextValue"=>"阿梅金！你在哪里？"],
17265=>["Value"=>17265,"TextKey"=>"剧情ID4060105","TextValue"=>"你……你是恩达？我不知道我在哪里……但是，这里好冷……"],
17266=>["Value"=>17266,"TextKey"=>"剧情ID4060106","TextValue"=>"冷？"],
17267=>["Value"=>17267,"TextKey"=>"剧情ID4060107","TextValue"=>"看来他不在这里。"],
17268=>["Value"=>17268,"TextKey"=>"剧情ID4060108","TextValue"=>"我动不了……救命， $#^*,!@%&:?""],
17269=>["Value"=>17269,"TextKey"=>"剧情ID4060109","TextValue"=>"你说什么？"],
17270=>["Value"=>17270,"TextKey"=>"剧情ID4060110","TextValue"=>"喂，恩达，我想……"],
17271=>["Value"=>17271,"TextKey"=>"剧情ID4060111","TextValue"=>"L"&%*@#$"……"],
17272=>["Value"=>17272,"TextKey"=>"剧情ID4060112","TextValue"=>"阿梅金你先等等！现在我要和另一个人说话，也许能帮到你。"],
17273=>["Value"=>17273,"TextKey"=>"剧情ID4060113","TextValue"=>"特拉齐嘉，你见过这种情况吗？"],
17274=>["Value"=>17274,"TextKey"=>"剧情ID4060114","TextValue"=>"喂……"],
17275=>["Value"=>17275,"TextKey"=>"剧情ID4060115","TextValue"=>"精神沟通不算我的专长。但我妈也遇到过这种情况，应该还是祭坛的原因。"],
17276=>["Value"=>17276,"TextKey"=>"剧情ID4060116","TextValue"=>"祭坛力量还是太过薄弱，缺少了最重要的一环。"],
17277=>["Value"=>17277,"TextKey"=>"剧情ID4060117","TextValue"=>"女神力量……@#$>:%^精粹……"],
17278=>["Value"=>17278,"TextKey"=>"剧情ID4060118","TextValue"=>"酋长，我好像知道了，你看祭坛柱子上的空缺！"],
17279=>["Value"=>17279,"TextKey"=>"剧情ID4060119","TextValue"=>"需要补充上精魄，增强祭坛的力量。咱们有吗？"],
17280=>["Value"=>17280,"TextKey"=>"剧情ID4060120","TextValue"=>"你说呢？阿兰，马上交给你们了。"],
17281=>["Value"=>17281,"TextKey"=>"剧情ID4060121","TextValue"=>"没问题！"],
17282=>["Value"=>17282,"TextKey"=>"剧情ID4070101","TextValue"=>"阿梅金，说点什么！"],
17283=>["Value"=>17283,"TextKey"=>"剧情ID4070102","TextValue"=>"你们需要来寻找我……"],
17284=>["Value"=>17284,"TextKey"=>"剧情ID4070103","TextValue"=>"这次没问题。你的声音终于听上去不像装咳嗽的麦格了，那个含糊劲儿！"],
17285=>["Value"=>17285,"TextKey"=>"剧情ID4070104","TextValue"=>"麦格还是个老太太。"],
17286=>["Value"=>17286,"TextKey"=>"剧情ID4070105","TextValue"=>"你这么一说……"],
17287=>["Value"=>17287,"TextKey"=>"剧情ID4070106","TextValue"=>"我曾经也到了火山，但不知发生了什么，等我清醒过来，就已经到了这里。我也不知道这是什么鬼地方。"],
17288=>["Value"=>17288,"TextKey"=>"剧情ID4070107","TextValue"=>"虽然你们的祭坛可以联系我，但我猜无法指引你们我在哪里……"],
17289=>["Value"=>17289,"TextKey"=>"剧情ID4070108","TextValue"=>"因为我可以接收并回应恩达，但这个地方……一定不会。还会想方设法地藏起来。"],
17290=>["Value"=>17290,"TextKey"=>"剧情ID4070109","TextValue"=>"有什么办法？"],
17291=>["Value"=>17291,"TextKey"=>"剧情ID4070110","TextValue"=>"要和环境一起共生……生生不息，构成循环。"],
17292=>["Value"=>17292,"TextKey"=>"剧情ID4070111","TextValue"=>"什么意思，让我们这里的火，流到你的冰窖那里？"],
17293=>["Value"=>17293,"TextKey"=>"剧情ID4070112","TextValue"=>"你个头脑简单的学渣！当然不是。"],
17294=>["Value"=>17294,"TextKey"=>"剧情ID4070113","TextValue"=>"循环……让岩浆流动，让飞灰升腾，让灰烬冷却，让石头再变成岩浆。"],
17295=>["Value"=>17295,"TextKey"=>"剧情ID4070114","TextValue"=>"你的确是个优等生。"],
17296=>["Value"=>17296,"TextKey"=>"剧情ID4070115","TextValue"=>"等着！"],
17297=>["Value"=>17297,"TextKey"=>"剧情ID4080101","TextValue"=>"这是个……猪头？"],
17298=>["Value"=>17298,"TextKey"=>"剧情ID4080102","TextValue"=>"嗯哼。"],
17299=>["Value"=>17299,"TextKey"=>"剧情ID4080103","TextValue"=>"道理我都懂，但为什么是猪头的形状？"],
17300=>["Value"=>17300,"TextKey"=>"剧情ID4080104","TextValue"=>"你等等，我似乎不该问这个问题。"],
17301=>["Value"=>17301,"TextKey"=>"剧情ID4080105","TextValue"=>"女神在上，成功的路上少不了亲爱的伙伴。为什么不把我的伙伴，什么斯坦的痕迹，留在这里呢？"],
17302=>["Value"=>17302,"TextKey"=>"剧情ID4080106","TextValue"=>"我们祭司多可爱啊，看这隐晦的示好方式。"],
17303=>["Value"=>17303,"TextKey"=>"剧情ID4080107","TextValue"=>"你！"],
17304=>["Value"=>17304,"TextKey"=>"剧情ID4080108","TextValue"=>"你们让开，我和酋长要发动这个祭坛了。"],
17305=>["Value"=>17305,"TextKey"=>"剧情ID4090101","TextValue"=>"呼，恩达，交给你了。"],
17306=>["Value"=>17306,"TextKey"=>"剧情ID4090102","TextValue"=>"阿梅金在……"],
17307=>["Value"=>17307,"TextKey"=>"剧情ID4090103","TextValue"=>"遥远东方……冰霜禁忌之地。"],
17308=>["Value"=>17308,"TextKey"=>"剧情ID4090104","TextValue"=>"虽然现在热得冒烟，但我想，我们该准备些御寒的衣物了。"],
17309=>["Value"=>17309,"TextKey"=>"剧情ID99990101","TextValue"=>"这雾比我遇到的任何一次危机都诡异！我在罗尔镇长大，没想到时隔多年再次回家，镇上多了这些可怕的灰雾！"],
17310=>["Value"=>17310,"TextKey"=>"剧情ID99990102","TextValue"=>"我离家没多久，就听说不远处的伊阿索火山爆发了。多年过去，这些火山灰雾还是久久不散。"],
17311=>["Value"=>17311,"TextKey"=>"剧情ID99990103","TextValue"=>"雾里有很多有害的可吸入颗粒物，必须驱散这雾，才能重建我童年时的小镇！"],
17312=>["Value"=>17312,"TextKey"=>"剧情ID47990201","TextValue"=>"嘿，干得好！没想到小麦居然还能在这种环境下生长！"],
17313=>["Value"=>17313,"TextKey"=>"剧情ID99990202","TextValue"=>"先采摘一些，看看能用它们来做什么吧！"],
17314=>["Value"=>17314,"TextKey"=>"剧情ID99990301","TextValue"=>"交付了面包订单后，我们用报酬买来了目前最需要的东西——"],
17315=>["Value"=>17315,"TextKey"=>"剧情ID99990302","TextValue"=>"照明灯！雾因为照明灯而变淡了些？我们可以试试用它清除迷雾！"],
17316=>["Value"=>17316,"TextKey"=>"剧情ID34990101","TextValue"=>"好的！我们有了一个计划：合并作物，制作食物，获得照明灯，清除迷雾！"],
17317=>["Value"=>17317,"TextKey"=>"剧情ID99990601","TextValue"=>"啊！这是什么？好像有个箱子埋在下面。"],
17318=>["Value"=>17318,"TextKey"=>"剧情ID99990602","TextValue"=>"我们快打开它！看看里面有什么。"],
17319=>["Value"=>17319,"TextKey"=>"剧情ID99990701","TextValue"=>"我们可以把这些用具收集起来，合成一下试试。"],
17320=>["Value"=>17320,"TextKey"=>"剧情ID99990702","TextValue"=>"我们成功了！果然，这些照明灯很管用！"],
17321=>["Value"=>17321,"TextKey"=>"剧情ID99991001","TextValue"=>"我很好奇一次合并5个相同物品会发生什么？"],
17322=>["Value"=>17322,"TextKey"=>"剧情ID99991002","TextValue"=>"我觉得应该把它们合起来试试，似乎会有好事情发生。相信我的第六感吧！"],
17323=>["Value"=>17323,"TextKey"=>"剧情ID99990801","TextValue"=>"这是什么？"],
17324=>["Value"=>17324,"TextKey"=>"剧情ID99990802","TextValue"=>"这些厨具看上去不错！花点时间，就能用这些厨具建造出一间像样的餐厅！"],
17325=>["Value"=>17325,"TextKey"=>"剧情ID99990803","TextValue"=>"哈！你是谁？吓我一跳！"],
17326=>["Value"=>17326,"TextKey"=>"剧情ID99990804","TextValue"=>"哈哈，不好意思了小姑娘。我叫瓦特，如你所见，是个工人，承接了罗尔镇重建项目。"],
17327=>["Value"=>17327,"TextKey"=>"剧情ID99990805","TextValue"=>"除了一些工作人员，我已经很久没看到过其他人了。你是来做什么的，小姑娘？"],
17328=>["Value"=>17328,"TextKey"=>"剧情ID99990806","TextValue"=>"你好，你可以叫我奥罗拉。我就是罗尔镇的人，只不过我很多年没回来了。我这次回来，就是为了做一些事，让我记忆中的美丽小镇再回来。"],
17329=>["Value"=>17329,"TextKey"=>"剧情ID99990807","TextValue"=>"你的厨艺如何？"],
17330=>["Value"=>17330,"TextKey"=>"剧情ID99990808","TextValue"=>"我想，还不错？我可以用微波炉把水煮开！"],
17331=>["Value"=>17331,"TextKey"=>"剧情ID99990809","TextValue"=>"哈哈，比我的双胞胎弟弟瓦里的手艺好！看来得靠你了！"],
17332=>["Value"=>17332,"TextKey"=>"剧情ID99990810","TextValue"=>"虽然的确如此……但是，也没有好到哪里去吧？"],
17333=>["Value"=>17333,"TextKey"=>"剧情ID99990811","TextValue"=>"没关系，我可以学呀！厨具都是现成的，只要google一下，没什么是做不出来的。"],
17334=>["Value"=>17334,"TextKey"=>"剧情ID99990812","TextValue"=>"那就太好了！如果能直接在罗尔镇吃饭，我们就不用天天带冷掉的便当了。"],
17335=>["Value"=>17335,"TextKey"=>"剧情ID99990501","TextValue"=>"这帽子看着有些简陋，不过形状不错。"],
17336=>["Value"=>17336,"TextKey"=>"剧情ID99990502","TextValue"=>"继续合成！我想这是个线索，能够找到助我们一臂之力的人。"],
17337=>["Value"=>17337,"TextKey"=>"剧情ID99990901","TextValue"=>"这四个神奇的底座是什么？看上去似乎需要什么物品来启动它们。"],
17338=>["Value"=>17338,"TextKey"=>"剧情ID99990902","TextValue"=>"这是修建我们的大餐厅做需要的底座。只要我们修建好了相应的房子，放在上面，就可以很轻松地修建梦想餐厅了。"],
17339=>["Value"=>17339,"TextKey"=>"剧情ID99990903","TextValue"=>"等到我们完成的时候，奥罗拉，我们会提醒你，让你自己在上面放置。"],
17340=>["Value"=>17340,"TextKey"=>"剧情ID99991101","TextValue"=>"我迫不及待想要找找里面藏着什么神秘的宝藏了。"],
17341=>["Value"=>17341,"TextKey"=>"剧情ID99991102","TextValue"=>"我们可以用它们合成可以开采的厨具资源！这样我们就有用不完的厨具了！"],
17342=>["Value"=>17342,"TextKey"=>"剧情ID99991201","TextValue"=>"非常有用的魔法水晶！可以代替任何一件你需要的物品！"],
17343=>["Value"=>17343,"TextKey"=>"剧情ID99991202","TextValue"=>"使用它，你只要2个，而不是3个相同物品就能合并！试着用起来吧！"],
17344=>["Value"=>17344,"TextKey"=>"剧情ID99991203","TextValue"=>"记住，魔法水晶能代替任何一件你需要的物品！"],
17345=>["Value"=>17345,"TextKey"=>"剧情ID99992001","TextValue"=>"欢迎来到海洋岛。你只能在有限的时间内访问它们，不过它们是最好玩的。想看一看吗？"],
17346=>["Value"=>17346,"TextKey"=>"剧情ID99993001","TextValue"=>"岛上有许许多多的美味，还有可爱的小馋猫！快来将好吃的给猫咪吧，美味岛限时开启！"],
17347=>["Value"=>17347,"TextKey"=>"剧情ID99993101","TextValue"=>"成功驱散了一大片迷雾！啊，地面上似乎有什么东西！"],
17348=>["Value"=>17348,"TextKey"=>"剧情ID99994001","TextValue"=>"岛上藏着数不尽的玩具与欢笑……欢乐岛玩具限时等你发掘！"],
17349=>["Value"=>17349,"TextKey"=>"剧情ID99995001","TextValue"=>"最美丽的花朵，尽皆汇聚于此……珍草岛宝藏限时等你发掘！"],
17350=>["Value"=>17350,"TextKey"=>"剧情ID39990201","TextValue"=>"如此丰富的服装资源！我怀疑哪个服装厂的库存都在其中了！"],
17351=>["Value"=>17351,"TextKey"=>"剧情ID39990202","TextValue"=>"这下我们不用担心服装店的原料问题了。"],
17352=>["Value"=>17352,"TextKey"=>"剧情ID34990201","TextValue"=>"我们的厨具库存告急了！"],
17353=>["Value"=>17353,"TextKey"=>"剧情ID39990301","TextValue"=>"来吧，更多更多的熨斗！"],
17354=>["Value"=>17354,"TextKey"=>"剧情ID39990401","TextValue"=>"为了更华美的游船，材料可是必不可少的哟！"],
17355=>["Value"=>17355,"TextKey"=>"剧情ID39990501","TextValue"=>"游船材料多多益善！"],
17356=>["Value"=>17356,"TextKey"=>"剧情ID39990601","TextValue"=>"这么多马车材料……难道这是个废弃的马车厂？"],
17357=>["Value"=>17357,"TextKey"=>"剧情ID39990701","TextValue"=>"我的城堡需要更多的材料！"],
17358=>["Value"=>17358,"TextKey"=>"剧情ID39990801","TextValue"=>"这……这么多的火柴！"],
17359=>["Value"=>17359,"TextKey"=>"剧情ID39990802","TextValue"=>"小火柴，这下你的城堡指日可待啦！哈哈哈。"],
17360=>["Value"=>17360,"TextKey"=>"剧情ID39990901","TextValue"=>"我可以不用房子，直接睡在稻草堆里！"],
17361=>["Value"=>17361,"TextKey"=>"剧情ID39990902","TextValue"=>"我倒是不担心你，杰克，但是我们做不到在稻草堆里找稻草人……"],
17362=>["Value"=>17362,"TextKey"=>"剧情ID39991001","TextValue"=>"放心，瓦特，我一定会找到足够的积木的。"],
17363=>["Value"=>17363,"TextKey"=>"剧情ID39991101","TextValue"=>"再来些积木！城堡马上快建成了。"],
17364=>["Value"=>17364,"TextKey"=>"剧情ID98880201","TextValue"=>"哇，这里可以采集出好多好多珍珠！"],
17365=>["Value"=>17365,"TextKey"=>"剧情ID98880301","TextValue"=>"有句话说，巧妇难为无米之炊。瓦特需要的材料，可一定不能少！"],
17366=>["Value"=>17366,"TextKey"=>"剧情ID30400301","TextValue"=>"快看看，怎么样？"],
17367=>["Value"=>17367,"TextKey"=>"剧情ID30400302","TextValue"=>"只要把食物放进去，调好时间就可以了。"],
17368=>["Value"=>17368,"TextKey"=>"剧情ID30400303","TextValue"=>"我很需要这种简单方便的工具！"],
17369=>["Value"=>17369,"TextKey"=>"剧情ID30410304","TextValue"=>"我想把每个人的特点揪出来，再最大程度地展示……"],
17370=>["Value"=>17370,"TextKey"=>"剧情ID30400401","TextValue"=>"我们的餐厅怎么能没有这个呢？"],
17371=>["Value"=>17371,"TextKey"=>"剧情ID30400402","TextValue"=>"只要调好温度，准确计时，我们就可以烤出香喷喷的面包了！"],
17372=>["Value"=>17372,"TextKey"=>"剧情ID30400403","TextValue"=>"真好，终于可以向冷掉的三明治告别了。"],
17373=>["Value"=>17373,"TextKey"=>"剧情ID30400501","TextValue"=>"地方有些小，不过该有的都有了。"],
17374=>["Value"=>17374,"TextKey"=>"剧情ID30400502","TextValue"=>"我们可以做出很棒的面包和小食了，谁看了不说这是满分早餐？哈哈。"],
17375=>["Value"=>17375,"TextKey"=>"剧情ID30400503","TextValue"=>"不过话又说回来，午餐还是太过单一。"],
17376=>["Value"=>17376,"TextKey"=>"剧情ID30400504","TextValue"=>"没错！接下来我们就朝美味午餐的方向努力吧！"],
17377=>["Value"=>17377,"TextKey"=>"剧情ID30400601","TextValue"=>"天妇罗真是金黄酥脆！咬一口，脆生生的外壳就破了，而里面的虾肉又嫩又鲜。天，这真的是我做出来的吗？"],
17378=>["Value"=>17378,"TextKey"=>"剧情ID30400602","TextValue"=>"哈哈哈，相信你的手艺。叉烧真不错！忙了一上午，我需要大口吃肉！"],
17379=>["Value"=>17379,"TextKey"=>"剧情ID30400603","TextValue"=>"对于晚餐有什么想法吗？我提议，接下来主要开发一种便携的食物如何？"],
17380=>["Value"=>17380,"TextKey"=>"剧情ID30400604","TextValue"=>"这样，镇上的居民可以在忙碌的时候吃，也可以悠闲地带回家享受。"],
17381=>["Value"=>17381,"TextKey"=>"剧情ID30400701","TextValue"=>"热狗搭配番茄酱和黄芥末酱，简直是天才的发明！"],
17382=>["Value"=>17382,"TextKey"=>"剧情ID30400702","TextValue"=>"我们的热狗店已经成了新的热门打卡地！"],
17383=>["Value"=>17383,"TextKey"=>"剧情ID30400703","TextValue"=>"很难想象奥罗拉不久之前还是一个厨房杀手。"],
17384=>["Value"=>17384,"TextKey"=>"剧情ID30400704","TextValue"=>"现在已经是大厨了，可以准备丰盛的早中晚餐。"],
17385=>["Value"=>17385,"TextKey"=>"剧情ID30400705","TextValue"=>"每天为了吃饭要跑三个地方，实在不适合我这种懒人啊。瓦里，不如你提个方案改进一下？"],
17386=>["Value"=>17386,"TextKey"=>"剧情ID30400801","TextValue"=>"当当当！现在你所看到的是本小镇最大的快餐厅，营养美味，健康快捷……"],
17387=>["Value"=>17387,"TextKey"=>"剧情ID30400802","TextValue"=>"这个古怪的播音腔是怎么回事？我记得近期没有采访计划。"],
17388=>["Value"=>17388,"TextKey"=>"剧情ID30400803","TextValue"=>"哈哈，不要问，习惯奥罗拉这个可爱的小疯子就好了！"],
17389=>["Value"=>17389,"TextKey"=>"剧情ID30400804","TextValue"=>"走吧。奥罗拉、瓦里，今天我请客，三人套餐！"],
17390=>["Value"=>17390,"TextKey"=>"剧情ID30400805","TextValue"=>"对了，餐厅建成了，我们还可以直接收取稳定的小镇工具！"],
17391=>["Value"=>17391,"TextKey"=>"剧情ID30400806","TextValue"=>"没错，能在里面找到好多有用的东西！"],
17392=>["Value"=>17392,"TextKey"=>"剧情ID31610301","TextValue"=>"帽子的样子改进了不少！我们需要找到它的主人。一定是个出色的设计师！"],
17393=>["Value"=>17393,"TextKey"=>"剧情ID31610401","TextValue"=>"嗯？竟然是你！"],
17394=>["Value"=>17394,"TextKey"=>"剧情ID31610402","TextValue"=>"对，奥罗拉，从你绝情地宣布分手已经过去了十八天！我飞到附近的机场，再赶过来在大雾里找你。这可真不容易。"],
17395=>["Value"=>17395,"TextKey"=>"剧情ID31610403","TextValue"=>"我知道我动摇不了你回罗尔镇的决心了。既然如此，还不如我来这里。"],
17396=>["Value"=>17396,"TextKey"=>"剧情ID31610404","TextValue"=>"……这里可没有什么美丽的衣服，没有什么可以吸引你的东西。反正没过多久你就要走了。"],
17397=>["Value"=>17397,"TextKey"=>"剧情ID31610405","TextValue"=>"美丽的衣服，我自己就可以做！我会留下来帮你的。"],
17398=>["Value"=>17398,"TextKey"=>"剧情ID30410301","TextValue"=>"说到我为什么想做服装——"],
17399=>["Value"=>17399,"TextKey"=>"剧情ID30410302","TextValue"=>"大多数人都穿着大同小异的衣服，说着不痛不痒的话，对身边的美视而不见。"],
17400=>["Value"=>17400,"TextKey"=>"剧情ID30410303","TextValue"=>"每个人都是不同的，但很多时候又显得根本没差别！"],
17401=>["Value"=>17401,"TextKey"=>"剧情ID30410304","TextValue"=>"我想把每个人的特点揪出来，再最大程度地展示……"],
17402=>["Value"=>17402,"TextKey"=>"剧情ID30410305","TextValue"=>"为此，没有比服装更便捷、更明显的东西了。"],
17403=>["Value"=>17403,"TextKey"=>"剧情ID30410306","TextValue"=>"现在，基本的工具都有了，可以让你们看看我的手艺。"],
17404=>["Value"=>17404,"TextKey"=>"剧情ID30410401","TextValue"=>"哇哦，好漂亮的儿童上衣！"],
17405=>["Value"=>17405,"TextKey"=>"剧情ID30410402","TextValue"=>"……"],
17406=>["Value"=>17406,"TextKey"=>"剧情ID30410403","TextValue"=>"其实这是我参考了以前奥罗拉的衣服。"],
17407=>["Value"=>17407,"TextKey"=>"剧情ID30410404","TextValue"=>"确实有点眼熟……哦，我想起来了！这很像之前去游乐园时候我穿的T恤。"],
17408=>["Value"=>17408,"TextKey"=>"剧情ID30410405","TextValue"=>"只是比较休闲而已啦，哪里像童装！不过，为什么做这样一件T恤？"],
17409=>["Value"=>17409,"TextKey"=>"剧情ID30410406","TextValue"=>"因为那天我很开心啊。"],
17410=>["Value"=>17410,"TextKey"=>"剧情ID30410501","TextValue"=>"哇哦，很利落的剪裁哦！"],
17411=>["Value"=>17411,"TextKey"=>"剧情ID30410502","TextValue"=>"嗯哼。"],
17412=>["Value"=>17412,"TextKey"=>"剧情ID30410503","TextValue"=>"而且全套配饰都有。帽子、包包、腰带……"],
17413=>["Value"=>17413,"TextKey"=>"剧情ID30410504","TextValue"=>"嗯哼。"],
17414=>["Value"=>17414,"TextKey"=>"剧情ID30410505","TextValue"=>"多做一些，店马上不就开起来了？"],
17415=>["Value"=>17415,"TextKey"=>"剧情ID30410601","TextValue"=>"怎么样？是我和瓦里费时费力选的材料。"],
17416=>["Value"=>17416,"TextKey"=>"剧情ID30410602","TextValue"=>"我猜你会喜欢剪刀的设计。"],
17417=>["Value"=>17417,"TextKey"=>"剧情ID30410603","TextValue"=>"的确如此！我喜欢这个大的橱窗设计！我再去挑选一些套装，放进里面展示。"],
17418=>["Value"=>17418,"TextKey"=>"剧情ID30410604","TextValue"=>"我提议再做一些帽子。早上在雾里工作，头发上总是有恼人的露水。"],
17419=>["Value"=>17419,"TextKey"=>"剧情ID30410701","TextValue"=>"除了瓦特他们的工作帽，我还做了很多装饰帽。"],
17420=>["Value"=>17420,"TextKey"=>"剧情ID30410702","TextValue"=>"看看，我做的帽子不错吧？小镇里的人一定会喜欢。"],
17421=>["Value"=>17421,"TextKey"=>"剧情ID30410703","TextValue"=>"好精致的蝴蝶结！"],
17422=>["Value"=>17422,"TextKey"=>"剧情ID30410704","TextValue"=>"我还会拓展别的周边业务，敬请期待。"],
17423=>["Value"=>17423,"TextKey"=>"剧情ID30410801","TextValue"=>"哇，你在鞋子上也保留了蝴蝶结设计！"],
17424=>["Value"=>17424,"TextKey"=>"剧情ID30410802","TextValue"=>"毕竟优秀的设计师总会倾听客人的意见。"],
17425=>["Value"=>17425,"TextKey"=>"剧情ID30410803","TextValue"=>"即便有时候客人的品位不那么尽如人意……"],
17426=>["Value"=>17426,"TextKey"=>"剧情ID30410804","TextValue"=>"你说什么？"],
17427=>["Value"=>17427,"TextKey"=>"剧情ID30410805","TextValue"=>"咳咳，我说，客人的品位颇为有趣。"],
17428=>["Value"=>17428,"TextKey"=>"剧情ID30410901","TextValue"=>"多棒的服装城！我得老实说，我之前没预料到本杰明的生意这么顺利！"],
17429=>["Value"=>17429,"TextKey"=>"剧情ID30410902","TextValue"=>"我喜欢这个小镇，这里的大家都很有品位。"],
17430=>["Value"=>17430,"TextKey"=>"剧情ID30410903","TextValue"=>"感谢瓦里的建筑设计。作为设计师同行，我得说你的优秀程度快赶上我了。"],
17431=>["Value"=>17431,"TextKey"=>"剧情ID30410904","TextValue"=>"嘿，我可以叫上萨拉，一起逛逛街。记得打折。"],
17432=>["Value"=>17432,"TextKey"=>"剧情ID31620301","TextValue"=>"本杰明，谁会需要这么多琴？"],
17433=>["Value"=>17433,"TextKey"=>"剧情ID31620302","TextValue"=>"哈哈，我可想不到是谁，但这个人的琴声一定不错！"],
17434=>["Value"=>17434,"TextKey"=>"剧情ID31620401","TextValue"=>"我感受到这些琴的力量逐渐在增长。"],
17435=>["Value"=>17435,"TextKey"=>"剧情ID31620501","TextValue"=>"这些琴，是一个乐者最好的武器！所以还能继续升级吗？"],
17436=>["Value"=>17436,"TextKey"=>"剧情ID31620601","TextValue"=>"我几乎能想象到这样的竖琴伫立在皇室豪华的音乐厅中的样子了。"],
17437=>["Value"=>17437,"TextKey"=>"剧情ID31620602","TextValue"=>"我想，这琴的主人会有这样的机会的。"],
17438=>["Value"=>17438,"TextKey"=>"剧情ID31620701","TextValue"=>"在下名为兰博。我又多了一件可以唱成颂歌的事情！"],
17439=>["Value"=>17439,"TextKey"=>"剧情ID31620702","TextValue"=>"唔，若是有一份冰淇淋松饼，再配上兰博你的乐声，那简直是最好的组合了！简直比搭配肉桂粉都好！"],
17440=>["Value"=>17440,"TextKey"=>"剧情ID31620703","TextValue"=>"在圆弧的大厅里，在田野的轻风中，在赞歌所赠之人面前。"],
17441=>["Value"=>17441,"TextKey"=>"剧情ID30420401","TextValue"=>"我喜欢这个精巧的门。我想，海上或许需要一个风向标？"],
17442=>["Value"=>17442,"TextKey"=>"剧情ID30420501","TextValue"=>"这不禁让我想起了以前冒险的日子啊。听我的，我们需要加高一下底座，要知道，海浪的拍打可不是闹着玩的。"],
17443=>["Value"=>17443,"TextKey"=>"剧情ID30420601","TextValue"=>"真不错，瓦里你是个毋庸置疑的天才！"],
17444=>["Value"=>17444,"TextKey"=>"剧情ID30420602","TextValue"=>"哈哈哈，瓦里一向是最好的！而且，以我对他的了解，这还远远不到欢呼庆祝的时候。"],
17445=>["Value"=>17445,"TextKey"=>"剧情ID30420701","TextValue"=>"赞美这高超的技艺！我们还需要什么呢……黑暗的夜晚，我们需要美妙的光亮，成为旅人的灯塔。"],
17446=>["Value"=>17446,"TextKey"=>"剧情ID30420801","TextValue"=>"这样美妙的船屋，只要再准备几个，我们的游轮就可以扬帆起航了！"],
17447=>["Value"=>17447,"TextKey"=>"剧情ID30420901","TextValue"=>"我已经听到了海浪的拍打声，嗅到了风暴前夕的味道。真是令人期待！"],
17448=>["Value"=>17448,"TextKey"=>"剧情ID30420902","TextValue"=>"哈哈，兰博已经沉浸在探险生活的畅想中了。瓦特、瓦里，你们果然是最好的匠人！"],
17449=>["Value"=>17449,"TextKey"=>"剧情ID30420903","TextValue"=>"有了这座游船城堡，也意味着我们实力大增！"],
17450=>["Value"=>17450,"TextKey"=>"剧情ID31630301","TextValue"=>"鼓身长了，终于像是大人用的了！我想自己敲鼓试试，哈哈！"],
17451=>["Value"=>17451,"TextKey"=>"剧情ID31630401","TextValue"=>"要我说，鼓身还需要一个固定带，便于保护鼓面。"],
17452=>["Value"=>17452,"TextKey"=>"剧情ID31630501","TextValue"=>"加固一下支架如何？兰博最清楚，他们这种人，一演奏起来可能会忘乎所以。弄坏了就不好了。"],
17453=>["Value"=>17453,"TextKey"=>"剧情ID31630502","TextValue"=>"的确如此。我送走了1,2,3,4……不少把竖琴呢。"],
17454=>["Value"=>17454,"TextKey"=>"剧情ID31630601","TextValue"=>"羽毛装饰的确十分可爱，还很有特色。兰博，你觉得呢？"],
17455=>["Value"=>17455,"TextKey"=>"剧情ID31630602","TextValue"=>"不过演奏起来可能会碍事，还是改动一下装饰位置比较好。"],
17456=>["Value"=>17456,"TextKey"=>"剧情ID31630701","TextValue"=>"这次肯定不会妨碍敲鼓了。"],
17457=>["Value"=>17457,"TextKey"=>"剧情ID31630702","TextValue"=>"但减弱了原来那种古朴又精巧的美感。兰博，你看这还有改进空间吗？"],
17458=>["Value"=>17458,"TextKey"=>"剧情ID31630801","TextValue"=>"是你们找到了我的乐鼓吗？谢谢你们！"],
17459=>["Value"=>17459,"TextKey"=>"剧情ID31630802","TextValue"=>"好可爱的小姑娘！"],
17460=>["Value"=>17460,"TextKey"=>"剧情ID31630803","TextValue"=>"嘻嘻，谢谢。我叫美乐蒂，可以叫我小美哦。我也不知道为什么，醒来就发现自己在这场迷雾中了。"],
17461=>["Value"=>17461,"TextKey"=>"剧情ID31630804","TextValue"=>"大家都是如此。小美，很高兴你加入我们一起探索！"],
17462=>["Value"=>17462,"TextKey"=>"剧情ID30430301","TextValue"=>"美丽的大珍珠，这正是我想要的样子呀！哈哈，虽然不能居住啦。"],
17463=>["Value"=>17463,"TextKey"=>"剧情ID30430302","TextValue"=>"我就想你一定喜欢！不过，小美，接下来我们就得做屋子了哦。"],
17464=>["Value"=>17464,"TextKey"=>"剧情ID30430401","TextValue"=>"瓦里很有创意嘛！贝壳做房顶，美丽归美丽，会不会太脆弱了？"],
17465=>["Value"=>17465,"TextKey"=>"剧情ID30430501","TextValue"=>"亲爱的瓦特、瓦里，可以把房子再扩大些吗？我想扩充更大空间放置珍珠和海贝。"],
17466=>["Value"=>17466,"TextKey"=>"剧情ID30430502","TextValue"=>"稍等。"],
17467=>["Value"=>17467,"TextKey"=>"剧情ID30430601","TextValue"=>"用海藻加些装饰怎么样？"],
17468=>["Value"=>17468,"TextKey"=>"剧情ID30430701","TextValue"=>"太美啦！嘻嘻，我好开心啊，看到珍珠屋就忍不住笑！"],
17469=>["Value"=>17469,"TextKey"=>"剧情ID30430702","TextValue"=>"哈哈哈，小美，你可以再等一会！我偷偷拿到了瓦里接下来的设计图……"],
17470=>["Value"=>17470,"TextKey"=>"剧情ID30430801","TextValue"=>"天哪，还多了两座尖顶高塔！这是即便在我最奢侈的梦里也没有出现过的场景！"],
17471=>["Value"=>17471,"TextKey"=>"剧情ID30430802","TextValue"=>"只要有四栋这样的豪宅，顶级的城堡指日可待。"],
17472=>["Value"=>17472,"TextKey"=>"剧情ID30430901","TextValue"=>"怎么样，不错吧，我就看小美很喜欢尖顶的样子。"],
17473=>["Value"=>17473,"TextKey"=>"剧情ID30430902","TextValue"=>"我可以进去吗？那我进去啦？哈哈，我的鼓呢，我好想敲鼓！"],
17474=>["Value"=>17474,"TextKey"=>"剧情ID30430903","TextValue"=>"我来为你伴奏，小美。"],
17475=>["Value"=>17475,"TextKey"=>"剧情ID31640301","TextValue"=>"这个王冠原本的主人一定是个位高权重之人。奥罗拉，你有没有什么印象呢？"],
17476=>["Value"=>17476,"TextKey"=>"剧情ID31640302","TextValue"=>"不太清楚，没有我们家族的印记。这样我也想不出是属于谁的了。"],
17477=>["Value"=>17477,"TextKey"=>"剧情ID31640401","TextValue"=>"华美的金子，精致的冠冕，作为诗歌的意象，它们与权柄如此相称。"],
17478=>["Value"=>17478,"TextKey"=>"剧情ID31640501","TextValue"=>"还加上了美丽深邃的绿宝石！"],
17479=>["Value"=>17479,"TextKey"=>"剧情ID31640601","TextValue"=>"如此华贵的王冠，本杰明刚刚居然告诉我这还不是顶级！"],
17480=>["Value"=>17480,"TextKey"=>"剧情ID31640602","TextValue"=>"对，我可以感受到上面附着的魔力，还远远没有达到上限。"],
17481=>["Value"=>17481,"TextKey"=>"剧情ID31640701","TextValue"=>"等王冠的主人来了，不知道我能不能借着戴一戴呢，这实在是太漂亮啦。"],
17482=>["Value"=>17482,"TextKey"=>"剧情ID31640801","TextValue"=>"魔力涌动得十分剧烈，它的主人很快就会降临了！"],
17483=>["Value"=>17483,"TextKey"=>"剧情ID31640901","TextValue"=>"嘿，奥罗拉公主，居然是你！"],
17484=>["Value"=>17484,"TextKey"=>"剧情ID31640902","TextValue"=>"难以置信！我一直没想到你也困在这里了。嘿，各位，这是狮王辛巴。"],
17485=>["Value"=>17485,"TextKey"=>"剧情ID31640903","TextValue"=>"这里的环境我已经有了初步的判断。我想，继续修建领地刻不容缓。"],
17486=>["Value"=>17486,"TextKey"=>"剧情ID30440301","TextValue"=>"这个简陋的马车可很难遮风挡雨。"],
17487=>["Value"=>17487,"TextKey"=>"剧情ID30440302","TextValue"=>"狮王陛下，的确如此。我们还需要一些时间。"],
17488=>["Value"=>17488,"TextKey"=>"剧情ID30440401","TextValue"=>"虽然还很简单，但是已经有了加工的雏形。"],
17489=>["Value"=>17489,"TextKey"=>"剧情ID30440402","TextValue"=>"给车夫改良下座椅吧，长途赶路可是很不容易的。"],
17490=>["Value"=>17490,"TextKey"=>"剧情ID30440501","TextValue"=>"很好，车里的座位同样需要改进，瓦特、瓦里，麻烦你们了。"],
17491=>["Value"=>17491,"TextKey"=>"剧情ID30440601","TextValue"=>"舒适度大大提升！要我说，试试密闭型车厢如何？隐私和安全兼顾。"],
17492=>["Value"=>17492,"TextKey"=>"剧情ID30440701","TextValue"=>"果然很不错！瓦特、瓦里，早就听说你们技艺精湛！可惜我的子民只有毛爪子，这种精细活儿，根本就是在难为狮子！"],
17493=>["Value"=>17493,"TextKey"=>"剧情ID30440702","TextValue"=>"哈哈哈哈，谢谢狮王陛下的赞赏！改进还没完成呢，您可以期待一下。"],
17494=>["Value"=>17494,"TextKey"=>"剧情ID30440801","TextValue"=>"瓦里，再增高一层能做到吗？魔力的循环需要一定的高度。"],
17495=>["Value"=>17495,"TextKey"=>"剧情ID30440802","TextValue"=>"可以，挑高设计是瓦特的专长。"],
17496=>["Value"=>17496,"TextKey"=>"剧情ID30440901","TextValue"=>"瓦特、瓦里，以后随我去我的王国如何？保证比待在人类王国的待遇更加优厚。"],
17497=>["Value"=>17497,"TextKey"=>"剧情ID30440902","TextValue"=>"辛巴，我还在这里呢！我以为你至少会避着我挖我的墙角？"],
17498=>["Value"=>17498,"TextKey"=>"剧情ID30441001","TextValue"=>"对我来说，这座大型城堡最大的意义是可以舒适随意地去任何地方。"],
17499=>["Value"=>17499,"TextKey"=>"剧情ID30441002","TextValue"=>"辛巴一直在草原上驰骋，果然就连住的城堡也不能安安定定地待在那儿。"],
17500=>["Value"=>17500,"TextKey"=>"剧情ID30441003","TextValue"=>"瓦特、瓦里，关于请务必认真考虑我之前的提议。"],
17501=>["Value"=>17501,"TextKey"=>"剧情ID31650301","TextValue"=>"哇哦，愈发丰盛啦！不过这个分量对我来说太小啦。"],
17502=>["Value"=>17502,"TextKey"=>"剧情ID31650401","TextValue"=>"餐桌和食物上的魔力正在逐渐充盈。"],
17503=>["Value"=>17503,"TextKey"=>"剧情ID31650501","TextValue"=>"我还是喜欢吃肉，正好奥罗拉喜欢甜点。各司其职，哈哈！"],
17504=>["Value"=>17504,"TextKey"=>"剧情ID31650601","TextValue"=>"不禁让我怀念起了以前举办宴会的日子。我们现在虽然人数少了点，但也可以准备准备，一起吃大餐！"],
17505=>["Value"=>17505,"TextKey"=>"剧情ID31650701","TextValue"=>"这是美好夜晚的意象。"],
17506=>["Value"=>17506,"TextKey"=>"剧情ID31650801","TextValue"=>"魔力几乎到达了顶峰，我们很快可以见到这些美丽幻觉的主人了。"],
17507=>["Value"=>17507,"TextKey"=>"剧情ID31650901","TextValue"=>"……"],
17508=>["Value"=>17508,"TextKey"=>"剧情ID31650902","TextValue"=>"你好啊，可爱的小姑娘。你叫什么名字？"],
17509=>["Value"=>17509,"TextKey"=>"剧情ID31650903","TextValue"=>"我……我没有名字。或许，也许，你可以叫我火柴。"],
17510=>["Value"=>17510,"TextKey"=>"剧情ID31650904","TextValue"=>"好的。孩子，别怕，快来我们的城堡里取个暖吧。"],
17511=>["Value"=>17511,"TextKey"=>"剧情ID30450301","TextValue"=>"怎么样，小火柴，这个火柴盒是不是你想要的样子？"],
17512=>["Value"=>17512,"TextKey"=>"剧情ID30450302","TextValue"=>"对，对的。我只要蜷缩起来，就可以躺进里面了，很挡风的。"],
17513=>["Value"=>17513,"TextKey"=>"剧情ID30450401","TextValue"=>"谢谢你，瓦特。没有想到，我也拥有房梁啦。真好！"],
17514=>["Value"=>17514,"TextKey"=>"剧情ID30450501","TextValue"=>"我可以在屋子里面站起来了，而不仅仅是躺着。"],
17515=>["Value"=>17515,"TextKey"=>"剧情ID30450601","TextValue"=>"小火柴，我想这个挡风帘你一定会喜欢。"],
17516=>["Value"=>17516,"TextKey"=>"剧情ID30450602","TextValue"=>"真的！我可以少点一些火柴来取暖啦。"],
17517=>["Value"=>17517,"TextKey"=>"剧情ID30450701","TextValue"=>"嘿嘿，我最擅长的挑高设计！"],
17518=>["Value"=>17518,"TextKey"=>"剧情ID30450702","TextValue"=>"谢谢！这是我见过最漂亮的房子……以前街上的大商人的房子，也没有这么漂亮。"],
17519=>["Value"=>17519,"TextKey"=>"剧情ID30450801","TextValue"=>"如果只能对房屋提一个要求，那你的要求是什么呢？"],
17520=>["Value"=>17520,"TextKey"=>"剧情ID30450802","TextValue"=>"啊……有房屋已经很好啦，我没有什么要求。"],
17521=>["Value"=>17521,"TextKey"=>"剧情ID30450803","TextValue"=>"不可以哦，小火柴！再努力想一想！一定有什么地方的，加油再思考一下。"],
17522=>["Value"=>17522,"TextKey"=>"剧情ID30450804","TextValue"=>"嗯……我想，是暖和。一定要暖和。"],
17523=>["Value"=>17523,"TextKey"=>"剧情ID30450901","TextValue"=>"只要有四栋这样的豪宅，小火柴也可以拥有自己的城堡了。是只属于小火柴的新家。"],
17524=>["Value"=>17524,"TextKey"=>"剧情ID30451001","TextValue"=>"你们说的是真的吗？……这个美丽的城堡，是我的？"],
17525=>["Value"=>17525,"TextKey"=>"剧情ID30451002","TextValue"=>"当然啦，亲爱的小火柴。正是由于此处很危险，我们才要更加重视我们的栖身之所啊。"],
17526=>["Value"=>17526,"TextKey"=>"剧情ID30451003","TextValue"=>"呜呜呜……谢谢，谢谢大家。"],
17527=>["Value"=>17527,"TextKey"=>"剧情ID30451004","TextValue"=>"快去休息吧，为未来的挑战养精蓄锐！"],
17528=>["Value"=>17528,"TextKey"=>"剧情ID31660301","TextValue"=>"加固设计倒是解了燃眉之急。不过，能不能把灯架改良成更简洁的款式呢？现在有些遮挡视线。"],
17529=>["Value"=>17529,"TextKey"=>"剧情ID31660401","TextValue"=>"不知道来者会是哪位提灯人呢？"],
17530=>["Value"=>17530,"TextKey"=>"剧情ID31660501","TextValue"=>"火焰很闪亮呢，本杰明，是不是和之前比显著变强了？"],
17531=>["Value"=>17531,"TextKey"=>"剧情ID31660502","TextValue"=>"的确如此，陛下。这就是魔力增强的表现。"],
17532=>["Value"=>17532,"TextKey"=>"剧情ID31660601","TextValue"=>"这是……南瓜？南瓜甜蜜的香气，和诡异的特性，是最适合做夜曲主题的植物呢。"],
17533=>["Value"=>17533,"TextKey"=>"剧情ID31660701","TextValue"=>"可爱的南瓜灯，可以做一个精致的小摆件呢。"],
17534=>["Value"=>17534,"TextKey"=>"剧情ID31660702","TextValue"=>"虽然看不出来，但其实它所蕴含的魔力不容小觑哦。"],
17535=>["Value"=>17535,"TextKey"=>"剧情ID31660801","TextValue"=>"你有没有注意到，南瓜灯的表情愈发生动，动作也很像人的动作？"],
17536=>["Value"=>17536,"TextKey"=>"剧情ID31660802","TextValue"=>"我有预感，这位南瓜朋友很快就会与我们见面了。"],
17537=>["Value"=>17537,"TextKey"=>"剧情ID31660901","TextValue"=>"嘿，你们，准备好参加午夜的惊吓派对了吗？"],
17538=>["Value"=>17538,"TextKey"=>"剧情ID31660902","TextValue"=>"小南瓜，不要吓唬小孩子！话说，你的南瓜头采摘的时候熟了吗？甜不甜？"],
17539=>["Value"=>17539,"TextKey"=>"剧情ID31660903","TextValue"=>"嗯……其实南瓜这种食物，里面有种叫南瓜素的东西，有剧毒的，不能吃。还有，我叫杰克，不叫小南瓜。"],
17540=>["Value"=>17540,"TextKey"=>"剧情ID31660904","TextValue"=>"好吧杰克。你刚刚说，“南瓜这种食物”？"],
17541=>["Value"=>17541,"TextKey"=>"剧情ID31660905","TextValue"=>"……再见小姐！"],
17542=>["Value"=>17542,"TextKey"=>"剧情ID30460301","TextValue"=>"对我来说稻草就是最御寒的东西啦。"],
17543=>["Value"=>17543,"TextKey"=>"剧情ID30460401","TextValue"=>"你们想想，有什么是别人一看到就会吓一跳的……对了，骷髅！我要在我的屋门口安装上骷髅！"],
17544=>["Value"=>17544,"TextKey"=>"剧情ID30460501","TextValue"=>"为什么不在外观上装一个南瓜呢？就像我安装了胡萝卜一样。"],
17545=>["Value"=>17545,"TextKey"=>"剧情ID30460601","TextValue"=>"打个天窗怎么样，杰克先生？就是骷髅装饰只能摘下来了。"],
17546=>["Value"=>17546,"TextKey"=>"剧情ID30460701","TextValue"=>"我很喜欢！但我喜欢更大的南瓜，你们可以帮我吗？"],
17547=>["Value"=>17547,"TextKey"=>"剧情ID30460702","TextValue"=>"当然。雕刻工作就交给瓦特。"],
17548=>["Value"=>17548,"TextKey"=>"剧情ID30460801","TextValue"=>"哇，好漂亮！咳咳，不，我是说……我是说我还需要一个提灯！对，提灯！"],
17549=>["Value"=>17549,"TextKey"=>"剧情ID30460901","TextValue"=>"这简直就是杰克的放大版！小杰克住在大杰克里，哈哈。"],
17550=>["Value"=>17550,"TextKey"=>"剧情ID30461001","TextValue"=>"哇哦，我的南瓜，我的稻草，我的提灯！瓦特、瓦里，你们简直是天才！我保证，下次我恶作剧一定绕过你们！"],
17551=>["Value"=>17551,"TextKey"=>"剧情ID30461002","TextValue"=>"绕过我就可以了。请务必不要放过瓦特。"],
17552=>["Value"=>17552,"TextKey"=>"剧情ID31670301","TextValue"=>"是一只美丽的团扇。看，充满了东方风情。"],
17553=>["Value"=>17553,"TextKey"=>"剧情ID31670302","TextValue"=>"看来我的灵感将会迎来新的来源！我已经迫不及待地想知道扇子将会召唤出谁了。"],
17554=>["Value"=>17554,"TextKey"=>"剧情ID31670401","TextValue"=>"多了两只漂亮的扇骨。是鲜嫩的绿色，摸上去凉丝丝的，很舒服。"],
17555=>["Value"=>17555,"TextKey"=>"剧情ID31670402","TextValue"=>"这……这似乎是竹子做的？我们本土没有这种植物，是外来的种类。"],
17556=>["Value"=>17556,"TextKey"=>"剧情ID31670403","TextValue"=>"我们的新朋友越来越神秘了。加油继续吧！"],
17557=>["Value"=>17557,"TextKey"=>"剧情ID31670501","TextValue"=>"这次我们可以将它折叠起来了！"],
17558=>["Value"=>17558,"TextKey"=>"剧情ID31670502","TextValue"=>"我已经了解了它的好处。夏天如果有这样一把扇子，我就不需要担心汗水破坏我的发型了。"],
17559=>["Value"=>17559,"TextKey"=>"剧情ID31670601","TextValue"=>"哇哦，我发现了绿色的漂亮石头！有点像绿宝石，但又不太一样。"],
17560=>["Value"=>17560,"TextKey"=>"剧情ID31670602","TextValue"=>"这是东方的美玉。"],
17561=>["Value"=>17561,"TextKey"=>"剧情ID31670603","TextValue"=>"我想知道这扇子还能变得更美吗？"],
17562=>["Value"=>17562,"TextKey"=>"剧情ID31670701","TextValue"=>"哇，扇面变得更大了，简直像一只翅膀。"],
17563=>["Value"=>17563,"TextKey"=>"剧情ID31670801","TextValue"=>"本杰明，快来看，很强劲的魔力涌动！"],
17564=>["Value"=>17564,"TextKey"=>"剧情ID31670802","TextValue"=>"这些魔力的实现方式，和我们的差别巨大。"],
17565=>["Value"=>17565,"TextKey"=>"剧情ID31670803","TextValue"=>"也许，这位新朋友，会让我们的团队豁然开朗也说不定呢。"],
17566=>["Value"=>17566,"TextKey"=>"剧情ID31670901","TextValue"=>"嘿嘿！这是哪儿？有没有美味的特产？"],
17567=>["Value"=>17567,"TextKey"=>"剧情ID31670902","TextValue"=>"想必你就是我们一直在等的新朋友了！我是奥罗拉，你可以先来休息一下。"],
17568=>["Value"=>17568,"TextKey"=>"剧情ID31670903","TextValue"=>"你们可以叫我阿潘。你这是在招揽我吗？可以，只要你的功夫比我强，我就愿意拜师。来吧，我们比试比试！"],
17569=>["Value"=>17569,"TextKey"=>"剧情ID31670904","TextValue"=>"功夫？那是什么？总之打赢你就可以了是吧。哼，完全是小菜一碟！上吧，辛巴。给他点颜色瞧瞧。"],
17570=>["Value"=>17570,"TextKey"=>"剧情ID31670905","TextValue"=>"我还以为你要上场呢……看，他们两个已经交上手了！"],
17571=>["Value"=>17571,"TextKey"=>"剧情ID31670906","TextValue"=>"咳咳咳，很有一套嘛！"],
17572=>["Value"=>17572,"TextKey"=>"剧情ID30470301","TextValue"=>"哇哦，茂盛的竹子！看上去很好吃！"],
17573=>["Value"=>17573,"TextKey"=>"剧情ID30470302","TextValue"=>"其实不是食物哦，阿潘先生。是建筑材料。"],
17574=>["Value"=>17574,"TextKey"=>"剧情ID30470401","TextValue"=>"这下子可算是把竹子处理好了！可以动工啦。"],
17575=>["Value"=>17575,"TextKey"=>"剧情ID30470402","TextValue"=>"砍伐竹子的手感和砍伐木材很不一样，可以根据材质，设计出一个前所未有的新城堡！是吧，瓦里！"],
17576=>["Value"=>17576,"TextKey"=>"剧情ID30470403","TextValue"=>"的确。难得瓦特提出了建设性意见呢。"],
17577=>["Value"=>17577,"TextKey"=>"剧情ID30470501","TextValue"=>"哇，我已经看到了房间的雏形！我可以在里面打滚啦哈哈哈。"],
17578=>["Value"=>17578,"TextKey"=>"剧情ID30470502","TextValue"=>"打滚可以，千万控制住自己不要吃啊！"],
17579=>["Value"=>17579,"TextKey"=>"剧情ID30470601","TextValue"=>"就像人类的糖果屋一样，这是属于熊猫的竹子小屋。"],
17580=>["Value"=>17580,"TextKey"=>"剧情ID30470602","TextValue"=>"这样说的话，我已经能想象到瓦特啃窗户的样子了。"],
17581=>["Value"=>17581,"TextKey"=>"剧情ID30470701","TextValue"=>"嘿，阿潘，快来看新加的灯笼！这是本杰明阁下提供的设计图纸，很独特吧！"],
17582=>["Value"=>17582,"TextKey"=>"剧情ID30470702","TextValue"=>"你应该会喜欢，我找到了你家乡的灯笼样式。"],
17583=>["Value"=>17583,"TextKey"=>"剧情ID30470703","TextValue"=>"哇！我真的很喜欢！我还可以要更多吗？"],
17584=>["Value"=>17584,"TextKey"=>"剧情ID30470704","TextValue"=>"等着！"],
17585=>["Value"=>17585,"TextKey"=>"剧情ID30470801","TextValue"=>"没想到瓦特、瓦里首次使用竹子就建造得这么出色！精致的双层挑高，不愧是你们！"],
17586=>["Value"=>17586,"TextKey"=>"剧情ID30470802","TextValue"=>"你们真的增加了灯笼！哇谢谢，这样我夜间也可以练功了。"],
17587=>["Value"=>17587,"TextKey"=>"剧情ID30470803","TextValue"=>"可以麻烦瓦特先生、瓦里先生，再加高一下建筑吗？这样，我就可以继续练习翻跟斗了。还是连续的！"],
17588=>["Value"=>17588,"TextKey"=>"剧情ID30470901","TextValue"=>"哇哦，真是让人眼前一亮！美丽又实用，多了窗口设计。"],
17589=>["Value"=>17589,"TextKey"=>"剧情ID30470902","TextValue"=>"我的天，我从未想过竹子除了吃，还能建造出如此壮观的房屋！"],
17590=>["Value"=>17590,"TextKey"=>"剧情ID30470903","TextValue"=>"只要拥有4个这样的豪宅，我们还可以建造堡垒！"],
17591=>["Value"=>17591,"TextKey"=>"剧情ID30470904","TextValue"=>"阿潘，你可以期待一下哦。"],
17592=>["Value"=>17592,"TextKey"=>"剧情ID30471001","TextValue"=>"……我的眼睛没有出问题吧？"],
17593=>["Value"=>17593,"TextKey"=>"剧情ID30471002","TextValue"=>"本来以为之前已经很棒了，没想到还能有更棒的！……我是醒着的吧？"],
17594=>["Value"=>17594,"TextKey"=>"剧情ID30471003","TextValue"=>"灯笼转移至室内了。谢谢你，阿潘先生，没有比这更好的赞美了。"],
17595=>["Value"=>17595,"TextKey"=>"剧情ID31680301","TextValue"=>"士兵的帽子！"],
17596=>["Value"=>17596,"TextKey"=>"剧情ID31680302","TextValue"=>"肯定不是狮子士兵，我的属下不需要。帽子反而会限制他们的发挥。"],
17597=>["Value"=>17597,"TextKey"=>"剧情ID31680303","TextValue"=>"希望早点见到他。"],
17598=>["Value"=>17598,"TextKey"=>"剧情ID31680401","TextValue"=>"帽子的军衔提升了。"],
17599=>["Value"=>17599,"TextKey"=>"剧情ID31680402","TextValue"=>"这也是魔力提升的证明呢。"],
17600=>["Value"=>17600,"TextKey"=>"剧情ID31680501","TextValue"=>"装饰替换成了金色的星星。看来帽子上的力量越发强大了。"],
17601=>["Value"=>17601,"TextKey"=>"剧情ID31680601","TextValue"=>"不知道会是哪里的军队呢。看这个精致的宝石，小美有什么线索吗？"],
17602=>["Value"=>17602,"TextKey"=>"剧情ID31680602","TextValue"=>"为什么小美会有线索？她不在，和兰博去研究新曲子了。"],
17603=>["Value"=>17603,"TextKey"=>"剧情ID31680603","TextValue"=>"因为军队经常需要鼓声来振奋士气，小美可能会有所了解。"],
17604=>["Value"=>17604,"TextKey"=>"剧情ID31680701","TextValue"=>"哇，好华丽的帽子！"],
17605=>["Value"=>17605,"TextKey"=>"剧情ID31680702","TextValue"=>"我感觉这位军官不是人类哦。因为魔力上附着的声音，不属于军队会用的任何一种鼓。究竟是什么呢……嗯……"],
17606=>["Value"=>17606,"TextKey"=>"剧情ID31680801","TextValue"=>"魔力涌动得十分剧烈！这位新朋友马上就能到了。"],
17607=>["Value"=>17607,"TextKey"=>"剧情ID31680901","TextValue"=>"日安，各位。"],
17608=>["Value"=>17608,"TextKey"=>"剧情ID31680902","TextValue"=>"原来是胡桃夹子！你好啊，士兵先生，你叫什么名字？"],
17609=>["Value"=>17609,"TextKey"=>"剧情ID31680903","TextValue"=>"我没有名字，名字对我来说并不重要。我只负责守护你们、保卫疆土。"],
17610=>["Value"=>17610,"TextKey"=>"剧情ID31680904","TextValue"=>"来吧，士兵先生，我带你认识一下我的朋友们。"],
17611=>["Value"=>17611,"TextKey"=>"剧情ID30480301","TextValue"=>"不得不说，积木建造起来太方便了，可以说是得心应手。"],
17612=>["Value"=>17612,"TextKey"=>"剧情ID30480302","TextValue"=>"谢谢你们，这些材料让我倍感亲切，像回家了一样。"],
17613=>["Value"=>17613,"TextKey"=>"剧情ID30480401","TextValue"=>"加大加高的门果然更好用了。"],
17614=>["Value"=>17614,"TextKey"=>"剧情ID30480402","TextValue"=>"还没有完成，我们会继续加高。"],
17615=>["Value"=>17615,"TextKey"=>"剧情ID30480501","TextValue"=>"十分美丽，谢谢瓦特、瓦里的帮助。接下来，我想要更坚实的房子。"],
17616=>["Value"=>17616,"TextKey"=>"剧情ID30480502","TextValue"=>"我知道为什么，这样更方便抵御敌人，是吗？"],
17617=>["Value"=>17617,"TextKey"=>"剧情ID30480503","TextValue"=>"是的，殿下。随时准备着！"],
17618=>["Value"=>17618,"TextKey"=>"剧情ID30480601","TextValue"=>"漂亮的小屋！用积木做的是吗？哈哈，那我用力一推的话……"],
17619=>["Value"=>17619,"TextKey"=>"剧情ID30480602","TextValue"=>"很遗憾呢，杰克，你想的事情并不会发生。中间的黏合剂牢固得超出你的想象，是瓦里的专利技术。"],
17620=>["Value"=>17620,"TextKey"=>"剧情ID30480701","TextValue"=>"接下来我想加上灯光。夜晚的视野非常重要。"],
17621=>["Value"=>17621,"TextKey"=>"剧情ID30480702","TextValue"=>"的确如此！"],
17622=>["Value"=>17622,"TextKey"=>"剧情ID30480801","TextValue"=>"谢谢你们扩大了小屋。这很有必要，军事训练和制作武器都很费空间。"],
17623=>["Value"=>17623,"TextKey"=>"剧情ID30480802","TextValue"=>"我很期待接下来会变成什么样？总之瓦特和瓦里从未让人失望过！"],
17624=>["Value"=>17624,"TextKey"=>"剧情ID30480901","TextValue"=>"非常壮观！住在这里感觉很有安全感！"],
17625=>["Value"=>17625,"TextKey"=>"剧情ID30480902","TextValue"=>"接下来我们准备进行外部加固，可以防风、防雨，还能防火。"],
17626=>["Value"=>17626,"TextKey"=>"剧情ID30481001","TextValue"=>"哇，只要看着我就能感觉到这座房屋的坚不可摧！"],
17627=>["Value"=>17627,"TextKey"=>"剧情ID30481002","TextValue"=>"据说我们马上就能修建堡垒了是吗？"],
17628=>["Value"=>17628,"TextKey"=>"剧情ID30481003","TextValue"=>"没错，而且我们还为你准备了小惊喜，士兵先生。"],
17629=>["Value"=>17629,"TextKey"=>"剧情ID30481101","TextValue"=>"哇，我真的没想到！"],
17630=>["Value"=>17630,"TextKey"=>"剧情ID30481102","TextValue"=>"哈哈哈哈哈，在前哨的位置，我们为你准备了一个积木像。"],
17631=>["Value"=>17631,"TextKey"=>"剧情ID30481103","TextValue"=>"不愧是你们！接下来的冒险，我们就有了一个牢固的大本营。"],
17632=>["Value"=>17632,"TextKey"=>"剧情ID99991301","TextValue"=>"欢迎来到<color=#ef933d>童话镇活动</color>， 奇妙的世界等你来探索。"],
17633=>["Value"=>17633,"TextKey"=>"剧情ID99991302","TextValue"=>"活动有丰厚的奖励，如<color=#ef933d>崭新的建筑</color>和<color=#ef933d>童话生物</color>，还有更多有趣的玩法等你来体验。"],
17634=>["Value"=>17634,"TextKey"=>"剧情ID99991401","TextValue"=>"这里展示了活动全部的<color=#ef933d>积分奖励</color>。积分越多，获得的奖励越丰厚。"],
17635=>["Value"=>17635,"TextKey"=>"剧情ID99991501","TextValue"=>"有些道具是不能合并的，譬如荆棘，只能通过童话生物来采集。<color=#ef933d>拖动童话生物</color>采集<color=#ef933d>荆棘</color>，会获得额外的奖励哦。"],
17636=>["Value"=>17636,"TextKey"=>"剧情ID99991601","TextValue"=>"童话镇有一些神奇的童话生物，合并他们就会出现。他们是采集灵花的好帮手。"],
17637=>["Value"=>17637,"TextKey"=>"剧情ID99991602","TextValue"=>"现在它们散布在各处，合并某些道具它们就会出现。"],
17638=>["Value"=>17638,"TextKey"=>"剧情ID99991701","TextValue"=>"<color=#ef933d>大地灵球</color>拥有强大的魔法，点击它能够唤醒<color=#ef933d>沉睡之地</color>。"],
17639=>["Value"=>17639,"TextKey"=>"剧情ID99991702","TextValue"=>"可以通过合并提升<color=#ef933d>大地灵球的等级</color>，大地灵球的等级越高，治愈之力越强大。"],
17640=>["Value"=>17640,"TextKey"=>"剧情ID99991801","TextValue"=>"嘿，你居然发现了这里！这里是藏着无数奇异种族的神秘岛屿……"],
17641=>["Value"=>17641,"TextKey"=>"剧情ID99991802","TextValue"=>"我敢说，来到这里，既是偶然，也是必然。"],
17642=>["Value"=>17642,"TextKey"=>"剧情ID99991803","TextValue"=>"一起去看看，有哪些奇幻生物在等待着我们吧！"],
17643=>["Value"=>17643,"TextKey"=>"剧情ID99991901","TextValue"=>"按照指引，这似乎是传说中的……龙蛋？"],
17644=>["Value"=>17644,"TextKey"=>"剧情ID99991902","TextValue"=>"龙蛋？我的三观受到了冲击……呼，我需要冷静一下。"],
17645=>["Value"=>17645,"TextKey"=>"剧情ID99991903","TextValue"=>"果然，这是个不可思议的地方，龙蛋不但有，还有许多，一点也不稀奇。"],
17646=>["Value"=>17646,"TextKey"=>"剧情ID99992601","TextValue"=>"哇，这是我们遇到的第一条顶级龙！"],
17647=>["Value"=>17647,"TextKey"=>"剧情ID99992602","TextValue"=>"为了表示感谢，这条可爱的龙咬住我的衣角不松口，一直带我到了这里——"],
17648=>["Value"=>17648,"TextKey"=>"剧情ID99992603","TextValue"=>"龙族巢穴。只有物种里最强大的个体，才能找到自己梦寐以求的家。"],
17649=>["Value"=>17649,"TextKey"=>"剧情ID99992604","TextValue"=>"帮助人，不对，帮助龙，真是件不错的事儿！哈哈！"],
17650=>["Value"=>17650,"TextKey"=>"剧情ID99992101","TextValue"=>"奇遇岛，真是个好地方。还有更多秘密等着我去探索呢。"],
17651=>["Value"=>17651,"TextKey"=>"剧情ID99992201","TextValue"=>"这是苹果吗？好好闻，只闻起来就让人知道它一定好吃！"],
17652=>["Value"=>17652,"TextKey"=>"剧情ID99992202","TextValue"=>"别说龙崽们，连旁边的龙蛋闻到之后都摇摆了几下呢。"],
17653=>["Value"=>17653,"TextKey"=>"剧情ID99992301","TextValue"=>"还好，这里还有一些苹果树的种子，足够我们应急了。"],
17654=>["Value"=>17654,"TextKey"=>"剧情ID99992302","TextValue"=>"可以合并这些种子获得更多的苹果树。每天都会有一些新种子出现在商店里，记得每天去领取哦。"],
17655=>["Value"=>17655,"TextKey"=>"剧情ID99992401","TextValue"=>"哇哦，这是龙崽们叼来的东西！"],
17656=>["Value"=>17656,"TextKey"=>"剧情ID99992402","TextValue"=>"送给我的礼物？哈哈，谢谢你们。"],
17657=>["Value"=>17657,"TextKey"=>"剧情ID99992403","TextValue"=>"放心，我会给你们更多更多更多的苹果！"],
17658=>["Value"=>17658,"TextKey"=>"剧情ID99992501","TextValue"=>"这……这是什么？虽然什么也看不到，但……"],
17659=>["Value"=>17659,"TextKey"=>"剧情ID99992502","TextValue"=>"冥冥之中，我仿佛摸到了钥匙的形状。"],
17660=>["Value"=>17660,"TextKey"=>"剧情ID99992503","TextValue"=>"这把虚空中的钥匙，是开启什么的呢？"],
17661=>["Value"=>17661,"TextKey"=>"剧情ID99992701","TextValue"=>"点击场景中的任何一个奇幻生物，点击<color=#ef933d>储存</color>按钮，就可以把它放进仓库了。"],
17662=>["Value"=>17662,"TextKey"=>"剧情ID99992702","TextValue"=>"点击仓库里任何一个奇幻生物，点击<color=#ef933d>移出</color>按钮，就可以把宠物移出仓库了。"],
17663=>["Value"=>17663,"TextKey"=>"剧情ID99992801","TextValue"=>"这是<color=#ef933d>幸运四叶草</color>，制作这种特殊的鲜花才会产生呢。<color=#ef933d>四叶草</color>可以用于完成家装的任务，我们去看看吧。"],
17664=>["Value"=>17664,"TextKey"=>"剧情ID99992901","TextValue"=>"</color>长按椅子<color=#ef933d>，你就可以随时更换你想要的椅子哦。任何道具，只要长按，就可以更换你想要的风格。"],
17665=>["Value"=>17665,"TextKey"=>"剧情ID13220101","TextValue"=>"好漂亮的蛋！"],
17666=>["Value"=>17666,"TextKey"=>"剧情ID13220102","TextValue"=>"我敢打赌，从这颗蛋里破壳而出的一定是个美丽的孩子。"],
17667=>["Value"=>17667,"TextKey"=>"剧情ID13220501","TextValue"=>"这是……花夫人！翅膀扇动之间，流露出甜蜜的香气。"],
17668=>["Value"=>17668,"TextKey"=>"剧情ID13220502","TextValue"=>"我们找到了花精的栖息地，她们可以安心地回到家乡了。"],
17669=>["Value"=>17669,"TextKey"=>"剧情ID13220503","TextValue"=>"这些都曾是流离失所的可怜精灵。祝她们以后一切顺利吧。"],
17670=>["Value"=>17670,"TextKey"=>"剧情ID13230101","TextValue"=>"这个蛋看上去非常坚硬，很结实的样子。"],
17671=>["Value"=>17671,"TextKey"=>"剧情ID13230102","TextValue"=>"不知道是什么种族，但感觉会是个健康的孩子呢。"],
17672=>["Value"=>17672,"TextKey"=>"剧情ID13230501","TextValue"=>"山谷守护灵！我可以到你的家去看看啦！"],
17673=>["Value"=>17673,"TextKey"=>"剧情ID13230502","TextValue"=>"我知道，你也喜欢生机勃勃的绿色！"],
17674=>["Value"=>17674,"TextKey"=>"剧情ID13240101","TextValue"=>"像是一个可爱的襁褓里的小婴儿！"],
17675=>["Value"=>17675,"TextKey"=>"剧情ID13240102","TextValue"=>"我也很想知道，你长大了会是什么样子。"],
17676=>["Value"=>17676,"TextKey"=>"剧情ID13240103","TextValue"=>"耐心等着我吧，我会努力合成的！"],
17677=>["Value"=>17677,"TextKey"=>"剧情ID13240501","TextValue"=>"终于见到你了！没想到远古的你如此美丽，就像毫无保留怒放的花。"],
17678=>["Value"=>17678,"TextKey"=>"剧情ID13240502","TextValue"=>"虽然我们听不懂彼此的语言……但就是感觉很亲近。"],
17679=>["Value"=>17679,"TextKey"=>"剧情ID13240503","TextValue"=>"带我去你的居住地看看吧！"],
17680=>["Value"=>17680,"TextKey"=>"剧情ID13250101","TextValue"=>"嗯，我不认识这是谁。"],
17681=>["Value"=>17681,"TextKey"=>"剧情ID13250102","TextValue"=>"现在的它太小了，很难辨别出什么有用的特征。"],
17682=>["Value"=>17682,"TextKey"=>"剧情ID13250501","TextValue"=>"我们遇到了顶级的祭司！"],
17683=>["Value"=>17683,"TextKey"=>"剧情ID13250502","TextValue"=>"可以和神灵沟通？那我是不是可以许愿？"],
17684=>["Value"=>17684,"TextKey"=>"剧情ID13250503","TextValue"=>"什么嘛！许愿可以，不保证实现？哼！"],
17685=>["Value"=>17685,"TextKey"=>"剧情ID13260101","TextValue"=>"这是山羊角？牛角？"],
17686=>["Value"=>17686,"TextKey"=>"剧情ID13260102","TextValue"=>"虽然我小时候在阿姨家的农场里挤过奶，但事实证明……"],
17687=>["Value"=>17687,"TextKey"=>"剧情ID13260103","TextValue"=>"我还是难以分辨相似的动物……"],
17688=>["Value"=>17688,"TextKey"=>"剧情ID13260501","TextValue"=>"是大预言家！"],
17689=>["Value"=>17689,"TextKey"=>"剧情ID13260502","TextValue"=>"果然在奇遇岛，一切皆有可能。"],
17690=>["Value"=>17690,"TextKey"=>"剧情ID13260503","TextValue"=>"你好啊，带我去你的住所做客吧。如果方便的话，我想要一杯香草茶。"],
17691=>["Value"=>17691,"TextKey"=>"剧情ID13270101","TextValue"=>"这是蛋吗？张牙舞爪的，很不好惹的样子。"],
17692=>["Value"=>17692,"TextKey"=>"剧情ID13270102","TextValue"=>"不过我不怕。预言家说过，我是奇遇岛最受欢迎的人，没有之一！"],
17693=>["Value"=>17693,"TextKey"=>"剧情ID13270103","TextValue"=>"我放弃思考奇遇岛总共有多少“人”。哼！"],
17694=>["Value"=>17694,"TextKey"=>"剧情ID13270501","TextValue"=>"精灵龙，你好啊，看来我们的巨龙小伙伴不会孤单了。"],
17695=>["Value"=>17695,"TextKey"=>"剧情ID13270502","TextValue"=>"希望你们不会因为闪亮的石头打架……"],
17696=>["Value"=>17696,"TextKey"=>"剧情ID13280101","TextValue"=>"好漂亮的原始风格！"],
17697=>["Value"=>17697,"TextKey"=>"剧情ID13280102","TextValue"=>"感觉似乎在哪里见过似的。"],
17698=>["Value"=>17698,"TextKey"=>"剧情ID13280501","TextValue"=>"你最擅长的事是分辨和采集水果？"],
17699=>["Value"=>17699,"TextKey"=>"剧情ID13280502","TextValue"=>"而且可以精准地判断出一堆水果里哪一个最甜最好吃？"],
17700=>["Value"=>17700,"TextKey"=>"剧情ID13280503","TextValue"=>"教教我教教我！"],
17701=>["Value"=>17701,"TextKey"=>"剧情ID13290101","TextValue"=>"很难想象这是什么生物。"],
17702=>["Value"=>17702,"TextKey"=>"剧情ID13290102","TextValue"=>"这是个……靶子吗？好吧，我放弃思考了。"],
17703=>["Value"=>17703,"TextKey"=>"剧情ID13290103","TextValue"=>"不过你放心，我会努力找到你的家的。"],
17704=>["Value"=>17704,"TextKey"=>"剧情ID13290501","TextValue"=>"哇，真的是百发百中！"],
17705=>["Value"=>17705,"TextKey"=>"剧情ID13290502","TextValue"=>"把弓箭借给我玩玩吧？看上去真的很好玩！哈哈，谢谢！"],
17706=>["Value"=>17706,"TextKey"=>"剧情ID13300101","TextValue"=>"我要开始种树了。"],
17707=>["Value"=>17707,"TextKey"=>"剧情ID13300102","TextValue"=>"你有没有发现，这颗蛋长得真的很像是一棵树？"],
17708=>["Value"=>17708,"TextKey"=>"剧情ID13300501","TextValue"=>"好美的花神！翅膀一扇一扇的，好可爱！"],
17709=>["Value"=>17709,"TextKey"=>"剧情ID13300502","TextValue"=>"我可以一直看漂亮姐姐，永远不会腻，哈哈。"],
17710=>["Value"=>17710,"TextKey"=>"剧情ID13310101","TextValue"=>"你是？山脉之子，哇哦，看上去就很有力量。"],
17711=>["Value"=>17711,"TextKey"=>"剧情ID13310102","TextValue"=>"头顶上的小黄花可以摘吗？"],
17712=>["Value"=>17712,"TextKey"=>"剧情ID13310103","TextValue"=>"哈哈，吓唬你的！"],
17713=>["Value"=>17713,"TextKey"=>"剧情ID13310501","TextValue"=>"虽然你很可爱，但是我还是不和你并排走了。"],
17714=>["Value"=>17714,"TextKey"=>"剧情ID13310502","TextValue"=>"因为你的身躯真的很庞大，怪不得走路很慢。"],
17715=>["Value"=>17715,"TextKey"=>"剧情ID13310503","TextValue"=>"不过没关系，奇遇岛是一个可以让人慢下来的地方。"],
17716=>["Value"=>17716,"TextKey"=>"剧情ID13320101","TextValue"=>"看上去很可爱！根据我丰富的经验，我猜，这是和植物有关的奇幻生物。"],
17717=>["Value"=>17717,"TextKey"=>"剧情ID13320102","TextValue"=>"不信？我去合成，找到更高级的它给你看！"],
17718=>["Value"=>17718,"TextKey"=>"剧情ID13320501","TextValue"=>"咳咳，短剑手！"],
17719=>["Value"=>17719,"TextKey"=>"剧情ID13320502","TextValue"=>"看短剑手身上的衣物！我想，也算和植物有关？"],
17720=>["Value"=>17720,"TextKey"=>"剧情ID13710101","TextValue"=>"哇哦，我没看错吧，这是一只可爱的蜗牛？"],
17721=>["Value"=>17721,"TextKey"=>"剧情ID13710102","TextValue"=>"上面还有一棵初生的小草！"],
17722=>["Value"=>17722,"TextKey"=>"剧情ID13710103","TextValue"=>"这是我们遇到的第一种珍稀生物！"],
17723=>["Value"=>17723,"TextKey"=>"剧情ID13710601","TextValue"=>"好可爱的蜗牛！哈哈，一看你的外表我就知道，你超级喜欢吃水果。"],
17724=>["Value"=>17724,"TextKey"=>"剧情ID13710602","TextValue"=>"我这里可是随时准备着苹果呢。想吃的时候告诉我哟！"],
17725=>["Value"=>17725,"TextKey"=>"剧情ID13720101","TextValue"=>"是猫猫！奇遇岛上居然还有可爱的猫咪！"],
17726=>["Value"=>17726,"TextKey"=>"剧情ID13720102","TextValue"=>"我想这个世界上没人不喜欢猫吧？我很喜欢猫咪“呼噜呼噜”的声音！"],
17727=>["Value"=>17727,"TextKey"=>"剧情ID13720103","TextValue"=>"小可怜，在送你回家之前，先陪我玩会儿游戏吧！"],
17728=>["Value"=>17728,"TextKey"=>"剧情ID13720601","TextValue"=>"美丽的大猫，我可以送你回家啦。"],
17729=>["Value"=>17729,"TextKey"=>"剧情ID13720602","TextValue"=>"不过我们还是可以经常一起玩啊，约好了！"],
17730=>["Value"=>17730,"TextKey"=>"剧情ID13730101","TextValue"=>"很有古典美的一顶冠冕！"],
17731=>["Value"=>17731,"TextKey"=>"剧情ID13730102","TextValue"=>"不知道新的奇幻生物会是谁呢？也许是个位高权重的人。"],
17732=>["Value"=>17732,"TextKey"=>"剧情ID13730601","TextValue"=>"是传说中的艳后！以美艳和野心闻名于世的艳后！"],
17733=>["Value"=>17733,"TextKey"=>"剧情ID13730602","TextValue"=>"没想到会在奇遇岛上遇到不可思议的人物……"],
17734=>["Value"=>17734,"TextKey"=>"剧情ID13730603","TextValue"=>"好啦，找到了您，意味着我也找到您的宫殿啦。"],
17735=>["Value"=>17735,"TextKey"=>"剧情ID13740101","TextValue"=>"是个毛绒绒的小东西！"],
17736=>["Value"=>17736,"TextKey"=>"剧情ID13740102","TextValue"=>"不可貌相，吃起东西来可是很凶的呢。"],
17737=>["Value"=>17737,"TextKey"=>"剧情ID13740601","TextValue"=>"谁能想到小可爱长大了是这么威武呢？"],
17738=>["Value"=>17738,"TextKey"=>"剧情ID13740602","TextValue"=>"带我去你的栖息地吧，我想，一定是个植被丰富的好地方。"],
17739=>["Value"=>17739,"TextKey"=>"剧情ID13740603","TextValue"=>"我会带着香甜的苹果去做客的。"],
17740=>["Value"=>17740,"TextKey"=>"剧情ID13750101","TextValue"=>"我很喜欢你身上的绿色，很鲜嫩的颜色，让人想到生命和春天。"],
17741=>["Value"=>17741,"TextKey"=>"剧情ID13750102","TextValue"=>"学生时代，我总会去菜园果园里玩，常常一玩就是一整天。"],
17742=>["Value"=>17742,"TextKey"=>"剧情ID13750103","TextValue"=>"奇遇岛总会让我遇到一些新的美好与希望。"],
17743=>["Value"=>17743,"TextKey"=>"剧情ID13750601","TextValue"=>"树精灵身上总是萦绕着一股草木的清新香气。"],
17744=>["Value"=>17744,"TextKey"=>"剧情ID13750602","TextValue"=>"你的家乡是什么样子呢？一定是山清水秀的地方，才能养育出这样的精灵。"],
17745=>["Value"=>17745,"TextKey"=>"剧情ID13750603","TextValue"=>"什么，有鲜花饼给我？哈哈，快带我去吧！"],
17746=>["Value"=>17746,"TextKey"=>"剧情ID13760101","TextValue"=>"是只圆圆的小鸟。小时候，经常有鸟儿落在我家园子里，因为妈妈总会撒上它们喜欢的谷粒。"],
17747=>["Value"=>17747,"TextKey"=>"剧情ID13760102","TextValue"=>"也就是说，想要吸引奇幻生物，我只需要多多准备它们喜欢的苹果就好啦。"],
17748=>["Value"=>17748,"TextKey"=>"剧情ID13760601","TextValue"=>"你最喜欢在陆地上生活？哈哈哈，好奇妙的喜好！"],
17749=>["Value"=>17749,"TextKey"=>"剧情ID13760602","TextValue"=>"是不是因为太胖了，飞着太累？"],
17750=>["Value"=>17750,"TextKey"=>"剧情ID13760603","TextValue"=>"哈哈，我错了，不要啄我！"],
17751=>["Value"=>17751,"TextKey"=>"剧情ID13770101","TextValue"=>"没有女孩子不喜欢蝴蝶结吧？总之我喜欢！"],
17752=>["Value"=>17752,"TextKey"=>"剧情ID13770102","TextValue"=>"咳，本杰明妈妈告诉过我，他小时候也喜欢。"],
17753=>["Value"=>17753,"TextKey"=>"剧情ID13770103","TextValue"=>"不许告诉别人哦！他会恼羞成怒的，哈哈。"],
17754=>["Value"=>17754,"TextKey"=>"剧情ID13770601","TextValue"=>"活力四射的女孩子谁不喜欢！"],
17755=>["Value"=>17755,"TextKey"=>"剧情ID13770602","TextValue"=>"奇遇岛可以开一场你的演唱会，我一定会叫上所有的小可爱去捧场的！"],
17756=>["Value"=>17756,"TextKey"=>"剧情ID13780101","TextValue"=>"这是小鳄鱼？这居然是鳄鱼？"],
17757=>["Value"=>17757,"TextKey"=>"剧情ID13780102","TextValue"=>"也太可爱了吧！和我在动物园看到的完全不同。"],
17758=>["Value"=>17758,"TextKey"=>"剧情ID13780103","TextValue"=>"我很难想象鳄鱼吵着要吃苹果的样子。不过有点期待呢！哈哈。"],
17759=>["Value"=>17759,"TextKey"=>"剧情ID13780601","TextValue"=>"很威风嘛，鳄鱼骑士！你住在池塘里吗，还是水洼里？"],
17760=>["Value"=>17760,"TextKey"=>"剧情ID13780602","TextValue"=>"好吧，我承认我很好奇。我可以去看看吗？"],
17761=>["Value"=>17761,"TextKey"=>"剧情ID13780603","TextValue"=>"哈哈，谢谢，我这就和你一起去。"],
17762=>["Value"=>17762,"TextKey"=>"剧情ID13790101","TextValue"=>"我有点认不出来这是什么生物。"],
17763=>["Value"=>17763,"TextKey"=>"剧情ID13790102","TextValue"=>"啊，这是老鼠？真的吗？我有点怕！"],
17764=>["Value"=>17764,"TextKey"=>"剧情ID13790103","TextValue"=>"但是仔细看看，好像和我熟悉的老鼠不一样！好吧，我也会努力帮助你升级的。"],
17765=>["Value"=>17765,"TextKey"=>"剧情ID13790601","TextValue"=>"老鼠大人，很厉害的称呼嘛！"],
17766=>["Value"=>17766,"TextKey"=>"剧情ID13790602","TextValue"=>"你只吃苹果？真巧，奇遇岛最好吃最有营养的就是苹果！"],
17767=>["Value"=>17767,"TextKey"=>"剧情ID13800101","TextValue"=>"又是一种珍稀的奇幻生物！"],
17768=>["Value"=>17768,"TextKey"=>"剧情ID13800102","TextValue"=>"但是我有点判断不出是什么种类……不过只要我加油合成，想必很快就可以知道答案了！"],
17769=>["Value"=>17769,"TextKey"=>"剧情ID13800601","TextValue"=>"大力神！看看你魁梧的身躯，我毫不怀疑这个称号。"],
17770=>["Value"=>17770,"TextKey"=>"剧情ID13800602","TextValue"=>"你要送给我一些宝藏？哈哈，那我就不客气啦。找到你确实很辛苦呢！"],
17771=>["Value"=>17771,"TextKey"=>"剧情ID13810101","TextValue"=>"唔，似乎是一些鱼骨。"],
17772=>["Value"=>17772,"TextKey"=>"剧情ID13810102","TextValue"=>"但是奇遇岛主要都是土地，鱼类可以存活吗？"],
17773=>["Value"=>17773,"TextKey"=>"剧情ID13810103","TextValue"=>"哦，我又差点忘记了，奇遇岛从来不是一个可以用常理推断的地方。"],
17774=>["Value"=>17774,"TextKey"=>"剧情ID13810601","TextValue"=>"好大的一条丑丑鱼！体型真大！"],
17775=>["Value"=>17775,"TextKey"=>"剧情ID13810602","TextValue"=>"我敢说，就算是经验丰富的渔民，看到你也会吓一跳的。"],
17776=>["Value"=>17776,"TextKey"=>"剧情ID13810603","TextValue"=>"走吧，我们去你的栖息地看看。"],
17777=>["Value"=>17777,"TextKey"=>"剧情ID14210101","TextValue"=>"我敢打赌，这一定是可爱的女孩子。"],
17778=>["Value"=>17778,"TextKey"=>"剧情ID14210102","TextValue"=>"这是我们遇到的第一种传奇生物！收集的难度加大了。"],
17779=>["Value"=>17779,"TextKey"=>"剧情ID14210103","TextValue"=>"啊啊，压力有点大！不过我会努力把你带回家的。"],
17780=>["Value"=>17780,"TextKey"=>"剧情ID14210701","TextValue"=>"是童话中才有的公主殿下！你从遥远的城堡中来？"],
17781=>["Value"=>17781,"TextKey"=>"剧情ID14210702","TextValue"=>"啊，居然还是偷偷跑出来的？那你想回去吗？"],
17782=>["Value"=>17782,"TextKey"=>"剧情ID14210703","TextValue"=>"好的，我知道了，我送你回家！"],
17783=>["Value"=>17783,"TextKey"=>"剧情ID14220101","TextValue"=>"似乎是由雪花构成的，摸上去冰冰凉凉。"],
17784=>["Value"=>17784,"TextKey"=>"剧情ID14220102","TextValue"=>"既然出现在奇遇岛上，应该像雪一样不会化掉吧？"],
17785=>["Value"=>17785,"TextKey"=>"剧情ID14220701","TextValue"=>"你可以在夏天活动吗？奇遇岛四季温暖如春，你会不会有危险？"],
17786=>["Value"=>17786,"TextKey"=>"剧情ID14220702","TextValue"=>"哦，这世界上居然有不怕热的雪人！"],
17787=>["Value"=>17787,"TextKey"=>"剧情ID14230101","TextValue"=>"好像是可爱的小狐狸！"],
17788=>["Value"=>17788,"TextKey"=>"剧情ID14230102","TextValue"=>"我小时候曾经在镇子上见过！因为我们镇子的环境很好，所以我见过很多种比较稀奇的动物哦。"],
17789=>["Value"=>17789,"TextKey"=>"剧情ID14230701","TextValue"=>"哇哦，长大的小狐狸是这么光彩照人！没有人会不喜欢你！"],
17790=>["Value"=>17790,"TextKey"=>"剧情ID14230702","TextValue"=>"对，别着急，我就是会带你回家的人。我们走吧。"],
17791=>["Value"=>17791,"TextKey"=>"剧情ID14240101","TextValue"=>"很可爱的生物！但是不得不说，我有点辨认不出这是什么。"],
17792=>["Value"=>17792,"TextKey"=>"剧情ID14240102","TextValue"=>"希望可以遇到更多的你，然后我再带你回家呀。"],
17793=>["Value"=>17793,"TextKey"=>"剧情ID14240701","TextValue"=>"憨憨龙，哈哈哈哈，的确是很适合你的名字。"],
17794=>["Value"=>17794,"TextKey"=>"剧情ID14240702","TextValue"=>"别不理我嘛，我给你保存了苹果！只要你想吃我就带给你。"],
17795=>["Value"=>17795,"TextKey"=>"剧情ID14240703","TextValue"=>"嗯嗯，我不会反悔的，放心。"],
17796=>["Value"=>17796,"TextKey"=>"剧情ID14250101","TextValue"=>"又是一种传奇生物！我已经迫不及待地想要见见长大后的它了。"],
17797=>["Value"=>17797,"TextKey"=>"剧情ID14250102","TextValue"=>"我得多找些苹果，不能让你们饿肚子。"],
17798=>["Value"=>17798,"TextKey"=>"剧情ID14250701","TextValue"=>"河马的家园，是在河流中吗？"],
17799=>["Value"=>17799,"TextKey"=>"剧情ID14250702","TextValue"=>"我准备了苹果，只要你带我回家，都可以让你吃哦。"],
17800=>["Value"=>17800,"TextKey"=>"剧情ID14250703","TextValue"=>"哈哈，别急别急，不用拽我，我这就和你走。"],
17801=>["Value"=>17801,"TextKey"=>"剧情ID14260101","TextValue"=>"一顶漂亮的牛仔帽！难道是牛仔吗？"],
17802=>["Value"=>17802,"TextKey"=>"剧情ID14260102","TextValue"=>"总之，我得多多寻找你的同类，才能知道答案了。"],
17803=>["Value"=>17803,"TextKey"=>"剧情ID14260701","TextValue"=>"你的家园是不是弥漫着黄沙？为了呼吸要戴着面罩？"],
17804=>["Value"=>17804,"TextKey"=>"剧情ID14260702","TextValue"=>"哈哈，谢谢你的邀请，我的确很想去参观！"],
17805=>["Value"=>17805,"TextKey"=>"剧情ID14270101","TextValue"=>"帮助奇幻生物们寻找栖息地的路的确很漫长。"],
17806=>["Value"=>17806,"TextKey"=>"剧情ID14270102","TextValue"=>"这不，我又遇到了新同伴。看看这标志性的长鼻子！"],
17807=>["Value"=>17807,"TextKey"=>"剧情ID14270103","TextValue"=>"我猜这是幼年的小象。哈哈，我可是见多识广了的！"],
17808=>["Value"=>17808,"TextKey"=>"剧情ID14270701","TextValue"=>"好庞大的猛犸象！"],
17809=>["Value"=>17809,"TextKey"=>"剧情ID14270702","TextValue"=>"是我的错觉吗？每走一步，地面似乎都要颤一颤！"],
17810=>["Value"=>17810,"TextKey"=>"剧情ID14270703","TextValue"=>"呼，奇遇岛真是十分广袤，还有不少地方我们还没有去过呢！"],
17811=>["Value"=>17811,"TextKey"=>"剧情ID14280101","TextValue"=>"这小南瓜真可爱，是幼小的嫩黄色。"],
17812=>["Value"=>17812,"TextKey"=>"剧情ID14280102","TextValue"=>"上面还有着眼睛！难道长大后会是万圣节会出现的南瓜头吗？"],
17813=>["Value"=>17813,"TextKey"=>"剧情ID14280103","TextValue"=>"哼，我已经做好心理准备了，吓不到我！"],
17814=>["Value"=>17814,"TextKey"=>"剧情ID14280701","TextValue"=>"居然是南瓜精灵！裙摆散发着南瓜的香甜气息……"],
17815=>["Value"=>17815,"TextKey"=>"剧情ID14280702","TextValue"=>"从小到大都是这么可爱漂亮！你住在南瓜里面吗？"],
17816=>["Value"=>17816,"TextKey"=>"剧情ID14280703","TextValue"=>"哈哈，我很乐意去你家拜访！"],
17817=>["Value"=>17817,"TextKey"=>"剧情ID14290101","TextValue"=>"是新的奇幻生物！传说级别！"],
17818=>["Value"=>17818,"TextKey"=>"剧情ID14290102","TextValue"=>"虽然看上去年级很小，但是感觉是很严肃认真的性格呢。"],
17819=>["Value"=>17819,"TextKey"=>"剧情ID14290701","TextValue"=>"我很相信你的武力！你已经从头到脚武装起来了。"],
17820=>["Value"=>17820,"TextKey"=>"剧情ID14290702","TextValue"=>"会不会害怕？哈哈，那倒是不会。不过，我想知道，你热不热？"],
17821=>["Value"=>17821,"TextKey"=>"剧情ID14290703","TextValue"=>"哈哈，正好可以回到你的家园换一下装扮！"],
17822=>["Value"=>17822,"TextKey"=>"剧情ID14300101","TextValue"=>"是小猴子！哇，我很喜欢小猴子！"],
17823=>["Value"=>17823,"TextKey"=>"剧情ID14300102","TextValue"=>"小时候我还哭着求妈妈养一只小猴子来着，哈哈。当然，我没能如愿。"],
17824=>["Value"=>17824,"TextKey"=>"剧情ID14300103","TextValue"=>"我要找到更多的小猴子陪我一起玩儿！"],
17825=>["Value"=>17825,"TextKey"=>"剧情ID14300701","TextValue"=>"看上去很有大厨风范！"],
17826=>["Value"=>17826,"TextKey"=>"剧情ID14300702","TextValue"=>"如果方便，我很愿意尝尝你的手艺！"],
17827=>["Value"=>17827,"TextKey"=>"剧情ID14300703","TextValue"=>"当然，我会带着苹果去拜访的！"],
17828=>["Value"=>17828,"TextKey"=>"剧情ID14310101","TextValue"=>"我以为，我已经是个成熟的奇遇岛民了。"],
17829=>["Value"=>17829,"TextKey"=>"剧情ID14310102","TextValue"=>"原来，我还是会遇到不熟悉的奇幻生物！"],
17830=>["Value"=>17830,"TextKey"=>"剧情ID14310103","TextValue"=>"我得更新一下我的奇遇岛图鉴了！这就去。"],
17831=>["Value"=>17831,"TextKey"=>"剧情ID14310701","TextValue"=>"哇哦，您看上去比我年长太多了！"],
17832=>["Value"=>17832,"TextKey"=>"剧情ID14310702","TextValue"=>"啊，您说的话是什么意思？坦白讲，我的高中成绩并不是特别好……"],
17833=>["Value"=>17833,"TextKey"=>"剧情ID14310703","TextValue"=>"好吧，我们去您的住所，听您慢慢解释给我听。"],
17834=>["Value"=>17834,"TextKey"=>"剧情ID99970201","TextValue"=>"哇，我们驱散了雾气，可以利用更多的地块啦！"],
17835=>["Value"=>17835,"TextKey"=>"剧情ID99970202","TextValue"=>"我们找到了更多的巨龙蛋！"],
