17926=>["Value"=>17926,"TextKey"=>"剧情ID101000301","TextValue"=>"看装饰和布局，这个宅子至少有两三百年的历史了。"],
17927=>["Value"=>17927,"TextKey"=>"剧情ID101000401","TextValue"=>"看起来可是个大工程啊。"],
17928=>["Value"=>17928,"TextKey"=>"剧情ID101000402","TextValue"=>"我可是巴特勒管家学院的杰出毕业生，一定能完美搞定小主人交待的任务——博得奥罗拉小姐的欢心！"],
17929=>["Value"=>17929,"TextKey"=>"剧情ID101000403","TextValue"=>"这可是小主人的终身大事！"],
17930=>["Value"=>17930,"TextKey"=>"剧情ID101000501","TextValue"=>"所以，首要任务就是去镇上，接奥罗拉小姐过来。"],
17931=>["Value"=>17931,"TextKey"=>"剧情ID101010101","TextValue"=>"这里是？……"],
17932=>["Value"=>17932,"TextKey"=>"剧情ID101010102","TextValue"=>"您好，奥罗拉小姐，旅途辛苦了"],
17933=>["Value"=>17933,"TextKey"=>"剧情ID101010103","TextValue"=>"您可以叫我梅林，这段时间我会负责宅子的装修事宜。"],
17934=>["Value"=>17934,"TextKey"=>"剧情ID101010104","TextValue"=>"你好，梅林先生……"],
17935=>["Value"=>17935,"TextKey"=>"剧情ID101010201","TextValue"=>"不，不对，你为什么带我来我姨妈家的宅子里？"],
17936=>["Value"=>17936,"TextKey"=>"剧情ID101010202","TextValue"=>"她明明告诉我，因为无法负担昂贵的修缮和维持费用，宅子已经卖掉了啊。"],
17937=>["Value"=>17937,"TextKey"=>"剧情ID101010203","TextValue"=>"没错，买下宅子的正是我的小主人。"],
17938=>["Value"=>17938,"TextKey"=>"剧情ID101010204","TextValue"=>"而我会按照您的喜好和吩咐，重新修整这栋您童年时所住的大宅。"],
17939=>["Value"=>17939,"TextKey"=>"剧情ID101010301","TextValue"=>"很抱歉奥罗拉小姐，一切太仓促了，我还没能做好准备。"],
17940=>["Value"=>17940,"TextKey"=>"剧情ID101010302","TextValue"=>"小镇里还没有旅馆可以下榻，今晚只能请您在这里过夜了。"],
17941=>["Value"=>17941,"TextKey"=>"剧情ID101010303","TextValue"=>"不过请放心，我会在天黑之前给您准备一个舒适的房间的。"],
17942=>["Value"=>17942,"TextKey"=>"剧情ID101010401","TextValue"=>"我不明白……"],
17943=>["Value"=>17943,"TextKey"=>"剧情ID101010402","TextValue"=>"你到底是谁？你的小主人又是谁？为什么买下宅子又让我住进来？"],
17944=>["Value"=>17944,"TextKey"=>"剧情ID101010403","TextValue"=>"而且…而且你们还知道我童年的事……"],
17945=>["Value"=>17945,"TextKey"=>"剧情ID101010501","TextValue"=>"天哪，我的脑子已经一团乱了"],
17946=>["Value"=>17946,"TextKey"=>"剧情ID101010502","TextValue"=>"奥罗拉小姐请当心！"],
17947=>["Value"=>17947,"TextKey"=>"剧情ID101010601","TextValue"=>"都是碎玻璃，好危险啊。"],
17948=>["Value"=>17948,"TextKey"=>"剧情ID101010602","TextValue"=>"您的顾虑我会慢慢解释清楚的，不过还请让我先清理掉这些碎玻璃"],
17949=>["Value"=>17949,"TextKey"=>"剧情ID101010603","TextValue"=>"要是你受伤了，我可没办法向小主人交代了。"],
17950=>["Value"=>17950,"TextKey"=>"剧情ID101020201","TextValue"=>"呼，这下终于放心了。"],
17951=>["Value"=>17951,"TextKey"=>"剧情ID101020301","TextValue"=>"现在可以解释原委了么？"],
17952=>["Value"=>17952,"TextKey"=>"剧情ID101020302","TextValue"=>"虽然我是很舍不得我童年时的家…但姨妈已经卖掉了宅子。"],
17953=>["Value"=>17953,"TextKey"=>"剧情ID101020303","TextValue"=>"可是你现在却带娃回到这里……"],
17954=>["Value"=>17954,"TextKey"=>"剧情ID101020304","TextValue"=>"请别着急，这里有文件……"],
17955=>["Value"=>17955,"TextKey"=>"剧情ID101020401","TextValue"=>"我之前放在这里的文件，怎么乱成这样？"],
17956=>["Value"=>17956,"TextKey"=>"剧情ID101020402","TextValue"=>"天哪，一定是因为我没有关好窗户，文件被风吹乱了。"],
17957=>["Value"=>17957,"TextKey"=>"剧情ID101020501","TextValue"=>"是我的失误，请容我整理一下文件。"],
17958=>["Value"=>17958,"TextKey"=>"剧情ID101030201","TextValue"=>"这就是相关资料。"],
17959=>["Value"=>17959,"TextKey"=>"剧情ID101030202","TextValue"=>"您看了之后就会明白的。"],
17960=>["Value"=>17960,"TextKey"=>"剧情ID101030301","TextValue"=>"哇……好厚……"],
17961=>["Value"=>17961,"TextKey"=>"剧情ID101030401","TextValue"=>"请坐到沙发这里慢慢看吧，我简单收拾一下。"],
17962=>["Value"=>17962,"TextKey"=>"剧情ID101040201","TextValue"=>"您整理房间真的很有一套啊，说是简单收拾一下，却整理的这么好。"],
17963=>["Value"=>17963,"TextKey"=>"剧情ID101040202","TextValue"=>"奥罗拉小姐您过誉了，身为一个管家，整理房间是我分内的事。"],
17964=>["Value"=>17964,"TextKey"=>"剧情ID101040203","TextValue"=>"这份地产档案，请您过目。"],
17965=>["Value"=>17965,"TextKey"=>"剧情ID101040301","TextValue"=>"梅林管家出示地产档案"],
17966=>["Value"=>17966,"TextKey"=>"剧情ID101040401","TextValue"=>"这份产权证上，是我的名字？！"],
17967=>["Value"=>17967,"TextKey"=>"剧情ID101040402","TextValue"=>"没错，只要您签名确认之后，这栋宅子就会在法律上正式归属于您，奥罗拉小姐。"],
17968=>["Value"=>17968,"TextKey"=>"剧情ID101040403","TextValue"=>"我不是在做梦吧？你的主人是谁，为什么要做这种事？"],
17969=>["Value"=>17969,"TextKey"=>"剧情ID101040404","TextValue"=>"请把这当做一份惊喜吧，小主人恐怕不希望我过早的泄露他的身份。"],
17970=>["Value"=>17970,"TextKey"=>"剧情ID101040405","TextValue"=>"如果一切顺利，明天您应该就能见到他了。"],
17971=>["Value"=>17971,"TextKey"=>"剧情ID101040406","TextValue"=>"这个字我不会签的，我不相信天上会掉馅饼"],
17972=>["Value"=>17972,"TextKey"=>"剧情ID101040407","TextValue"=>"请别误会，这可不是一个馅饼，这是一份责任。"],
17973=>["Value"=>17973,"TextKey"=>"剧情ID101040408","TextValue"=>"或者说…是一个考验。"],
17974=>["Value"=>17974,"TextKey"=>"剧情ID101040409","TextValue"=>"这是什么意思？"],
17975=>["Value"=>17975,"TextKey"=>"剧情ID101040501","TextValue"=>"这里是您的姨妈没有带走的东西。"],
17976=>["Value"=>17976,"TextKey"=>"剧情ID101040502","TextValue"=>"等我找一找，这里应该有一份蓝图的……"],
17977=>["Value"=>17977,"TextKey"=>"剧情ID101050201","TextValue"=>"就是这个。"],
17978=>["Value"=>17978,"TextKey"=>"剧情ID101050301","TextValue"=>"啊，这个是姨妈一直想要开的面包房，我做面包的手艺，都是跟姨妈学的……"],
17979=>["Value"=>17979,"TextKey"=>"剧情ID101050302","TextValue"=>"可现在别说面包房了，连罗尔小镇都……"],
17980=>["Value"=>17980,"TextKey"=>"剧情ID101050303","TextValue"=>"嗯，由于罗尔镇官员的长期腐败，小镇处于严重赤字状态，并深陷财务危机。"],
17981=>["Value"=>17981,"TextKey"=>"剧情ID101050304","TextValue"=>"为了重建小镇，您辞去了在城市的高薪工作，加入了重建队伍。"],
17982=>["Value"=>17982,"TextKey"=>"剧情ID101050401","TextValue"=>"你知道的太多了，这让我很不安。"],
17983=>["Value"=>17983,"TextKey"=>"剧情ID101050402","TextValue"=>"当然这些还不是重点，奥罗拉小姐。"],
17984=>["Value"=>17984,"TextKey"=>"剧情ID101050403","TextValue"=>"请看这个。"],
17985=>["Value"=>17985,"TextKey"=>"剧情ID101050501","TextValue"=>"梅林管家出示一份文件"],
17986=>["Value"=>17986,"TextKey"=>"剧情ID101050601","TextValue"=>"…小镇重建基金会？这是什么？"],
17987=>["Value"=>17987,"TextKey"=>"剧情ID101050602","TextValue"=>"您知道罗尔小镇其实有着很优秀的乡土文化和旅游资源，现在缺少的是一个得力的人手。"],
17988=>["Value"=>17988,"TextKey"=>"剧情ID101050603","TextValue"=>"基金会在商议之后，认为您就是最适合的那个人。"],
17989=>["Value"=>17989,"TextKey"=>"剧情ID101050604","TextValue"=>"基金会会提供资金用于小镇建设，而这座宅子算是提前的奖励，希望您可以为小镇的建设做出足以匹配这座宅子的贡献。"],
17990=>["Value"=>17990,"TextKey"=>"剧情ID101050605","TextValue"=>"……"],
17991=>["Value"=>17991,"TextKey"=>"剧情ID101050606","TextValue"=>"你说得对，这的确不是馅饼，是一个考验。"],
17992=>["Value"=>17992,"TextKey"=>"剧情ID101050607","TextValue"=>"我现在更加不确定自己有没有资格拥有这座宅子了。"],
17993=>["Value"=>17993,"TextKey"=>"剧情ID101050608","TextValue"=>"您太紧张了奥罗拉小姐，其实事情并没有你想到那么复杂。"],
17994=>["Value"=>17994,"TextKey"=>"剧情ID101050609","TextValue"=>"前几天基金会应该给您发过一封邮件，您是没有看到吗？"],
17995=>["Value"=>17995,"TextKey"=>"剧情ID101050610","TextValue"=>"哦…该不会是被我当成垃圾邮件的那一封？"],
17996=>["Value"=>17996,"TextKey"=>"剧情ID101050611","TextValue"=>"额……没事没事，现在看也来得及。"],
17997=>["Value"=>17997,"TextKey"=>"剧情ID101050701","TextValue"=>"这个电脑看起来很破旧了，还能用么？"],
17998=>["Value"=>17998,"TextKey"=>"剧情ID101050702","TextValue"=>"先整理一下吧……"],
17999=>["Value"=>17999,"TextKey"=>"剧情ID101060201","TextValue"=>"嗯…这……"],
18000=>["Value"=>18000,"TextKey"=>"剧情ID101060202","TextValue"=>"怎么了梅林先生？"],
18001=>["Value"=>18001,"TextKey"=>"剧情ID101060301","TextValue"=>"说来惭愧，我这把年纪的人，还真是不太擅长使用电脑这些电子产品……"],
18002=>["Value"=>18002,"TextKey"=>"剧情ID101060302","TextValue"=>"哦我来吧。"],
18003=>["Value"=>18003,"TextKey"=>"剧情ID101060401","TextValue"=>"还好，还能使用。"],
18004=>["Value"=>18004,"TextKey"=>"剧情ID101060402","TextValue"=>"您看是这封邮件么？"],
18005=>["Value"=>18005,"TextKey"=>"剧情ID101060403","TextValue"=>"没错没错，就是这个。"],
18006=>["Value"=>18006,"TextKey"=>"剧情ID101060404","TextValue"=>"关于基金会、小镇重建、还有您的部分职责，都写在里面，您可以酌情修改。"],
18007=>["Value"=>18007,"TextKey"=>"剧情ID101060405","TextValue"=>"好的谢谢您。"],
18008=>["Value"=>18008,"TextKey"=>"剧情ID101060406","TextValue"=>"我就趁这个时间整理整理屋子吧，今晚您还得睡在这里呢。"],
18009=>["Value"=>18009,"TextKey"=>"剧情ID101060501","TextValue"=>"首先就是这块破旧的地毯，还有没清理干净的碎玻璃呢。"],
18010=>["Value"=>18010,"TextKey"=>"剧情ID101070201","TextValue"=>"梅林，我差不多看完了。"],
18011=>["Value"=>18011,"TextKey"=>"剧情ID101070301","TextValue"=>"小心！"],
18012=>["Value"=>18012,"TextKey"=>"剧情ID101070401","TextValue"=>"好痛……"],
18013=>["Value"=>18013,"TextKey"=>"剧情ID101070402","TextValue"=>"天哪这个地板，太脆弱了，坑坑洼洼的。"],
18014=>["Value"=>18014,"TextKey"=>"剧情ID101070403","TextValue"=>"请让我看看，您受伤了么？"],
18015=>["Value"=>18015,"TextKey"=>"剧情ID101070501","TextValue"=>"管家为奥罗拉处理伤口"],
18016=>["Value"=>18016,"TextKey"=>"剧情ID101070502","TextValue"=>"谢谢你梅林，我好多了。"],
18017=>["Value"=>18017,"TextKey"=>"剧情ID101070601","TextValue"=>"实在抱歉，奥罗拉小姐，这是我的失职。"],
18018=>["Value"=>18018,"TextKey"=>"剧情ID101070602","TextValue"=>"您先休息休息，请让我修葺一下地板吧。"],
18019=>["Value"=>18019,"TextKey"=>"剧情ID101080201","TextValue"=>"呼，还好我提前预定了地板。"],
18020=>["Value"=>18020,"TextKey"=>"剧情ID101080301","TextValue"=>"那份邮件，您看完之后有何感想？"],
18021=>["Value"=>18021,"TextKey"=>"剧情ID101080302","TextValue"=>"……"],
18022=>["Value"=>18022,"TextKey"=>"剧情ID101080401","TextValue"=>"我还是不能确定自己能否胜任这个重任，但我大概猜到了另一件事。"],
18023=>["Value"=>18023,"TextKey"=>"剧情ID101080402","TextValue"=>"对我这么了解，能够准确地猜中我心思的人，大概就只有他——"],
18024=>["Value"=>18024,"TextKey"=>"剧情ID101080403","TextValue"=>"本杰明。"],
18025=>["Value"=>18025,"TextKey"=>"剧情ID101080404","TextValue"=>"哎……我就说过这种隐瞒毫无意义。"],
18026=>["Value"=>18026,"TextKey"=>"剧情ID101080405","TextValue"=>"以您的聪慧一定很快就会猜出一切。"],
18027=>["Value"=>18027,"TextKey"=>"剧情ID101080501","TextValue"=>"…我就是不喜欢他这样……"],
18028=>["Value"=>18028,"TextKey"=>"剧情ID101080502","TextValue"=>"他总是擅自安排我的一切，就好像没有他我什么都做不成一样。"],
18029=>["Value"=>18029,"TextKey"=>"剧情ID101080503","TextValue"=>"如果不是这样我们也不会分手！……"],
18030=>["Value"=>18030,"TextKey"=>"剧情ID101080504","TextValue"=>"我倒要问问他到底什么意思！"],
18031=>["Value"=>18031,"TextKey"=>"剧情ID101080601","TextValue"=>"嗯……"],
18032=>["Value"=>18032,"TextKey"=>"剧情ID101080602","TextValue"=>"这就不是我能插手的事情了，我还是做好我的本职工作………"],
18033=>["Value"=>18033,"TextKey"=>"剧情ID101080603","TextValue"=>"比如换换壁纸什么的……"],
18034=>["Value"=>18034,"TextKey"=>"剧情ID101090201","TextValue"=>"可恶，他不接电话！"],
18035=>["Value"=>18035,"TextKey"=>"剧情ID101090301","TextValue"=>"请不要再收拾了！我不会再接受他的任何东西！"],
18036=>["Value"=>18036,"TextKey"=>"剧情ID101090401","TextValue"=>"奥罗拉小姐，整理这座屋子是我的工作，您这样让我很为难……"],
18037=>["Value"=>18037,"TextKey"=>"剧情ID101090402","TextValue"=>"……非常抱歉梅林先生，我不该迁怒你，这一切都不是你的错。"],
18038=>["Value"=>18038,"TextKey"=>"剧情ID101090403","TextValue"=>"没关系奥罗拉小姐。"],
18039=>["Value"=>18039,"TextKey"=>"剧情ID101090404","TextValue"=>"其实在您不告而别之后小主人难过了很久，他反思了自己曾经做的不对的地方，非常的后悔。"],
18040=>["Value"=>18040,"TextKey"=>"剧情ID101090405","TextValue"=>"所以他这次做了重大的决定，希望您冷静一下再给他一次机会，好好听他解释。"],
18041=>["Value"=>18041,"TextKey"=>"剧情ID101090406","TextValue"=>"小主人他现在应该正在飞机上，不是故意不接电话。"],
18042=>["Value"=>18042,"TextKey"=>"剧情ID101090407","TextValue"=>"…………"],
18043=>["Value"=>18043,"TextKey"=>"剧情ID101090408","TextValue"=>"其实我也知道不全是他的错，他只是在试图用自己的以为对的方式照顾我……"],
18044=>["Value"=>18044,"TextKey"=>"剧情ID101090409","TextValue"=>"可是他这样真的让我……"],
18045=>["Value"=>18045,"TextKey"=>"剧情ID101090501","TextValue"=>"哎……该死……明明告诉自己不要再因为那家伙流泪的……"],
18046=>["Value"=>18046,"TextKey"=>"剧情ID101090502","TextValue"=>"…………"],
18047=>["Value"=>18047,"TextKey"=>"剧情ID101090601","TextValue"=>"今天晚上您就先在这里休息吧，明天一早小主人大概就能赶到了"],
18048=>["Value"=>18048,"TextKey"=>"剧情ID101090602","TextValue"=>"您也可以趁着这段时间，好好考虑一下地产合同和文件的事情。"],
18049=>["Value"=>18049,"TextKey"=>"剧情ID101090603","TextValue"=>"我给您把床铺整理一下，您早点休息吧。"],
18050=>["Value"=>18050,"TextKey"=>"剧情ID101090604","TextValue"=>"嗯…谢谢你梅林。"],
18051=>["Value"=>18051,"TextKey"=>"剧情ID101100201","TextValue"=>"奥罗拉小姐，您的行李衣物送到了。"],
18052=>["Value"=>18052,"TextKey"=>"剧情ID101100202","TextValue"=>"需要我帮您把衣物整理一下么？"],
18053=>["Value"=>18053,"TextKey"=>"剧情ID101100203","TextValue"=>"谢谢，衣服我自己整理就好。"],
18054=>["Value"=>18054,"TextKey"=>"剧情ID101100301","TextValue"=>"额……这个衣柜……"],
18055=>["Value"=>18055,"TextKey"=>"剧情ID101100401","TextValue"=>"哦，新的衣柜也一并送到了，我给您更换一下吧。"],
18056=>["Value"=>18056,"TextKey"=>"剧情ID101110201","TextValue"=>"好了，时间有限，今天只能做到这种程度了。"],
18057=>["Value"=>18057,"TextKey"=>"剧情ID101110301","TextValue"=>"天哪梅林，我第一次见到你这么优秀的管家，只一天的时间就让这里焕然一新。"],
18058=>["Value"=>18058,"TextKey"=>"剧情ID101110302","TextValue"=>"我都快不认识这里了。"],
18059=>["Value"=>18059,"TextKey"=>"剧情ID101110401","TextValue"=>"您过誉了，这都是我的本职工作。"],
18060=>["Value"=>18060,"TextKey"=>"剧情ID101110402","TextValue"=>"新的衣柜也换好了，还有什么我可以为您效劳的么？"],
18061=>["Value"=>18061,"TextKey"=>"剧情ID101110403","TextValue"=>"剩下的我自己来就可以了。"],
18062=>["Value"=>18062,"TextKey"=>"剧情ID101110404","TextValue"=>"不管怎么说，今天非常谢谢你梅林，各个方面……、"],
18063=>["Value"=>18063,"TextKey"=>"剧情ID101110405","TextValue"=>"关于合同的事，还有本杰明的事，我都会认真考虑的……"],
18064=>["Value"=>18064,"TextKey"=>"剧情ID101110406","TextValue"=>"您这么想，我今天的辛苦就不算白费了。"],
18065=>["Value"=>18065,"TextKey"=>"剧情ID101110407","TextValue"=>"那么请早点休息吧，晚安奥罗拉小姐。"],
18066=>["Value"=>18066,"TextKey"=>"剧情ID101110408","TextValue"=>"晚安梅林。"],
18067=>["Value"=>18067,"TextKey"=>"剧情ID101120101","TextValue"=>"哎，发生了好多事，好累啊。"],
18068=>["Value"=>18068,"TextKey"=>"剧情ID101120102","TextValue"=>"今天就早点睡吧，明天还有别的事呢。"],
18069=>["Value"=>18069,"TextKey"=>"剧情ID101120301","TextValue"=>"新的一天"],
18070=>["Value"=>18070,"TextKey"=>"剧情ID102010101","TextValue"=>"门铃响了！"],
18071=>["Value"=>18071,"TextKey"=>"剧情ID102010102","TextValue"=>"梅林，是我。"],
18072=>["Value"=>18072,"TextKey"=>"剧情ID102010201","TextValue"=>"奥罗拉小姐正在忙着收拾客厅。"],
18073=>["Value"=>18073,"TextKey"=>"剧情ID102010202","TextValue"=>"哈哈，先生，不用着急，奥罗拉小姐这次可不会跑掉了。"],
18074=>["Value"=>18074,"TextKey"=>"剧情ID102020101","TextValue"=>"真的是满目狼藉的房间啊。"],
18075=>["Value"=>18075,"TextKey"=>"剧情ID102020102","TextValue"=>"奥罗拉，这就是你一心想要回来的家乡吗？"],
18076=>["Value"=>18076,"TextKey"=>"剧情ID102020103","TextValue"=>"那又怎么样？我能用自己的力量把它变好，现在这里什么样子并不重要。"],
18077=>["Value"=>18077,"TextKey"=>"剧情ID102020104","TextValue"=>"算了……我干嘛要跟你说这个。"],
18078=>["Value"=>18078,"TextKey"=>"剧情ID102020105","TextValue"=>"反正已经争论过无数次了，都没有用不是吗？"],
18079=>["Value"=>18079,"TextKey"=>"剧情ID102020106","TextValue"=>"先生，女士，我们为什么不坐下慢慢说话呢？"],
18080=>["Value"=>18080,"TextKey"=>"剧情ID102020107","TextValue"=>"比如，先生，您可以解释一下那些文件。"],
18081=>["Value"=>18081,"TextKey"=>"剧情ID102030101","TextValue"=>"现在的会客厅实在有些杂乱。"],
18082=>["Value"=>18082,"TextKey"=>"剧情ID102030102","TextValue"=>"我就知道你的收拾癖看不得这些。好吧，我到处看看，这里交给你。"],
18083=>["Value"=>18083,"TextKey"=>"剧情ID102030103","TextValue"=>"感谢您的谅解。"],
18084=>["Value"=>18084,"TextKey"=>"剧情ID102040101","TextValue"=>"新的地板很有必要，唔……我带来的岛内供应商的名单，现在派上用场了。"],
18085=>["Value"=>18085,"TextKey"=>"剧情ID102040201","TextValue"=>"很好，今天内就可以送达了，效率还是很高的。"],
18086=>["Value"=>18086,"TextKey"=>"剧情ID102050201","TextValue"=>"还好我提前定好了地毯。"],
18087=>["Value"=>18087,"TextKey"=>"剧情ID102050202","TextValue"=>"新地板上的确不适合再有这块破破烂烂的地毯了。"],
18088=>["Value"=>18088,"TextKey"=>"剧情ID102050203","TextValue"=>"旧物值得珍藏，但这种早该淘汰的物品不在其中。"],
18089=>["Value"=>18089,"TextKey"=>"剧情ID102060101","TextValue"=>"沙发居然都露出弹簧了！"],
18090=>["Value"=>18090,"TextKey"=>"剧情ID102060102","TextValue"=>"来更换一下沙发吧，这并不费什么功夫。"],
18091=>["Value"=>18091,"TextKey"=>"剧情ID102060103","TextValue"=>"好，我也来帮忙。"],
18092=>["Value"=>18092,"TextKey"=>"剧情ID102070101","TextValue"=>"为什么会让梅林先生送给我那样一份文件？"],
18093=>["Value"=>18093,"TextKey"=>"剧情ID102070102","TextValue"=>"为什么要把房子送给我？"],
18094=>["Value"=>18094,"TextKey"=>"剧情ID102070103","TextValue"=>"你签名了吗？"],
18095=>["Value"=>18095,"TextKey"=>"剧情ID102070104","TextValue"=>"没有。我以为我们已经结束了，不是吗？"],
18096=>["Value"=>18096,"TextKey"=>"剧情ID102070105","TextValue"=>"真可惜，不会结束的。"],
18097=>["Value"=>18097,"TextKey"=>"剧情ID102070106","TextValue"=>"看来你还不知道罗尔镇的一些消息。"],
18098=>["Value"=>18098,"TextKey"=>"剧情ID102070107","TextValue"=>"罗尔镇重建的工作，因为长期缺乏资金，所以迟迟没有完成。"],
18099=>["Value"=>18099,"TextKey"=>"剧情ID102070108","TextValue"=>"我已经和镇长达成合作，成立一个重建基金会，捐献一部分财产。"],
18100=>["Value"=>18100,"TextKey"=>"剧情ID102070109","TextValue"=>"而这一切的前提，就是我全权监督和管理这间宅子的重建工作。"],
18101=>["Value"=>18101,"TextKey"=>"剧情ID102070110","TextValue"=>"这段时间，我要一直在这里了。"],
18102=>["Value"=>18102,"TextKey"=>"剧情ID102070111","TextValue"=>"什么？！"],
18103=>["Value"=>18103,"TextKey"=>"剧情ID102070112","TextValue"=>"别激动，这脆弱的茶几经不起什么波折了。不如更换一个新的？"],
18104=>["Value"=>18104,"TextKey"=>"剧情ID102080101","TextValue"=>"就是这样。不过，这间宅子的归属，毋庸置疑，一直属于你。"],
18105=>["Value"=>18105,"TextKey"=>"剧情ID102080102","TextValue"=>"我不明白，那你的设计公司呢，你在这里又怎么继续你的设计梦想呢？"],
18106=>["Value"=>18106,"TextKey"=>"剧情ID102080103","TextValue"=>"你不是说我们已经分手了吗？那你为什么还在关心这些？"],
18107=>["Value"=>18107,"TextKey"=>"剧情ID102080104","TextValue"=>"你就这么笃定我一定会同意？"],
18108=>["Value"=>18108,"TextKey"=>"剧情ID102080105","TextValue"=>"难道不是吗？这不就是你心心念念一直想要做的事吗？"],
18109=>["Value"=>18109,"TextKey"=>"剧情ID102080106","TextValue"=>"我……"],
18110=>["Value"=>18110,"TextKey"=>"剧情ID102080107","TextValue"=>"先生，女士，似乎有新的访客来了，我们可以先平静一下，待会儿再聊。"],
18111=>["Value"=>18111,"TextKey"=>"剧情ID102090201","TextValue"=>"原来是地板到了。速度比我想象的快很多啊。"],
18112=>["Value"=>18112,"TextKey"=>"剧情ID102090202","TextValue"=>"就是不知道是谁送的，这么仓促，把货送到就走了。"],
18113=>["Value"=>18113,"TextKey"=>"剧情ID102090203","TextValue"=>"希望他们能及时停下争论，好好沟通。总之，转移下注意力，先帮我换上地板吧！"],
18114=>["Value"=>18114,"TextKey"=>"剧情ID102100101","TextValue"=>"是地板到了。"],
18115=>["Value"=>18115,"TextKey"=>"剧情ID102100102","TextValue"=>"哎，我这个老腰，可没法儿铺这么大面积的地板啊。"],
18116=>["Value"=>18116,"TextKey"=>"剧情ID102100103","TextValue"=>"请原谅我的失职，不过，我们为什么不早点把它们换上呢？"],
18117=>["Value"=>18117,"TextKey"=>"剧情ID102100104","TextValue"=>"怎么会，你的身体不是最健康的吗，难道最近……"],
18118=>["Value"=>18118,"TextKey"=>"剧情ID102100105","TextValue"=>"咳咳，是啊，不是什么大问题，只是有些疲劳。"],
18119=>["Value"=>18119,"TextKey"=>"剧情ID102100106","TextValue"=>"梅林先生，那您快休息一下吧，交给我，……还有本杰明好了。"],
18120=>["Value"=>18120,"TextKey"=>"剧情ID102110101","TextValue"=>"先生，如果您愿意，可以留下来帮我这把老骨头啊。女士，您觉得呢？"],
18121=>["Value"=>18121,"TextKey"=>"剧情ID102110102","TextValue"=>"（本杰明说的没错，我的确需要这些帮助……）"],
18122=>["Value"=>18122,"TextKey"=>"剧情ID102110103","TextValue"=>"（他想要留下来，可是，这个小镇真的太小了，无法让他进行他的设计。）"],
18123=>["Value"=>18123,"TextKey"=>"剧情ID102110104","TextValue"=>"本杰明可以留下来。可是我还不想签这些文件。"],
18124=>["Value"=>18124,"TextKey"=>"剧情ID102110105","TextValue"=>"反正，没多久，你也要走的。"],
18125=>["Value"=>18125,"TextKey"=>"剧情ID102110106","TextValue"=>"不，我已经下定决心要留在这里了！"],
18126=>["Value"=>18126,"TextKey"=>"剧情ID102110201","TextValue"=>"没关系没关系，总之，我们可以先把精力放在修缮房屋上。"],
18127=>["Value"=>18127,"TextKey"=>"剧情ID102120101","TextValue"=>"这里还算宽敞，但放了不少杂物。"],
18128=>["Value"=>18128,"TextKey"=>"剧情ID102120102","TextValue"=>"我们可以先收拾出来，让女士的房门附近有一个整洁的环境，如何？"],
18129=>["Value"=>18129,"TextKey"=>"剧情ID102120103","TextValue"=>"您休息，让我来吧。"],
18130=>["Value"=>18130,"TextKey"=>"剧情ID102120104","TextValue"=>"这些杂物看起来十分笨重，还是交给我吧。"],
18131=>["Value"=>18131,"TextKey"=>"剧情ID102130101","TextValue"=>"这里布置一个小的休闲区怎么样？"],
18132=>["Value"=>18132,"TextKey"=>"剧情ID102130102","TextValue"=>"不错，面积刚好合适。"],
18133=>["Value"=>18133,"TextKey"=>"剧情ID102130103","TextValue"=>"可以先铺一个地毯，这样休息的时候踩上去，会十分舒服放松。"],
18134=>["Value"=>18134,"TextKey"=>"剧情ID102130104","TextValue"=>"原来你还记得……"],
18135=>["Value"=>18135,"TextKey"=>"剧情ID102130105","TextValue"=>"什么？"],
18136=>["Value"=>18136,"TextKey"=>"剧情ID102130106","TextValue"=>"没什么。"],
18137=>["Value"=>18137,"TextKey"=>"剧情ID102140101","TextValue"=>"只有脚垫的话，还是会显得有些空荡。"],
18138=>["Value"=>18138,"TextKey"=>"剧情ID102140102","TextValue"=>"不如增加一个沙发，这样可以看看书，享受美好的午后时光。"],
18139=>["Value"=>18139,"TextKey"=>"剧情ID102140103","TextValue"=>"可以，我很喜欢。"],
18140=>["Value"=>18140,"TextKey"=>"剧情ID102140104","TextValue"=>"好吧，勉强可以让你用。"],
18141=>["Value"=>18141,"TextKey"=>"剧情ID102150101","TextValue"=>"这里空出来的空间，不如放一个置物架？"],
18142=>["Value"=>18142,"TextKey"=>"剧情ID102150102","TextValue"=>"可以摆放你获得过的设计奖项。放在这里刚刚好！"],
18143=>["Value"=>18143,"TextKey"=>"剧情ID102150103","TextValue"=>"好吧。我自己都还没想起来这回事呢……"],
18144=>["Value"=>18144,"TextKey"=>"剧情ID102150104","TextValue"=>"我就知道。"],
18145=>["Value"=>18145,"TextKey"=>"剧情ID102160101","TextValue"=>"这些墙纸看上去也十分陈旧了。"],
18146=>["Value"=>18146,"TextKey"=>"剧情ID102160102","TextValue"=>"不过谢天谢地，墙看上去还不错。"],
18147=>["Value"=>18147,"TextKey"=>"剧情ID102160103","TextValue"=>"女士，不如选一下你喜欢的墙纸类型吧？"],
18148=>["Value"=>18148,"TextKey"=>"剧情ID102170101","TextValue"=>"不知不觉已经这么晚了。"],
18149=>["Value"=>18149,"TextKey"=>"剧情ID102170102","TextValue"=>"的确，先生，奥罗拉小姐，不如去早点休息吧。"],
18150=>["Value"=>18150,"TextKey"=>"剧情ID102170103","TextValue"=>"我去和奥罗拉一起住好了。"],
18151=>["Value"=>18151,"TextKey"=>"剧情ID102170104","TextValue"=>"不可以！"],
18152=>["Value"=>18152,"TextKey"=>"剧情ID102170105","TextValue"=>"好吧。"],
18153=>["Value"=>18153,"TextKey"=>"剧情ID102170106","TextValue"=>"绅士都应该尊重女士的意愿。来吧，这位绅士，我为您带路后面的房间。"],
18154=>["Value"=>18154,"TextKey"=>"剧情ID102170301","TextValue"=>"新的一天"],
18155=>["Value"=>18155,"TextKey"=>"剧情ID103010101","TextValue"=>"主人，快快快来，你的老伙计们到了！"],
18156=>["Value"=>18156,"TextKey"=>"剧情ID103010102","TextValue"=>"嘿，安静点！小奥还没起床！"],
18157=>["Value"=>18157,"TextKey"=>"剧情ID103010201","TextValue"=>"天啊！起司，小八，你们俩怎么在这里？"],
18158=>["Value"=>18158,"TextKey"=>"剧情ID103010202","TextValue"=>"梅林，是你从酒店里带到这的吗？"],
18159=>["Value"=>18159,"TextKey"=>"剧情ID103010203","TextValue"=>"不，不是我。我刚到老宅门口，就看见他俩早早在这等着了。"],
18160=>["Value"=>18160,"TextKey"=>"剧情ID103010204","TextValue"=>"一定是趁保姆不注意偷偷从酒店溜了出来。"],
18161=>["Value"=>18161,"TextKey"=>"剧情ID103010205","TextValue"=>"那好吧！既来之则安之，我看就不必送回去了。"],
18162=>["Value"=>18162,"TextKey"=>"剧情ID103010206","TextValue"=>"收到！"],
18163=>["Value"=>18163,"TextKey"=>"剧情ID103020101","TextValue"=>"让我带你们看一看我们的新家吧！喔喔！"],
18164=>["Value"=>18164,"TextKey"=>"剧情ID103020102","TextValue"=>"汪汪！汪汪！汪！（开心！新家真棒！哈哈！）"],
18165=>["Value"=>18165,"TextKey"=>"剧情ID103020103","TextValue"=>"喵喵！喵喵！喵!（哦不！本杰明破产了！）"],
18166=>["Value"=>18166,"TextKey"=>"剧情ID103020201","TextValue"=>"大清早的好吵啊"],
18167=>["Value"=>18167,"TextKey"=>"剧情ID103020202","TextValue"=>"天啊！起司，小八，我想死你们了！"],
18168=>["Value"=>18168,"TextKey"=>"剧情ID103020203","TextValue"=>"咳！是我吩咐管家把他们接过来的，我想你见到他俩一定会很开心！"],
18169=>["Value"=>18169,"TextKey"=>"剧情ID103020204","TextValue"=>"好吧，那谢谢了，你总算开窍了。"],
18170=>["Value"=>18170,"TextKey"=>"剧情ID103020205","TextValue"=>"汪汪！汪汪！汪！（开心！本本真棒！哈哈！）"],
18171=>["Value"=>18171,"TextKey"=>"剧情ID103020206","TextValue"=>"喵喵！喵喵！喵!（相信我，他一定另有所图。）"],
18172=>["Value"=>18172,"TextKey"=>"剧情ID103030101","TextValue"=>"梅林还打算为你的爱猫购置新的小窝，你快来看。"],
18173=>["Value"=>18173,"TextKey"=>"剧情ID103030102","TextValue"=>"嗯，代我谢谢他。也谢谢你咯~"],
18174=>["Value"=>18174,"TextKey"=>"剧情ID103040101","TextValue"=>"新猫窝换好了，但总感觉和这个老客厅格格不入"],
18175=>["Value"=>18175,"TextKey"=>"剧情ID103040102","TextValue"=>"你不是会插花吗？不如把这里的花瓶装满鲜花？"],
18176=>["Value"=>18176,"TextKey"=>"剧情ID103040103","TextValue"=>"好主意！"],
18177=>["Value"=>18177,"TextKey"=>"剧情ID103050101","TextValue"=>"喵，喵喵！（嘿，说真的你们是不是破产了？）"],
18178=>["Value"=>18178,"TextKey"=>"剧情ID103050102","TextValue"=>"喵喵，喵！（那我以后是不是吃不到进口猫粮了...）"],
18179=>["Value"=>18179,"TextKey"=>"剧情ID103050103","TextValue"=>"哇，起司今天话好多呀，好可爱的小猫咪"],
18180=>["Value"=>18180,"TextKey"=>"剧情ID103050104","TextValue"=>"喵嗷！（你到底有没有在认真听我说话？）"],
18181=>["Value"=>18181,"TextKey"=>"剧情ID103050105","TextValue"=>"你还没吃早餐吧！别担心，我马上就把你小肚子喂的饱饱的！"],
18182=>["Value"=>18182,"TextKey"=>"剧情ID103050106","TextValue"=>"喵~（也行吧，我饿了。）"],
18183=>["Value"=>18183,"TextKey"=>"剧情ID103060101","TextValue"=>"汪汪！汪汪汪！（忙完了吗？快陪我玩！)"],
18184=>["Value"=>18184,"TextKey"=>"剧情ID103060102","TextValue"=>"哦天啊，差点把你忘了！你也得有个小窝才行，跟我来吧小八！"],
18185=>["Value"=>18185,"TextKey"=>"剧情ID103060103","TextValue"=>"过了一会儿……"],
18186=>["Value"=>18186,"TextKey"=>"剧情ID103060201","TextValue"=>"看我为你手工打造的狗狗豪宅！你觉得怎么样？"],
18187=>["Value"=>18187,"TextKey"=>"剧情ID103060202","TextValue"=>"汪汪！汪汪汪！（本本好厉害！喜欢！)"],
18188=>["Value"=>18188,"TextKey"=>"剧情ID103060203","TextValue"=>"我好像听见你的肚子都咕噜咕噜叫了。我马上打电话订购狗粮！"],
18189=>["Value"=>18189,"TextKey"=>"剧情ID103070101","TextValue"=>"奇怪？怎么没有信号…得想个法子解决才好。"],
18190=>["Value"=>18190,"TextKey"=>"剧情ID103070201","TextValue"=>"梅林，这里的手机信号怎么如此之差？"],
18191=>["Value"=>18191,"TextKey"=>"剧情ID103070202","TextValue"=>"是这样主人，昨夜大风挂断了电缆，现正抢修，预计要两天才能恢复。"],
18192=>["Value"=>18192,"TextKey"=>"剧情ID103070203","TextValue"=>"维修期间就让我先接入一部座机应急吧！"],
18193=>["Value"=>18193,"TextKey"=>"剧情ID103080101","TextValue"=>"哇，干的不错嘛！辛苦了，我的老伙计。"],
18194=>["Value"=>18194,"TextKey"=>"剧情ID103080102","TextValue"=>"不如来吧台休息一会，让我为你特调一杯我的招牌鸡尾酒！"],
18195=>["Value"=>18195,"TextKey"=>"剧情ID103080103","TextValue"=>"不，不行主人，现在才下午一点，喝酒还太早了吧…"],
18196=>["Value"=>18196,"TextKey"=>"剧情ID103080104","TextValue"=>"放心，我可以做无酒精的，不会耽误你工作的。"],
18197=>["Value"=>18197,"TextKey"=>"剧情ID103080105","TextValue"=>"那好吧…就一杯。"],
18198=>["Value"=>18198,"TextKey"=>"剧情ID103090101","TextValue"=>"嗯？我总觉得这里还缺点什么…对了，不如铺一块地毯。"],
18199=>["Value"=>18199,"TextKey"=>"剧情ID103090102","TextValue"=>"今后主人和奥罗拉小姐两个人在这喝酒会更有情调。"],
18200=>["Value"=>18200,"TextKey"=>"剧情ID103100101","TextValue"=>"嗯，既然地毯有了，不如顺便把桌椅也升级一番。"],
18201=>["Value"=>18201,"TextKey"=>"剧情ID103100102","TextValue"=>"这样我就可以安排他们两人在这吃烛光晚餐。然后再喝杯睡前酒。"],
18202=>["Value"=>18202,"TextKey"=>"剧情ID103100103","TextValue"=>"借着醉意，四目相对…… 我可真是最牛的僚机！"],
18203=>["Value"=>18203,"TextKey"=>"剧情ID103110101","TextValue"=>"哦天，一转眼都下午了，肚子好饿呀"],
18204=>["Value"=>18204,"TextKey"=>"剧情ID103110102","TextValue"=>"去厨房简单的做个花生果酱三明治垫一垫肚子好了。"],
18205=>["Value"=>18205,"TextKey"=>"剧情ID103110103","TextValue"=>"本杰明来到厨房……"],
18206=>["Value"=>18206,"TextKey"=>"剧情ID103110201","TextValue"=>"这……难道就是传说中的战损风装潢？奥罗拉姨妈的品味可真是让人“耳目一新”呢！"],
18207=>["Value"=>18207,"TextKey"=>"剧情ID103110202","TextValue"=>"瞧瞧，我们的室内设计师蜘蛛一家正在现场演示……蛛丝软装的妙用"],
18208=>["Value"=>18208,"TextKey"=>"剧情ID103110203","TextValue"=>"非常抱歉，蜘蛛朋友们，我还是得请你们离开，奥罗拉怕你们怕的要死。"],
18209=>["Value"=>18209,"TextKey"=>"剧情ID103120101","TextValue"=>"呼！总算搞定了。终于可以制作我最爱的花生果酱三明治了。"],
18210=>["Value"=>18210,"TextKey"=>"剧情ID103120102","TextValue"=>"让我翻一翻橱柜看看果酱都藏在哪。啊啊啊——"],
18211=>["Value"=>18211,"TextKey"=>"剧情ID103120103","TextValue"=>"橱柜门在翻找过程中掉落……"],
18212=>["Value"=>18212,"TextKey"=>"剧情ID103120201","TextValue"=>"看来我的美味三明治还要再等等了"],
18213=>["Value"=>18213,"TextKey"=>"剧情ID103120202","TextValue"=>"橱柜的合页都松动了，砸到奥罗拉就糟了。"],
18214=>["Value"=>18214,"TextKey"=>"剧情ID103130101","TextValue"=>"本杰明终于吃上了三明治……"],
18215=>["Value"=>18215,"TextKey"=>"剧情ID103130102","TextValue"=>"嗝……不敢相信忙了一天才吃了一顿饭。"],
18216=>["Value"=>18216,"TextKey"=>"剧情ID103130103","TextValue"=>"明天一定要早起，做一顿豪华早餐，再来上一杯双份意式浓缩，美滋滋……"],
18217=>["Value"=>18217,"TextKey"=>"剧情ID103130104","TextValue"=>"哦，不妙！我虽然带了阿拉比卡咖啡豆，但我还缺少一台像样的咖啡机。"],
18218=>["Value"=>18218,"TextKey"=>"剧情ID103140101","TextValue"=>"我看到你今天完成了不少事情，甚至还装了一台崭新的咖啡机。不错。"],
18219=>["Value"=>18219,"TextKey"=>"剧情ID103140102","TextValue"=>"嘿嘿，没什么，明天早上可以邀请你一起吃早饭吗？"],
18220=>["Value"=>18220,"TextKey"=>"剧情ID103140103","TextValue"=>"我……好吧。但是我有一个要求就是我来做，你的厨艺可实在不敢恭维。"],
18221=>["Value"=>18221,"TextKey"=>"剧情ID103140104","TextValue"=>"你想吃培根煎蛋还是三文鱼贝果？"],
18222=>["Value"=>18222,"TextKey"=>"剧情ID103140105","TextValue"=>"你是大厨你来选吧。只要是你做的我都爱吃！"],
18223=>["Value"=>18223,"TextKey"=>"剧情ID103140106","TextValue"=>"*脸红*咳咳咳，现在不早了，我要睡觉了，晚安！"],
18224=>["Value"=>18224,"TextKey"=>"剧情ID103140107","TextValue"=>"晚安！明早见！"],
18225=>["Value"=>18225,"TextKey"=>"剧情ID104010101","TextValue"=>"天哪！Hatchi你做了什么，我的电脑！"],
18226=>["Value"=>18226,"TextKey"=>"剧情ID104010201","TextValue"=>"怎么了？"],
18227=>["Value"=>18227,"TextKey"=>"剧情ID104010202","TextValue"=>"我的咖啡，被Hatchi洒在了电脑上！希望不要故障啊！"],
18228=>["Value"=>18228,"TextKey"=>"剧情ID104010203","TextValue"=>"Hatchi跑掉的时候，嘴里似乎还叼着什么。"],
18229=>["Value"=>18229,"TextKey"=>"剧情ID104010204","TextValue"=>"叼着什么……等等，不会吧！"],
18230=>["Value"=>18230,"TextKey"=>"剧情ID104020101","TextValue"=>"我的巧克力慕斯！"],
18231=>["Value"=>18231,"TextKey"=>"剧情ID104020102","TextValue"=>"乖狗狗，吐出来！不可以吃！"],
18232=>["Value"=>18232,"TextKey"=>"剧情ID104020103","TextValue"=>"嗷呜……"],
18233=>["Value"=>18233,"TextKey"=>"剧情ID104030101","TextValue"=>"Hatchi，你可真是吓到我了！"],
18234=>["Value"=>18234,"TextKey"=>"剧情ID104030102","TextValue"=>"差一点你都有生命危险了知不知道！"],
18235=>["Value"=>18235,"TextKey"=>"剧情ID104030103","TextValue"=>"嗷呜。"],
18236=>["Value"=>18236,"TextKey"=>"剧情ID104030104","TextValue"=>"哎，还好来得及时。"],
18237=>["Value"=>18237,"TextKey"=>"剧情ID104030105","TextValue"=>"傻狗狗，来吧，吃些狗粮。"],
18238=>["Value"=>18238,"TextKey"=>"剧情ID104040101","TextValue"=>"咳咳，这里的灰尘可真不少。"],
18239=>["Value"=>18239,"TextKey"=>"剧情ID104040102","TextValue"=>"不好意思，我注意到这些箱子里是一些旧物，为了隐私考虑，没有您的允许，我一直没有收拾。"],
18240=>["Value"=>18240,"TextKey"=>"剧情ID104040103","TextValue"=>"谢谢你的细心，梅林先生。"],
18241=>["Value"=>18241,"TextKey"=>"剧情ID104040104","TextValue"=>"我自己来收拾吧，我很喜欢收拾旧物的感觉。"],
18242=>["Value"=>18242,"TextKey"=>"剧情ID104040105","TextValue"=>"当然可以。"],
18243=>["Value"=>18243,"TextKey"=>"剧情ID104050101","TextValue"=>"有不少旧书。"],
18244=>["Value"=>18244,"TextKey"=>"剧情ID104050102","TextValue"=>"姨妈一直喜欢看各种书，每当我跑到她房间的时候，总是能看到她手边桌边放着几本书。"],
18245=>["Value"=>18245,"TextKey"=>"剧情ID104050103","TextValue"=>"居然还有小时候她带我一起读的绘本！"],
18246=>["Value"=>18246,"TextKey"=>"剧情ID104050104","TextValue"=>"不如放一个书架在这边吧，把这些书都好好整理一下。"],
18247=>["Value"=>18247,"TextKey"=>"剧情ID104060101","TextValue"=>"正好，旁边的壁炉也可以收拾一下。"],
18248=>["Value"=>18248,"TextKey"=>"剧情ID104060102","TextValue"=>"把这片区域一起整理好，这样客人来的时候才不至于失礼。"],
18249=>["Value"=>18249,"TextKey"=>"剧情ID104060103","TextValue"=>"好主意，梅林。"],
18250=>["Value"=>18250,"TextKey"=>"剧情ID104060104","TextValue"=>"好的，先生、女士，对壁炉的外观有什么要求？"],
18251=>["Value"=>18251,"TextKey"=>"剧情ID104070101","TextValue"=>"总觉得房间里还少了一些什么。"],
18252=>["Value"=>18252,"TextKey"=>"剧情ID104070102","TextValue"=>"的确，嗯……还少了一些绿色？"],
18253=>["Value"=>18253,"TextKey"=>"剧情ID104070103","TextValue"=>"没错！我们可以摆放一些植物。要注意位置，别让那两个小家伙给撞翻了。"],
18254=>["Value"=>18254,"TextKey"=>"剧情ID104080101","TextValue"=>"除了书，还有不少零星的小摆件儿。"],
18255=>["Value"=>18255,"TextKey"=>"剧情ID104080102","TextValue"=>"虽然都很别致，但不太适合现在房间的装潢。"],
18256=>["Value"=>18256,"TextKey"=>"剧情ID104080103","TextValue"=>"不如先将它们收到阁楼？请您放心，交给我吧。"],
18257=>["Value"=>18257,"TextKey"=>"剧情ID104090101","TextValue"=>"小心！"],
18258=>["Value"=>18258,"TextKey"=>"剧情ID104090102","TextValue"=>"小心！"],
18259=>["Value"=>18259,"TextKey"=>"剧情ID104090103","TextValue"=>"呼，吓我一跳……我没事。"],
18260=>["Value"=>18260,"TextKey"=>"剧情ID104090104","TextValue"=>"这里的楼梯老化得很厉害……"],
18261=>["Value"=>18261,"TextKey"=>"剧情ID104090105","TextValue"=>"要赶紧修缮啊，不然就成了安全隐患！"],
18262=>["Value"=>18262,"TextKey"=>"剧情ID104100101","TextValue"=>"还有，扶手也要一起更换。"],
18263=>["Value"=>18263,"TextKey"=>"剧情ID104100102","TextValue"=>"我也来帮忙。"],
18264=>["Value"=>18264,"TextKey"=>"剧情ID104110101","TextValue"=>"刚刚我接到了镇长的电话。"],
18265=>["Value"=>18265,"TextKey"=>"剧情ID104110102","TextValue"=>"奥罗拉，你知道镇子东南面有一家小小的裁缝店吗？"],
18266=>["Value"=>18266,"TextKey"=>"剧情ID104110103","TextValue"=>"我记得，小时候姨妈还和我去过。"],
18267=>["Value"=>18267,"TextKey"=>"剧情ID104110104","TextValue"=>"昨晚以那间裁缝店为起点，发生了一场火灾。"],
18268=>["Value"=>18268,"TextKey"=>"剧情ID104110105","TextValue"=>"什么？！有人受伤吗？"],
18269=>["Value"=>18269,"TextKey"=>"剧情ID104110106","TextValue"=>"万幸没有人员伤亡，但是财产损失很大，相邻的一些房子也遭了殃。"],
18270=>["Value"=>18270,"TextKey"=>"剧情ID104120101","TextValue"=>"工作人员已经完成了初步的安置工作，难点在于缺乏资金进行进一步的修整。"],
18271=>["Value"=>18271,"TextKey"=>"剧情ID104120102","TextValue"=>"所以资金……"],
18272=>["Value"=>18272,"TextKey"=>"剧情ID104120103","TextValue"=>"对，就是你想的那样。只要你签字，第一笔资金就会到账。"],
18273=>["Value"=>18273,"TextKey"=>"剧情ID104120104","TextValue"=>"……"],
18274=>["Value"=>18274,"TextKey"=>"剧情ID104120105","TextValue"=>"没想到你真的做到了这种地步。"],
18275=>["Value"=>18275,"TextKey"=>"剧情ID104120106","TextValue"=>"我只能这么做。所以，你的决定是？"],
18276=>["Value"=>18276,"TextKey"=>"剧情ID104120107","TextValue"=>"合作愉快。今后，你就是我的“监工”了。"],
18277=>["Value"=>18277,"TextKey"=>"剧情ID104130101","TextValue"=>"既然这样，不如就正式签署这些文件吧？"],
18278=>["Value"=>18278,"TextKey"=>"剧情ID104130102","TextValue"=>"签好之后，先生也可以放心了呢。"],
18279=>["Value"=>18279,"TextKey"=>"剧情ID104130103","TextValue"=>"放心，既然决定了我就不会后悔的。"],
18280=>["Value"=>18280,"TextKey"=>"剧情ID104140101","TextValue"=>"大厅基本上已经修缮完毕了呢。"],
18281=>["Value"=>18281,"TextKey"=>"剧情ID104140102","TextValue"=>"还差这里！这个门显得格格不入，十分老旧了。"],
18282=>["Value"=>18282,"TextKey"=>"剧情ID104140103","TextValue"=>"每次开关都要小心翼翼的，要是砸到两小只就糟糕了。"],
18283=>["Value"=>18283,"TextKey"=>"剧情ID104150101","TextValue"=>"你的卧室设计得不错嘛，看着就知道待着很舒服。"],
18284=>["Value"=>18284,"TextKey"=>"剧情ID104150102","TextValue"=>"就算你这么说，我也不会让你住进来的！"],
18285=>["Value"=>18285,"TextKey"=>"剧情ID104150103","TextValue"=>"哈哈，戒心不要这么重。给你增加几盆绿植怎么样？"],
18286=>["Value"=>18286,"TextKey"=>"剧情ID104150104","TextValue"=>"梅林购入了很多绿植，他会打理好每一棵的。"],
18287=>["Value"=>18287,"TextKey"=>"剧情ID104160101","TextValue"=>"今天真是忙碌充实的一天啊。不过，客厅总算是有个样子了。"],
